/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<div class=\"innerbanner\" style=\"background-color:#000\">\n    <img src=\"../assets/images/cours-particuliers-de-tennis.jpg\" style=\"width:100%;opacity:0.8\" alt=\"Los Angeles\">\n    <div class=\"inner_carousel\">\n        <h3>COURS TENNIS</h3>\n    </div>\n</div>\n<!-- Banner ends -->\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n    <div class=\"banner_container\">\n        <h3>Réservez un cours particulier</h3>\n        <div class=\"row\">\n            <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n                <div class=\"form-group\">\n                    <div class=\"addon-lg\">\n                        <input class=\"form-control\" id=\"\" maxlength=\"6\" placeholder=\"Code Postal\" [(ngModel)]=\"Ville\"\n                            type=\"text\" />\n                        <label><img src=\"./assets/images/ville_icon.png\" /></label>\n                    </div>\n                </div>\n            </div>\n            <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n                <div class=\"form-group\">\n                    <div class=\"addon-lg\">\n                        <input type=\"text\" style=\"text-align:left!important;\" [min]=\"min\" class=\"form-control\" id=\"\"\n                            placeholder=\"Date\" [(ngModel)]=\"Date\" [owlDateTime]=\"dt1\" [owlDateTimeTrigger]=\"dt1\" />\n                        <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n                        <label><img src=\"./assets/images/date_icon.png\" /> </label>\n                    </div>\n                </div>\n            </div>\n            <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n                <button class=\"btn black_btn\">\n                    Rechercher\n                </button>\n            </div>\n        </div>\n    </div>\n</div>\n<!-- Inner Search area ends -->\n<!-- section1 starts -->\n<div class=\"sec_news section1 des_concept_list haspadd\">\n    <div class=\"container\">\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"page_title_div\">\n                    <h1 class=\"page_title\">Ohmytennis : cours tennis</h1>\n                    <img src=\"../assets/images/title_border.png\" alt=\"title_border\" />\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Cours particuliers de tennis</h2>\n                    <p>Réserver votre professeur de tennis près de chez vous afin de bénéficier de conseils\n                        personnalisés. Formule à a la carte pour joueur souhaitant prendre des cours de tennis soit\n                        intensivement soit un peu plus ponctuellement.</p>\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Cours collectifs de tennis</h2>\n                    <p>Vous pouvez prendre des cours collectifs tennis de deux façons différentes , vous pouvez décidez\n                        avec un groupe d’amis, qui ont les mêmes disponibilités que vous, de mutualiser le coût pour\n                        jouer de façon intensive ou plus ponctuelle avec un moniteur de tennis. L’autre solution\n                        consiste à piocher dans le catalogue de cours collectifs organisés par les clubs de tennis\n                        partenaires avec un rendez vous régulier par semaine durant la période scolaires (engagement sur\n                        environ 30 séances à l’année).</p>\n                        <p><strong><a class=\"content_link\"  routerLink=\"{{\n                            '/' + this._const('PATH.OH_MY_COACH_NEW')\n                            }}\">Découvrez notre offre concernant les cours de tennis\n                            collectifs</a></strong></p>\n                </div>\n            </div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Stages de tennis</h2>\n                    <p>Si vous souhaitez découvrir le tennis pour savoir si cela vous plait avant de vous engager de\n                        façon plus ferme , la solution du stage peut être intéressant pour vous. Organisés sur une\n                        semaine souvent pendant les vacances scolaires , les stages vous permettent de jouer de façon\n                        très intensive pendant une courte période pour progresser rapidement. Ils peuvent être à\n                        destination d’un public enfant (en journée) ou adulte (début de soirée).</p>\n                    <p><strong><a class=\"content_link\"  routerLink=\"{{\n                        '/' + this._const('PATH.stage-tennis')\n                        }}\">Découvrez notre offre concernant les stage de\n                        tennis</a></strong></p>\n                </div>\n            </div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Team building tennis</h2>\n                    <p>Vous avez envie de motiver votre équipe d’entreprise par le biais du terrain de tennis avec un\n                        encadrant professionnel. Nous vous permettons de vivre des émotions qui renforceront vos liens\n                        au quotidien grâce à des souvenirs indélébiles de victoires ou de défaites. Ce sera l’occasion\n                        de vous découvrir dans un contexte différents de celui des bureaux car le sport permet d’avoir\n                        une approche plus détendue et joviale.</p>\n                </div>\n            </div>\n        </div>\n\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Animations tennis</h2>\n                    <p>Rendez vous sur le terrain pour s’amuser et découvrir des support inédits pour pour jouer au\n                        tennis : radar de vitesse au service pour mesurer votre puissance , découvrir le tennis connecté\n                        avec des statistiques concernant votre jeu (volume de frappes , qualité de centrage, rotation de\n                        la balles , vitesse de balle , vitesse de raquette) structure gonflable de tennis pour les\n                        enfants (précision , côté ludique de la discipline) , lance balle (jouer contre un machine qui\n                        vous envoie des balles de façon automatique , vous pouvez régler la vitesse , les effets pour\n                        mieux progresser).</p>\n                </div>\n            </div>\n        </div>\n\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Anniversaire tennis</h2>\n                    <p>Nous organisons l’anniversaire des enfants ou des adultes autour du thème du tennis pour\n                        s’éclater pendant un après-midi . Il y aura bien sur des gâteaux , des bonbons et des boissons\n                        pour clôturer cet événement.</p>\n                    <!-- <p><strong><a class=\"content_link\" href=\"\">Découvrez comment rechercher de partenaires</a></strong></p> -->\n\n                    <p><strong><a class=\"content_link\"  routerLink=\"{{\n                        '/' + this._const('PATH.TENNIS.RECHERCHEPARTENAIRE.SELF')\n                        }}\">Découvrez comment rechercher de partenaires</a></strong></p>\n                </div>\n            </div>\n        </div>\n\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Recherche de partenaires de tennis</h2>\n                    <p>Retrouvez des personnes de votre niveau près de chez vous disponibles pour jouer au tennis. Ce\n                        sera l’occasion pour vous de jouer avec des personnes différentes si vous avez déjà un\n                        partenaire ou d’en trouver si cela fait longtemps que vous en cherchez. </p>\n                    <!-- <p><strong><a class=\"content_link\" href=\"\">Découvrez notre offre concernant la recherche de\n                                partenaires</a></strong></p> -->\n                </div>\n            </div>\n        </div>\n\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Participation à des tournois amicaux de tennis</h2>\n                    <p>Apprenez à gérer votre stress en participant à un tournoi non officiel vous permettant de vous\n                        confronter avec des inconnus sous forme de matchs en petits formats pour commencer à vous\n                        habituer. Le but est de rencontrer plusieurs jeux différents pour voir votre capacité\n                        d’adaptation selon votre adversaire.</p>\n                </div>\n            </div>\n        </div>\n\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Participation à des tournois officiels de tennis</h2>\n                    <p>C’est l’expérience ultime du pratiquant pour plonger dans le grand bain et se tester en condition\n                        réelle. Votre participation doit d’abord être soumise à l’aval de votre professeur de tennis\n                        référent car c’est lui qui vous connait le mieux. Cette étape doit être une suite logique de vos\n                        matchs amicaux où vous vous sentez de plus en plus à l’aise : vous arrivez à gérer un minimum\n                        les situations de stress , l’environnement ne vous semble pas anxiogène bref vous êtes bien sur\n                        le terrain et prêt à donner le meilleur de vous même pour gagner. N’oubliez pas que cette\n                        participation se fait avec la licence et un certificat médical sinon il vous sera impossible de\n                        jouer.</p>\n                </div>\n            </div>\n        </div>\n\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Guide des terrains de tennis</h2>\n                    <p>Vous avez une envie irrésistible de jouer mais vous ne savez pas où et ce pour différentes\n                        raisons (vous venez de déménager, vous êtes en vacances , vous vous mettez au tennis pour la\n                        première fois). Ce guide vous recense la maximum de terrains en France pour jouer à votre guise.\n                        Nous vous conseillons de contacter le lieu qui vous intéresse pour y connaître les prix et\n                        conditions de réservations car ils diffèrent en fonction de l’heure, du terrain , de la région\n                        etc …</p>\n                </div>\n            </div>\n        </div>\n\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>E learning (cours de tennis en ligne)</h2>\n                    <p>Cette méthode de cours de tennis à distance vous permet de prolonger l’expérience terrain chez\n                        vous pour continuer à progresser. Vous avez évoqué un point technique, tactique, physique ou\n                        mental avec votre enseignant de tennis et bien il sera possible de se poser tranquillement chez\n                        vous par le biais de fiches et de vidéos qui seront vos tutoriels.</p>\n                </div>\n            </div>\n        </div>\n\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Histoire du tennis</h2>\n                    <p>Le tennis a évolué depuis son ancêtre le jeu de paume (invention Française au 13eme siècle) en\n                        passant par Lawn Tennis (invention des Anglais). Les règles , les tenues , les terrains , les\n                        infrastructures ainsi que l’organisation des tournois (et des classements) a changé au cours du\n                        temps pour permettre la pratique actuelle. Il est toujours intéressant de comprendre les\n                        différentes étapes qui nous ont amenées au jeu actuel que cela soit pour les pratiquants ou même\n                        les professionnels.</p>\n                </div>\n            </div>\n        </div>\n\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Lexique du tennis</h2>\n                    <p>Le tennis a son vocabulaire propre parfois incompris des néophytes. C’est une forme de langage\n                        qui réunit tous les termes de l’environnement du tennis avec ses acteurs (joueurs, coachs,\n                        organisateurs, spectateurs etc…) , ses éléments du jeu (terrains, matériels, lieux etc…) , les\n                        règles au tennis (cadre , loi définissant comment gagner ou perdre un point) , ainsi que les\n                        moyens utilisés pour gagner faisant référence à des termes techniques, tactiques, physiques ,\n                        mentaux qui sont très précis dans leur approche du jeu pour permettre de gagner le point.</p>\n                </div>\n            </div>\n        </div>\n\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Règles du tennis</h2>\n                    <p>Pour commencer à jouer des points il est nécessaire de savoir un minimum de principes vous\n                        permettant de savoir qui à gagner ou qui a perdu l’échange.\n                        Pour faire un match il y a également un nombre de règles minimum qu’il faut avoir en tête pour\n                        participer au bon déroulement de la rencontre.</p>\n                </div>\n            </div>\n        </div>\n\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Forum du tennis</h2>\n                    <p>vous pouvez échanger sur les différents sujets du tennis qui vous touchent avec d‘autres\n                        personnes du site internet. Vous avez un problème à régler, un coup de gueule , un sentiment à\n                        partager , ce sera l’endroit pour vous exprimer !</p>\n                </div>\n            </div>\n        </div>\n\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Vente de matériel de tennis</h2>\n                    <p>Rendez vous sur notre site internet pour acheter votre matériel de tennis (balle de tennis,\n                        chaussure de tennis, raquette de tennis) et vous faire livrer dans les plus brefs délais.\n                        Bénéficier des dernières promotions et des bons plans à venir pour s’équiper au mieux sur le\n                        terrain de tennis.</p>\n                </div>\n            </div>\n        </div>\n\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Recherche de sparring de tennis</h2>\n                    <p>vous recherchez un joueur de tennis un peu plus fort que vous pour vous mesurer à lui. Le\n                        sparring est un joueur de tennis et non pas un enseignant qui vient pour jouer avec vous et vous\n                        faire transpirer ! Il n’y a pas d’exercices lors de votre séance mais uniquement des balles ou\n                        carrément un match si vous le désirez.</p>\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Petites annonces de tennis</h2>\n                    <p>Notre site de petites annonces aide les particuliers à vendre ou échanger leur matériel de tennis\n                        s’ils le désirent. Si vous souhaitez vous débarrasser d’une vieille raquette de tennis en bon\n                        état qui traine dans votre cave pour vous en acheter une nouvelle ce service est fait pour vous\n                    </p>\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Quiz et jeu concours tennis</h2>\n                    <p>Apprenez sur le tennis en vous amusant et participez à nos quiz (questions à choix multiples) ou\n                        jeu concours pour tenter de gagner des points ou des cadeaux. Vous serez sûrement surpris de\n                        découvrir des événements , des performances ou encore des joueurs qui ont marqués l’histoire du\n                        tennis.</p>\n                </div>\n            </div>\n        </div>\n    </div>\n</div>\n<app-footer></app-footer>");

