/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<div class=\"innerbanner\" style=\"background-color:#000\">\n    <img src=\"../assets/images/cours-particuliers-de-tennis.jpg\" style=\"width:100%;opacity:0.8\" alt=\"Los Angeles\">\n    <div class=\"inner_carousel\">\n        <h3> </h3>\n    </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n    <div class=\"banner_container\">\n        <h3>Réservez un cours particulier</h3>\n        <div class=\"row\">\n            <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n                <div class=\"form-group\">\n                    <div class=\"addon-lg\">\n                        <input class=\"form-control\" id=\"\" maxlength=\"6\" placeholder=\"Code Postal\" [(ngModel)]=\"Ville\"\n                            type=\"text\" />\n                        <label><img src=\"./assets/images/ville_icon.png\" /></label>\n                    </div>\n                </div>\n            </div>\n            <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n                <div class=\"form-group\">\n                    <div class=\"addon-lg\">\n                        <input type=\"text\" style=\"text-align:left!important;\" [min]=\"min\" class=\"form-control\" id=\"\"\n                            placeholder=\"Date\" [(ngModel)]=\"Date\" [owlDateTime]=\"dt1\" [owlDateTimeTrigger]=\"dt1\" />\n                        <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n                        <label><img src=\"./assets/images/date_icon.png\" /> </label>\n                    </div>\n                </div>\n            </div>\n            <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n                <button (click)=\"handleClick($event)\" class=\"btn black_btn\">\n                    Rechercher\n                </button>\n            </div>\n        </div>\n    </div>\n</div>\n\n\n<div class=\"section1 des_concept_list haspadd\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"page_title_div\">\n\n                    <h1 class=\"page_title\">Ohmytennis : Devenez coach\n                    </h1>\n                    <img src=\"../assets/images/title_border.png\" alt=\"title_border\" />\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n\n                <div class=\"mid_contentdiv\">\n                    <h2 class=\"page_title\">Un réseau de professionnels du tennis (uniquement des diplômés d’etat)\n                    </h2>\n                    <ul>\n                        <li>Pour vous inscrire sur notre plateforme communautaire tennis vous devez être diplômé d’Etat\n                            et avoir un statut vous permettant d’exercer votre activité légalement\n                            (Auto-Entrepreneur).<a\n                                href=\"https://www.cfe.urssaf.fr/autoentrepreneur/CFE_Declaration\">https://www.cfe.urssaf.fr/autoentrepreneur/CFE_Declaration</a>\n                            (Domaine\n                            d’activité : Loisirs, Animations, cours de sport puis Choisissez votre activité : moniteur\n                            de tennis). Ce sont des préalables nécessaires pour pouvoir encadrer tous les publics (âge\n                            et niveau) sauf si vous proposez uniquement une offre pour un club de tennis. C’est un gage\n                            de qualité d’enseignement nécessaire pour intégrer notre plateforme Ohmytennis.\n                        </li>\n                    </ul>\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n\n                <div class=\"mid_contentdiv\">\n                    <h2>Un site 100% tennis fait par un moniteur de tennis pour les moniteurs de tennis\n\n                    </h2>\n                    <ul>\n                        <li>Grâce à mon activité de moniteur de tennis depuis une dizaine d’année j’ai pu constater\n                            quels étaient les besoins des moniteurs de tennis qui souhaitent développer leur activité.\n                            Vous pouvez organiser des cours particuliers , des cours collectifs à la demande et\n                            compléter des cours collectifs en club. Vous pouvez également organiser des stages , du team\n                            building , des animations et même des tournois amicaux ! L’idée est d’apporter une vraie\n                            valeur ajoutée à l’élève pour qu’il puisse bénéficier des mêmes services qu’un club de\n                            tennis.</li>\n\n                        <li>Découvrez notre offre de cours particuliers de tennis</li>\n                        <li>Découvrez notre proposition concernant les cours collectifs en club</li>\n                    </ul>\n                </div>\n            </div>\n\n            <div class=\"clearfix\"></div>\n        </div>\n\n\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n\n                <div class=\"mid_contentdiv\">\n                    <h2>10 ans d’expérience dans le web (premier site www.proftennis.com)</h2>\n                    <ul>\n                        <li>Le succès du premier site <a href=\"https://www.proftennis.com/\" target=\"_blank\">(www.proftennis.com)</a> créé en 2007 a permis d’envisager mon\n                            activité en plus grand tout en identifiant certains points perfectibles. Ohmytennis est une\n                            version aboutie et complète de tous les services et fonctionnalités nécessaires aux\n                            moniteurs pour développer leur activité mais aussi pour les élèves qui souhaitent pratiquer\n                            le tennis à fond. L’objectif est de mettre toute mon expérience au service des coachs et des\n                            élèves afin d’offrir le meilleur service possible.\n\n                        </li>\n                    </ul>\n                </div>\n            </div>\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n\n                <div class=\"mid_contentdiv\">\n                    <img src=\"./assets/images/devenir_coach.PNG\" class=\"center-block\" alt=\"coach tennis / coach de tennis\" />\n                </div>\n            </div>\n\n            <div class=\"clearfix\"></div>\n        </div>\n\n\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n\n                <div class=\"mid_contentdiv\">\n                    <h3> 4.Quelles sont les formules proposées pour les coachs Ohmytennis ?</h3>\n                    <ul>\n                        <li>Il existe deux types de formule que vous pouvez utiliser selon votre préférence :\n                        </li>\n                        <li>- Abonnement visibilité + commission : 40 euros/mois + 3% de commission sur chaque cours\n                        </li>\n                        <li>- Paiement uniquement à la commission : commission de 10% sur chaque cours\n\n                        </li>\n                    </ul>\n                </div>\n            </div>\n\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"page_title_div\">\n\n                    <h3 class=\"page_title\">REJOINDRE LA TEAM OHMYTENNIS\n                    </h3>\n                    <img src=\"../assets/images/title_border.png\" alt=\"title_border\" />\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n\n                <div class=\"mid_contentdiv\">\n                    <h3 class=\"page_title\">1. Qui peut s’inscrire au service Ohmycoach ?\n                    </h3>\n                    <ul>\n                        <li>L’inscription est gratuite, vous devez être Diplomé d’Etat de tennis et posséder un statut\n                            d’Auto entrepreneur (sauf si vous proposez uniquement une offre pour un club de tennis)\n                            <a\n                                href=\"https://www.cfe.urssaf.fr/autoentrepreneur/CFE_Declaration\">https://www.cfe.urssaf.fr/autoentrepreneur/CFE_Declaration</a>\n                            (Domaine d’activité : Loisirs,\n                            Animations, cours de sport puis Choisissez votre activité : moniteur de tennis)\n                        </li>\n                    </ul>\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n\n                <div class=\"mid_contentdiv\">\n                    <h3>2. Quels sont les services dédiés aux coachs Ohmytennis ?\n                    </h3>\n                    <ul>\n                        <li>Chaque moniteur de tennis possède une fiche dédiée avec descriptif, planning ,\n                            commentaires/notes, , intervention géographique, possibilité de facturation , paiement en\n                            ligne ainsi qu’une application mobile. Tout ceci vous pemettra de trouver des nouveaux\n                            clients en permanence et de gérer la relation avec vos éléves sur le long terme</li>\n                    </ul>\n                </div>\n            </div>\n\n            <div class=\"clearfix\"></div>\n        </div>\n\n\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n\n                <div class=\"mid_contentdiv\">\n                    <h3>3. Que peut-on proposer comme services en tant que coach Ohmytennis ?</h3>\n                    <ul>\n                        <li>Il est possible de proposer en tant que coach Ohmytennis des cours particuliers , des cours\n                            collectifs la demande , des cours collectifs en club , des stages , des team building, des\n                            animations , des tournois amicaux. C’est à vous de choisir ce que vous voulez proposer !\n                        </li>\n                    </ul>\n                </div>\n            </div>\n\n            <div class=\"clearfix\"></div>\n        </div>\n\n\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n\n                <div class=\"mid_contentdiv\">\n                    <h3> 4.Quelles sont les formules proposées pour les coachs Ohmytennis ?</h3>\n                    <ul>\n                        <li>Il existe deux types de formule que vous pouvez utiliser selon votre préférence : \n                        </li>\n                        <li>- Abonnement visibilité + commission : 40 euros/mois  + 3% de commission sur chaque cours\n                        </li>\n                        <li>- Paiement uniquement à la commission : commission de 10% sur chaque cours\n\n                        </li>\n                    </ul>\n                </div>\n            </div>\n\n            <div class=\"clearfix\"></div>\n        </div>\n\n\n    </div>\n</div>\n\n\n<!-- <div class=\"section1 des_concept_list haspadd\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"page_title_div\">\n\n                    <h1 class=\"page_title\">REJOINDRE LA TEAM OHMYTENNIS\n                    </h1>\n                    <img src=\"../assets/images/title_border.png\" alt=\"title_border\" />\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n        \n    </div>\n</div> -->\n<!-- section1 ends -->\n\n<!-- section2 starts -->\n<div class=\"section2 des_concept_backtext\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"des_back_content\">\n                    <h4>Nous proposons aux passionnés de tennis d'avoir un univers spécialement créé pour eux.</h4>\n                </div>\n            </div>\n        </div>\n    </div>\n</div>\n<!-- section2 ends -->\n<app-footer></app-footer>");

