/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<div class=\"innerbanner\" style=\"background-color:#000\">\n    <img src=\"../assets/images/cours-particuliers-de-tennis.jpg\" style=\"width:100%;opacity:0.8\" alt=\"Los Angeles\">\n    <div class=\"inner_carousel\">\n        <h3>PROFESSEUR PARTICULIER DE TENNIS</h3>\n    </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n    <div class=\"banner_container\">\n        <h3>Réservez un cours particulier</h3>\n        <div class=\"row\">\n            <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n                <div class=\"form-group\">\n                    <div class=\"addon-lg\">\n                        <input class=\"form-control\" id=\"\" maxlength=\"6\" placeholder=\"Code Postal\" [(ngModel)]=\"Ville\"\n                            type=\"text\" />\n                        <label><img src=\"./assets/images/ville_icon.png\" /></label>\n                    </div>\n                </div>\n            </div>\n            <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n                <div class=\"form-group\">\n                    <div class=\"addon-lg\">\n                        <input type=\"text\" style=\"text-align:left!important;\" [min]=\"min\" class=\"form-control\" id=\"\"\n                            placeholder=\"Date\" [(ngModel)]=\"Date\" [owlDateTime]=\"dt1\" [owlDateTimeTrigger]=\"dt1\" />\n                        <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n                        <label><img src=\"./assets/images/date_icon.png\" /> </label>\n                    </div>\n                </div>\n            </div>\n            <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n                <button class=\"btn black_btn\">\n                    Rechercher\n                </button>\n            </div>\n        </div>\n    </div>\n</div>\n<!-- Inner Search area ends -->\n<!-- section1 starts -->\n<div class=\"sec_news section1 des_concept_list haspadd\">\n    <div class=\"container\">\n\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"page_title_div\">\n                    <h1 class=\"page_title\">Ohmytennis : professeur particulier de tennis</h1>\n                    <img src=\"../assets/images/title_border.png\" alt=\"title_border\" />\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Je souhaite réserver un professeur particulier de tennis , comment ca marche ? qui dois je payer\n                        ?</h2>\n                    <p>Sur la fiche du professeur le planning vous permet d’avoir un aperçu des disponibilités de chaque\n                        professeur partculier de tennis durant la semaine. Cliquez sur un créneau horaire pour faire une\n                        demande de réservation, celle ci sera ensuite validée par le moniteur de tennis une fois la\n                        réservation du terrain effectuée. Des emails de confirmation sont envoyés de part et d’autres à\n                        chaque étape. Lorsque vous prenez un cours avec le professeur vous le payer directement à la fin\n                        de la séance.</p>\n                    <!-- <p><strong><a class=\"content_link\" href=\"\">Découvrez notre offre concernant les professeur\n                                particulier de tennis</a></strong></p> -->\n\n                                <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                                    '/' + this._const('PATH.OH_MY_COACH_NEW')\n                                  }}\">Découvrez notre offre concernant les professeur\n                                  particulier de tennis</a></strong></p>\n\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Comment se pré-inscrire en cours collectif dans un club de tennis ? qui dois je payer ?</h2>\n                    <p>Vous êtes intéressés par un cours collectif dans un club de tennis. Une pré inscription vous sera\n                        demandée et vous verserez un acompte de la prestation pour réserver de façon ferme. Le solde du\n                        paiement de la prestation s’effectuera sur place.dans le club de tennis</p>\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>J’ai besoin de faire un devis pour du team building tennis , une animation ou un anniversaire\n                        tennis ? qui dois je payer ?</h2>\n                    <p>Pour obtenir une réponse il est nécessaire de préciser le nombre de personnes , le temps imparti\n                        à l’événement , le lieu , la date. En effet ce sont autant de paramètres qui peuvent avoir un\n                        influence sur le prix de la prestation proposée par les professionnels du tennis.\n                        Une pré inscription sera ensuite effectuée et vous verserez un acompte de la prestation pour\n                        réserver de façon ferme. Le solde du paiement de la prestation s’effectuera sur place.</p>\n\n                    <!-- <p><strong><a class=\"content_link\" href=\"\"> Découvrez notre offre concernant le team building\n                                tennis</a></strong></p> -->\n\n                                <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                                    '/' + this._const('PATH.OH_MY_EVENT_NEW')\n                                  }}\">Découvrez notre offre concernant le team building\n                                tennis</a></strong></p>\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Comment marche le système de cours de tennis en ligne via votre site web ?</h2>\n                    <p>Vous avez la possibilité d’accéder à différentes prestations d’e-learning : chaque point abordé\n                        possède deux vidéos et deux fiches (description et exercice). Vous avez la possibilité d’acheter\n                        un thème entier (exemple le coup droit lifté) ou des package (les coups de fond de court) ou\n                        d’avoir un accès illimité au contenu pendant un an. Tous les paiements sont sécurisés grâce\n                        notre partenaire.</p>\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>A quoi correspondent les points cumulés sur votre internet ?</h2>\n                    <p>Les points cumulés sur notre site internet vous aident à vérifier votre assiduité et votre\n                        participation active dans le temps. En effet plus vous jouez et plus vous engranger des points .\n                        Ces points évoluent durant l’année et vous permettent d’accéder à des réductions de nos\n                        partenaires ou encore à des lots/récompenses ou des gratuités.</p>\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Comment acheter du matériel de tennis (balle de tennis , raquette de tennis, balle de tennis) ?\n                    </h2>\n                    <p>Il est possible via notre boutique partenaire en ligne d’acheter de quoi vous équiper pour jouer\n                        au tennis. Une sélection de différents articles vous permettra de trouver votre bonheur, de\n                        commander en ligne et d’être ensuite livré dans les meilleurs délais.\n                        Une sélection de textiles est disponible pour les hommes et pour les femmes ainsi que des\n                        accessoires utiles pour les pratiquants plus aguéris (surgrips, anti vibrateurs , cordages etc…)\n                    </p>\n<!-- \n                    <p><strong><a class=\"content_link\" href=\"\">Nos conseils pour acheter du matériel de\n                                tennis</a></strong></p> -->\n\n                                <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                                    '/' + this._const('PATH.CONSEILS.CHOISIR.SELF')\n                                  }}\">>Nos conseils pour acheter du matériel de\n                                  tennis</a></strong></p>\n\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Quels sont les services gratuits sur votre site web ?</h2>\n                    <p>Nous proposons sur le site <a class=\"content_link\" href=\"\">http://www.ohmytennis.com</a>\n                        differnets services tels que : la recherche de partenaires pour jouer ou faire des matchs, , le\n                        guide pratique qui recense les terrains, le tutoriel pour participer à son premier tournoi\n                        officiel , le dépôt d’annonces , la participation au forum , les conseils et les informations\n                        sur la pratique au quotidien, le suivi de l’actualité de l’ATP et WTA, le suivi du livescore en\n                        direct ,</p>\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Puis je reserver un terrain de tennis sur votre site internet ?</h2>\n                    <p>Il est impossible de réserver un terrain de tennis via notre site , vous devez vous même vous en\n                        occuper si vous jouer avec un ami ou votre professeur s’en chargera pour votre prochain cours.\n                        Dans tous les cas vérifiez bien les conditions de réservations si c’est votre première fois\n                        (tarifs, annulation) pour éviter les mauvaises surprises.</p>\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Je commence à jouer tennis , que dois je faire et où m’adresser ?</h2>\n                    <p>Il est tout d’abord impératif d ‘être équipé pour jouer au tennis : pour cela le minimum requis\n                        est une raquette de tennis , des chaussures de tennis (semelle plate) et un short ou un jogging\n                        selon la saison où vous jouer. Il est très difficile d’apprendre par soi-même le tennis car cela\n                        nécessite une approche technique lié à l’utilisation d’un outils qu’est votre raquette. En effet\n                        le maniement de cette raquette et la frappe de balle demande une coordination dans le temps (la\n                        balle bouge plus ou moins vite) qui n’est pas facile à appréhender au premier abord. Nous vous\n                        conseillons de prendre au moins quelques cours (un carnet de 10 cours est l’idéal) pour des\n                        acquérir des notions indispensables pour renvoyer la balle et s’amuser un minimum , sinon vous\n                        allez constamment courir pour ramasser les balles !</p>\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"mid_contentdiv\">\n                    <h2>Les tournois de tennis officiels , ca marche comment ? C’est pour les forts ?</h2>\n                    <p>Pour participer à un tournoi il faut être muni d’une licence et d’un certificat médical. Une fois\n                        ces deux éléments obtenus, vous pourrez trouver votre tournoi via un moteur de recherche de la\n                        fédération française de tennis qui organise ces événements. Une lettre d’engagement munie d’un\n                        chèque adressée au juge arbitre (responsable)vous engagera définitivement. Les tournois de\n                        tennis concernent la plupart du temps tous types de niveaux (on commence par les non classés) et\n                        sont progressifs (vous rencontrez des gens de plus en plus fort petit à petit).</p>\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n\n\n    </div>\n</div>\n\n<app-footer></app-footer>");

