/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<div class=\"innerbanner\">\n    <img src=\"../assets/images/coach_banner.jpg\" alt=\"Los Angeles\">\n    <div class=\"inner_carousel\">\n        <h3>oh my tennis</h3>\n    </div>\n</div>\n<!-- Banner ends -->\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n    <div class=\"banner_container\">\n        <h3>Réservez un cours particulier</h3>\n        <div class=\"row\">\n            <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n                <div class=\"form-group\">\n                    <div class=\"addon-lg\">\n                        <input class=\"form-control\" id=\"\" placeholder=\"Ville\" type=\"text\">\n                        <label><img src=\"../assets/images/ville_icon.png\"></label>\n                    </div>\n                </div>\n            </div>\n            <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n                <div class=\"form-group\">\n                    <div class=\"addon-lg\">\n                        <input class=\"form-control\" id=\"\" placeholder=\"Date\" type=\"text\">\n                        <label><img src=\"../assets/images/date_icon.png\">\n                        </label>\n                    </div>\n                </div>\n            </div>\n            <div class=\"col-xs-12 col-sm-4 col-lg-4 inner_search_div\">\n                <button class=\"btn black_btn\">Rechercher</button>\n            </div>\n        </div>\n    </div>\n</div>\n<!-- Inner Search area ends -->\n<!-- section1 starts -->\n<div class=\"section1 des_titre_list haspadd\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"page_title_div\">\n                    <h1 class=\"page_title\">Guide pratique des terrains de tennis </h1>\n                    <img src=\"../assets/images/title_border.png\" alt=\"title_border\" />\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h5>C’est quoi un guide pratique des terrains de tennis ?</h5>\n                <p>Le guide pratique vous permet de trouver des terrains de tennis sur un département sélectionné. C’est\n                    un véritable outils d’aide à la pratique qui permet tout à chacun de découvrir des lieux\n                    insoupçonnés. Au delà de ça, il est intéressant d’avoir des informations complémentaires vous\n                    permettant d’affiner vos choix si cela est possible.En effet il n’existe pas deux même lieux, chacun\n                    a ses spécificités qui peuvent parfois vous pousser à vous décider si vous êtes hésitants.</p>\n\n                <p>Commencez votre première partie au tennis (conseils)</p>\n                <p>Quelques conseils pour vous préparez à l’effort (conseils)</p>\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"../assets/images/concept_img1.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n            </div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"../assets/images/concept_img3.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h5>Informations complémentaires sur les courts de tennis</h5>\n                <p>C’est sympa de savoir si il existe un terrain à tel endroit mais chacun a ses exigences parfois sur\n                    certains paramètres qui ne sont pas évidemment les mêmes pour tout le monde </p>\n            </div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h5>Stade ou complexe pour jouer au tennis ?</h5>\n                <p>S’agit il d’un stade ou d’un complexe ? En effet on a beaucoup plus de chances d’avoir froid en hiver\n                    dans un stade que dans un complexe. On peut noter que certains complexes sont même chauffés (environ\n                    15 degrés) ce qui peut être un élément différenciant quand en plein hiver il fait très froid sous\n                    les courts bullés d’un stade (proche de 0 degré) mais attention cela à souvent un coût d’entretien\n                    qui se répercute sur le prix de location ! </p>\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"../assets/images/concept_img6.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n            </div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"../assets/images/concept_img9.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h5>Terrain de tennis couvert ou découvert ?</h5>\n                <p>Le froid c’est une chose mais si la pluie s’en mêle, le terrain peut devenir vite impraticable\n                    (glissade, chute et blessures dans le pire des cas). Dans ce genre de situation il faut éviter de\n                    s’entêter à vouloir absolument jouer car votre santé physique est en jeu. La plupart du temps les\n                    agent d’accueil des stades déclinent toute responsabilité en cas d’accident et ne vous font pas\n                    payer voire vous interdisent l’accès aux terrains. Un petit coup d’œil sur un site ou un appli météo\n                    (lien méteo France) vous permettra de savoir si il pleut le jour dit ou même une heure avant.</p>\n\n                <p>Voici quelques conseils si vous jouer au tennis dehors par temps froid ou temps chaud (conseils)</p>\n\n\n            </div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h5>Possibilité de jouer gratuit grâce au mur de tennis?</h5>\n                <p>Certains lieux possèdent un mur, le terrain par excellence pour commencer à taper dans la balle quand\n                    on est débutant. La plupart du temps ils sont gratuits d’accès et vous permettent de répéter vos\n                    frappes à l’infini (c’est toujours le mur qui gagne !). Le seul inconvénient de cet outils est qu’il\n                    ne retranscrit pas bien l’effet de la balle puisque au contact du mur la rotation de la balle est\n                    forcément altérée. Si vous n’avez pas trouvé d’adversaire ou si vous souhaitez vous défoulez , rien\n                    de mieux</p>\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"../assets/images/concept_img13.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n            </div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"../assets/images/concept_img3.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h5>Surface du terrain de tennis rapide ou lente ?</h5>\n                <p>LQue cela soit sur terre battue , synthétique ou béton poreux (quick) les joueurs ont leur\n                    préférences pour différentes raisons : préventions des articulations (et donc des blessures) sur\n                    terre battue ou préférence de filière de jeu rapide sur courts en synthétiques , le but est\n                    d’optimiser son rendement sur le terrain.</p>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h5>Quel est le nombre de terrains de tennis sur site ?</h5>\n                <p>Cela peut paraître bête mais plus il y a de terrains et plus vous avez de la chance de jouer si il y\n                    a une forte demande (soir et week end par exemple). Il faut savoir qu’en période hivernale les gens\n                    se battent pour jouer en structure couverte donc prêter attention aux conditions de réservations des\n                    terrains pour éviter de vous faire avoir et ne pas jouer ! </p>\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"../assets/images/concept_img6.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n            </div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"../assets/images/concept_img9.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h5>Terrain de tennis ou terrain multi sport ?</h5>\n                <p>Le terrain multisport est la hantise de tout joueur de tennis. En effet les lignes de basketball ou\n                    handball perturbent les jugements de balles , les repères sur le terrain et pour peu que vous soyez\n                    daltonien c’est la totale ! Ce n’est pas forcément l’idéal pour commencer , rien de mieux qu’un\n                    terrain bien dégagé pour avoir une vision claire de l’espace de jeu mais certaines fois on n’a pas\n                    le choix </p>\n\n\n            </div>\n        </div>\n\n    </div>\n</div>\n<!-- section1 ends -->\n\n<!-- section2 starts -->\n<div class=\"section2 des_titre_backtext\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"des_back_content\">\n                    <h4>Nous proposons aux passionnés de tennis d'avoir un univers spécialement créé pour eux.</h4>\n                </div>\n            </div>\n        </div>\n    </div>\n</div>\n<app-footer></app-footer>\n<!-- section2 ends -->");

