/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n  <img\n    src=\"./assets/images/cours-particuliers-de-tennis.jpg\"\n    alt=\"Los Angeles\"\n  />\n  <div class=\"inner_carousel\">\n    <h3>Oh My Concept</h3>\n  </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n  <div class=\"banner_container\">\n    <h3>Réservez un cours particulier</h3>\n    <div class=\"row\">\n      <form class=\"text-left\" [formGroup]=\"engform\" (ngSubmit)=\"onSubmitCoach()\">\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input\n              class=\"form-control\"\n              id=\"\"\n              maxlength=\"6\"\n              placeholder=\"Code Postal\"\n              type=\"text\"\n              formControlName=\"code_postal\"\n            />\n            <label><img src=\"./assets/images/ville_icon.png\"/></label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input\n              type=\"text\"\n              style=\"text-align:left!important;\"\n              [min]=\"min\"\n              class=\"form-control\"\n              id=\"\"\n              placeholder=\"Date\"\n              [owlDateTime]=\"dt1\"\n              [owlDateTimeTrigger]=\"dt1\"\n              formControlName=\"Date\"\n            />\n            <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n            <label><img src=\"./assets/images/date_icon.png\" /> </label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n        \n        <button type=\"submit\" [disabled] =\"!engform.valid\" class=\"btn black_btn\">\n          Rechercher\n        </button>\n      </div>\n    </form>\n\n    </div>\n  </div>\n</div>\n<!-- Inner Search area ends -->\n\n<!-- section1 starts -->\n<div class=\"section1 des_titre_list haspadd\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-12 col-sm-12 col-xs-12\">\n        <div class=\"page_title_div\">\n          <h1 class=\"page_title\">Ohmytennis: la charte d’engagement</h1>\n          <img src=\"./assets/images/title_border.png\" alt=\"title_border\" />\n        </div>\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h2>\n          1. Un encadrement  formé et diplômé pour donner un cours de tennis\n        </h2>\n        <p>\n          Tous les éducateurs sportifs et professeur de tennis donnant des cours de tennis dans le le cadre de ohmytennis sont obligatoirement titulaires d’un diplôme leurs permettants d’exercer contre rémunération. Conformément à L’article L 212-1 du code du sport\n        </p>\n        <p>\n          <i\n            >\"Seuls peuvent, contre rémunération, enseigner, animer ou encadrer\n            une activité physique ou sportive ou entraîner ses pratiquants, à\n            titre d'occupation principale ou secondaire, de façon habituelle,\n            saisonnière ou occasionnelle, les titulaires d'un diplôme, titre à\n            finalité professionnelle ou certificat de qualification :</i\n          >\n        </p>\n        <ul>\n          <li>\n            <i\n              >garantissant les compétences de l'éducateur en matière de\n              sécurité des pratiquants et des tiers dans l'activité\n              considérée.</i\n            >\n          </li>\n          <li>\n            <i\n              >enregistré au répertoire national des certifications\n              professionnelles (RNCP)\".</i\n            >\n          </li>\n        </ul>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <!-- <img\n          src=\"./assets/images/concept1.jpg\"\n          class=\"center-block\"\n          alt=\"titre_img1\"\n        /> -->\n        <img\n          src=\"./assets/images/nos_engagement.PNG\"\n          class=\"center-block\"\n          alt=\"engagement cours tennis / engagement leçon de tennis\"\n        />\n      </div>\n    </div>\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-12 col-sm-12 col-xs-12\">\n        <p class=\"para_nomargin\">\n          A la lecture de cet article fondamental, il est important de souligner\n          que ce n'est pas la seule activité d'enseignement ou d'entraînement\n          qui est réglementé mais bien, au sens le plus large, l'encadrement et\n          l'animation d'un activité physique ou sportive à partir de l'instant\n          où il y a rémunération – autant de compétences transversales\n          concernant le tennis et le sport au cœur du projet de ohmytennis.\n        </p>\n      </div>\n      <div class=\"clearfix\"></div>\n      <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n        '/' + this._const('PATH.OH_MY_COACH_NEW')\n      }}\">Trouver votre futur professeur pour des cours de tennis particuliers    </a></strong></p>\n    </div>\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img\n          src=\"./assets/images/club-tennis.jpg\"\n          class=\"center-block\"\n          alt=\"encadrement cours tennis / encadrement professeur tennis\"\n        />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h4>2. Le joueur qui pratique le tennis est au cœur de notre projet</h4>\n        <p>\n          L’épanouissement humain et tennistique du pratiquant est au cœur du projet de ohmytennis. Pour cela, il est important de vous proposer un cadre de pratique du tennis sur mesure, répondant à vos besoins et à vos envies. Qu’il s’agisse d’une pratique de tennis pour le loisir, d’une pratique de tennis récréative ou d’une volonté de progression technique et compétitive… Les éducateurs sportifs ohmytennis sauront déterminer le cadre qui vous est le plus adapté pour vous faire progresser le joueur de tennis et lui donner le plaisir de jouer.\n        </p>\n        <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n          '/' + this._const('PATH.OH_MY_EVENT_NEW')\n        }}\">Chercher un stage de tennis proche de chez vous </a></strong></p>\n      </div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h4>3. Exigence et valorisation du joueur de tennis </h4>\n        <p>\n          Pour ohmytennis, l’exigence est un principe valorisant pour le pratiquant. Qu’il s’agisse d’une pratique du tennis pour le loisir ou la compétition, ohmytennis s’engage à maintenir un niveau d’exigence constant auprès de ses professeurs de tennis. Celle-ci se traduit par une recherche permanente des meilleures conditions de pratiques et par une adaptation et une évaluation constante de notre enseignement et de notre pédagogie. \n        </p>\n        <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n          '/' + this._const('PATH.CONCEPTS.LACHARTE.SELF')\n        }}\">Consultez les informations réglementaires pour jouer au tennis</a></strong></p>\n        <h4>\n          4. Professionnalisme pendant le cours de tennis  (ponctualité, respect, etc.) \n        </h4>\n        <p>\n          Ponctualité, assiduité, prévenance, écoute, adaptation, respect des règles, du cadre et du matériel,ohmytennis attache une importance cruciale au professionnalisme des professeurs de tennis employés par ohmytennis et qui sont  au services de votre cours de  tennis. \n        </p>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img\n          src=\"./assets/images/cours-collectifs-enfants.jpg\"\n          class=\"center-block\"\n          alt=\"educateur cours tennis /  educateur cours de tennis\"\n        />\n      </div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img\n          src=\"./assets/images/cours-collectifs-adultes.jpg\"\n          class=\"center-block\"\n          alt=\"engagements cours tennis / engagements cours tennis\"\n        />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h4>5. Un projet sportif et éducatif</h4>\n        <p>\n          Les coachs de ohmytennis sont des professionnels formés au service de la progression des joueurs prenant des cours de tennis. Mais ce sont aussi des partenaires éducatifs, notamment dans l’enseignement qu’ils apportent aux plus jeunes pratiquants. Nos professeurs de tennis sont ainsi sélectionnés en fonction de leurs compétences techniques, mais aussi d’une pédagogique qui entraînera la progression des joueurs de tennis. L’ensemble de nos coachs adhèrent à cette mission de transmission de valeurs, à leurs responsabilités éducatives et à un nécessaire devoir d’exemplarité.\n        </p>\n        <h4>\n          6. Une offre de service toujours optimisée pour le joueur de tennis\n        </h4>\n        <p>\n          Entraînement de tennis, conseils techniques, diététiques, conseils relatifs aux choix du matériel de tennis, informations relatives aux tournois de tennis, accompagnement dans la formalisation de plans \n          d’entrainements,Ohmytennis cherche à anticiper vos besoins de manière à vous\n          proposer une offre de service optimisée. En ce sens, nous vous\n          invitons à faire remonter vos propositions.\n        </p>\n      </div>\n    </div>\n  </div>\n</div>\n<!-- section1 ends -->\n\n<!-- section2 starts -->\n<div class=\"section2 des_titre_backtext\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-12 col-sm-12 col-xs-12\">\n        <div class=\"des_back_content\">\n          <h4>\n            Nous avons créé un univers spécialement dédié au tennis pour nos passionnés + flouter Wilson raquette \n          </h4>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n<!-- section2 ends -->\n<div class=\"section3 des_concept_circletext haspadd\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-3 col-sm-6 col-xs-12 text-center\">\n        <div class=\"des_orange_circle\">\n          <img src=\"./assets/images/concept_icon1.png\" alt=\"concept_icon1\" />\n        </div>\n        <h5>\n          <strong\n            ><a\n              href=\"javascript:;\"\n              routerLink=\"{{\n                '/' + this._const('PATH.CONCEPTS.PRESENTATION.SELF')\n              }}\"\n              >Présentation <br />Générale</a\n            ></strong\n          >\n        </h5>\n      </div>\n      <div class=\"col-md-3 col-sm-6 col-xs-12 text-center\">\n        <div class=\"des_orange_circle\">\n          <img src=\"./assets/images/concept_icon2.png\" alt=\"concept_icon1\" />\n        </div>\n        <h5>\n          <strong\n            ><a\n              href=\"javascript:;\"\n              routerLink=\"{{ '/' + this._const('PATH.CONCEPTS.CHARTE.SELF') }}\"\n              >La charte <br />de Qualité</a\n            ></strong\n          >\n        </h5>\n      </div>\n      <div class=\"col-md-3 col-sm-6 col-xs-12 text-center\">\n        <div class=\"des_orange_circle\">\n          <img src=\"./assets/images/concept_icon3.png\" alt=\"concept_icon1\" />\n        </div>\n        <h5>\n          <strong\n            ><a\n              href=\"javascript:;\"\n              routerLink=\"{{\n                '/' + this._const('PATH.CONCEPTS.ENGAGEMENTS.SELF')\n              }}\"\n              >Nos <br />Engagements</a\n            ></strong\n          >\n        </h5>\n      </div>\n      <div class=\"col-md-3 col-sm-6 col-xs-12 text-center\">\n        <div class=\"des_orange_circle\">\n          <img src=\"./assets/images/concept_icon4.png\" alt=\"concept_icon1\" />\n        </div>\n        <h5>\n          <strong\n            ><a\n              href=\"javascript:;\"\n              routerLink=\"{{\n                '/' + this._const('PATH.CONCEPTS.INFORMATIONS.SELF')\n              }}\"\n              >Informations<br />\n              Réglementaires</a\n            ></strong\n          >\n        </h5>\n      </div>\n    </div>\n  </div>\n</div>\n<app-footer></app-footer>\n");

