/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n  <img src=\"./assets/images/cours-particuliers-de-tennis.jpg\" alt=\"Los Angeles\" />\n  <div class=\"inner_carousel\">\n    <h3>Oh My Concept</h3>\n  </div>\n</div>\n<!-- Banner ends -->\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n  <div class=\"banner_container\">\n    <h3>Réservez un cours particulier</h3>\n    <div class=\"row\">\n      <form class=\"text-left\" [formGroup]=\"coachform\" (ngSubmit)=\"onSubmitCoach()\">\n        <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n          <div class=\"form-group\">\n            <div class=\"addon-lg\">\n              <input class=\"form-control\" id=\"\" maxlength=\"6\" placeholder=\"Code Postal\" type=\"text\"\n                formControlName=\"code_postal\" />\n              <label><img src=\"./assets/images/ville_icon.png\" /></label>\n            </div>\n          </div>\n        </div> \n        <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n          <div class=\"form-group\">\n            <div class=\"addon-lg\">\n              <input type=\"text\" style=\"text-align:left!important;\" [min]=\"min\" class=\"form-control\" id=\"\"\n                placeholder=\"Date\" [owlDateTime]=\"dt1\" [owlDateTimeTrigger]=\"dt1\" formControlName=\"Date\" />\n              <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n              <label><img src=\"./assets/images/date_icon.png\" /> </label>\n            </div>\n          </div>\n        </div>\n        <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n          <button type=\"submit\" [disabled]=\"!coachform.valid\" class=\"btn black_btn\">\n            Rechercher\n          </button>\n        </div>\n      </form>\n\n    </div>\n  </div>\n</div>\n<!-- Inner Search area ends -->\n<!-- section1 starts -->\n<div class=\"section1 des_titre_list haspadd\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-12 col-sm-12 col-xs-12\">\n        <div class=\"page_title_div\">\n          <h1 class=\"page_title\">Charte des professeurs Ohmytennis</h1>\n          <img src=\"./assets/images/title_border.png\" alt=\"title_border\" />\n        </div>\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h3><strong>Préambule :</strong></h3>\n        <p>\n          Le professeur de tennis ohmytennis est un professionnel, diplômé, exerçant contre rémunération. ll transmet\n          dans l’intérêt général et en exerçant sa misssion d’accompagnement, son savoir, savoir être, savoir-faire et\n          se doit d’offrir une image exemplaire.\n        </p>\n        <p>\n          Dans le cadre de ses missions il engage en permanence l’image de ohmytennis.\n          Le développement individuel, tennistique et humain des pratiquants dont il a la charge est au cœur de ses\n          préoccupation\n\n        </p>\n        <p>\n          Ohmytennis labellise un encadrement, en étant garant de sa compétence, de son professionnalisme et de son\n          éthique.<br />\n          Ohmytennis est ainsi à la fois une vitrine et une certification qualité pour l’ensemble des entraîneurs\n          labellisés.\n        </p>\n        <p class=\"para_nomargin\">\n          Agissant pour ohmytennis, chaque éducateur,dans le cadre de ses activités professionnelles, engage l’image de\n          ohmytennis.\n        </p>\n        <p class=\"~para_nomargin\">\n          Au travers des éléments qui suivent, cette charte de l’éducateur doit constituer l’engagement que prendra tout\n          éducateur lors de sa prise de fonction au sein de ohmytennis.\n        </p>\n        <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n          '/' + this._const('PATH.OH_MY_COACH_NEW')\n        }}\">Trouver dés maintenant votre coach pour des cours de tennis particuliers</a></strong></p>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/tennis_court.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/tennis_court3.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h3 style=\"font-size:15px; font-weight: bold;\">\n          CHARTE DE L’EDUCATEUR SPORTIF OHMYTENNIS:\n        </h3>\n        <!-- <h5><strong>Respect des règlements :</strong></h5> -->\n        <p><strong>Préconisations/obligations :</strong></p>\n        <ul style=\"margin-bottom:10px;\">\n          <li>\n            Connaître les règlements du tennis et du code du sport et s’y conformer est l’une des tâches fondamentales\n            de l’éducateur.\n          </li>\n          <li>\n            L’enseignement de la règle du tennis – et du code du sport - doit mettre en valeur ses raisons, notamment\n            avant, pendant et après les animations.\n          </li>\n          <li>\n            Placer le pratiquant (son développement, son bien-être, sa santé) au centre de toutes ses attentions.\n          </li>\n        </ul>\n        <p><strong> Comportements répréhensibles :</strong></p>\n        <ul>\n          <li>\n            Manquements aux règlements et tous contournements de l’éthique.\n          </li>\n          <li>Manquements au droit de réserve.</li>\n          <li>Tout comportement portant atteinte à l’image de ohmytennis.</li>\n          <li>Prise en compte insuffisante des intérêts du client.</li>\n          <li>Refus de travailler.</li>\n        </ul>\n        <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n          '/' + this._const('PATH.CONCEPTS.LACHARTE.SELF')\n        }}\">Voir toutes les informations réglementaires pendant un cours de tennis\n      </a></strong></p>\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <!-- <h5><strong>Ponctualité :</strong></h5> -->\n        <p><strong>Préconisations/obligations :</strong></p>\n        <ul style=\"margin-bottom:10px;\">\n          <li>Se conformer aux exigences du métier.</li>\n          <li>\n            Tenir informer ohmytennis et ses élèves des absences, maladies, retards…\n          </li>\n        </ul>\n        <p><strong>Comportements répréhensibles :</strong></p>\n        <ul style=\"margin-bottom:10px;\">\n          <li>\n            Ne pas justifier ses retards et absences. Chaque retard ou absence signalé par les pratiquants fera l’objet\n            d’une remontrance spécifique pouvant aller jusqu’à l'exclusion de ohmytennis.\n          </li>\n        </ul>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/tennis_court2.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n    </div>\n\n    <div class=\"row split_marginbot \" style=\"padding-top:13px;\">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/tennis_court5.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <!-- <h5><strong>Tenue adaptée :</strong></h5> -->\n        <p><strong>Préconisations/obligations :</strong></p>\n        <ul style=\"margin-bottom:10px;\">\n          <li>Se conformer aux exigences du métier.</li>\n          <li>\n            Être vêtu de telle façon à être reconnu de tous comme le référent de l’animation.\n          </li>\n          <li>\n            Avoir une attitude conforme à l’éthique sportive (expression orale et corporelle, politesse, civisme…).\n          </li>\n        </ul>\n        <p><strong>Comportements répréhensibles :</strong></p>\n        <ul style=\"margin-bottom:10px;\">\n          <li>\n            Nuire à l’image d’éducateur et par ce fait à celle de ohmytennis.\n          </li>\n        </ul>\n      </div>\n    </div>\n\n    <div class=\"row split_marginbot \" style=\"padding-top:13px;\">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <!-- <h5><strong>Se responsabiliser :</strong></h5> -->\n        <p><strong>Préconisations/obligations :</strong></p>\n        <ul style=\"margin-bottom:10px;\">\n          <li>\n            Les éducateurs sportifs doivent se mettre au service du collectif.\n          </li>\n          <li>\n            Les éducateurs sportifs doivent avertir ohmytennis de toutes modifications d’emploi du temps ou du lieu de\n            structure en cas de changement (ex : incendie de salle…)\n          </li>\n          <li>\n            Les éducateurs sportifs doivent faire remonter toutes les informations utiles au bon fonctionnement de\n            l’association ohmytennis.\n          </li>\n        </ul>\n        <p><strong>Comportements répréhensibles :</strong></p>\n        <ul style=\"margin-bottom:10px;\">\n          <li>Refuser de se plier aux exigences du métier.</li>\n        </ul>\n        <p class=\"para_nomargin\">\n          Chaque manquement signalé par les pratiquants fera l’objet d’une remontrance spécifique pouvant aller jusqu’à\n          l’exclusion de ohmytennis.\n        </p>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/tennis_court4.png\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n    </div>\n\n    <div class=\"row split_marginbot \" style=\"padding-top:13px;\">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/tennis_court7.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <!-- <h5>\n          <strong>S’éduquer au respect de l’environnement et d’autrui :</strong>\n        </h5> -->\n        <p><strong>Préconisations/obligations :</strong></p>\n        <ul style=\"margin-bottom:10px;\">\n          <li>\n            Les relations mutuelles entre les personnes comme l’attitude envers la nature sont empreintes de respect.\n          </li>\n          <li>\n            Enseigner dans le cadre de la laïcité, de l’égalité et de la citoyenneté.\n          </li>\n        </ul>\n        <p><strong>Comportements répréhensibles :</strong></p>\n        <ul style=\"margin-bottom:10px;\">\n          <li>\n            Refuser de se soumettre aux codes institutionnels (code du travail, règlement intérieur, code national des\n            forêts...).\n          </li>\n          <li>Faire preuve de quelque forme de discriminations que ce soit.</li>\n        </ul>\n        <p class=\"para_nomargin\">\n          Chaque manquement signalé par les pratiquants fera l’objet d’une remontrance spécifique pouvant aller jusqu’à\n          exclusion de ohmytennis. Par ailleurs, le signalement d’une pratique discriminatoire pourra faire l’objet d’un\n          signalement aux autorités compétentes.\n        </p>\n      </div>\n    </div>\n\n    <div class=\"row split_marginbot \" style=\"padding-top:13px;\">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <!-- <h5>\n          <strong>Favoriser l’engagement envers les partenaires :</strong>\n        </h5> -->\n        <p><strong>Préconisations/obligations :</strong></p>\n        <ul style=\"margin-bottom:10px;\">\n          <li>Véhiculer une image professionnelle.</li>\n          <li>Avoir un comportement digne, de la tenue et de la réserve.</li>\n        </ul>\n        <p><strong>Comportements répréhensibles :</strong></p>\n        <ul style=\"margin-bottom:10px;\">\n          <li>Le mépris.</li>\n          <li>Tout comportement irrespectueux.</li>\n        </ul>\n        <p>\n          Chaque manquement signalé par les pratiquants fera l’objet d’une remontrance spécifique pouvant aller\n          jusqu’àl’exclusion de ohmytennis.\n        </p>\n        <p>\n          Cette charte relève également d’une certaine déontologie c’est-à-dire d’une morale professionnelle, impliquant\n          le respect par les membres d’un corps d’un ensemble de règles de conduite, reposant sur une axiologie (une\n          philosophie des valeurs ) de la profession.\n        </p>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/tennis_court9.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n      <div class=\"clearfix\"></div>\n      <div class=\"col-xs-12\">\n        <p><strong>C’est pourquoi chaque personnel employé devra :</strong></p>\n        <ul style=\"margin-bottom:10px;\">\n          <li>Exercer son activité dans le respect de la personne humaine.</li>\n          <li>\n            S’occuper avec la même attention de chacun, quelque soit sa condition, sa nationalité, ses convictions.\n          </li>\n          <li>\n            S’abstenir de tout prosélytisme politique, religieux ou philosophique.\n          </li>\n          <li>Proposer d’autres démarches si nécessaire.</li>\n          <li>\n            Garantir le secret professionnel, sauf dérogation prévue par la loi.\n          </li>\n        </ul>\n        <p>\n          Le respect de la charte peut être vérifié par un certain nombre de contrôles. Ces contrôles seront opérés par\n          les dirigeants de ohmytennis et pris en compte dans l’évaluation annuelle.\n        </p>\n        <p>\n          En foi de quoi, chacun sera appelé à adhérer à la charte et à participer à sa promotion en toutes\n          circonstances.\n        </p>\n      </div>\n      <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n        '/' + this._const('PATH.CONCEPTS.PRESENTATION.SELF')\n      }}\">Consulter notre présentation générale pour vos leçons de tennis\n    </a></strong></p>\n    </div>\n  </div>\n</div>\n<!-- section1 ends -->\n\n<!-- section2 starts -->\n<div class=\"section2 des_titre_backtext\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-12 col-sm-12 col-xs-12\">\n        <div class=\"des_back_content\">\n          <h4>\n            Nous avons créé un univers spécialement dédié au tennis pour nos passionnés + flouter Wilson raquette\n          </h4>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n<!-- section2 ends -->\n<div class=\"section3 des_concept_circletext haspadd\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-3 col-sm-6 col-xs-12 text-center\">\n        <div class=\"des_orange_circle\">\n          <img src=\"./assets/images/concept_icon1.png\" alt=\"concept_icon1\" />\n        </div>\n        <h5>\n          <strong><a href=\"javascript:;\" routerLink=\"{{\n                '/' + this._const('PATH.CONCEPTS.PRESENTATION.SELF')\n              }}\">Présentation <br />Générale</a></strong>\n        </h5>\n      </div>\n      <div class=\"col-md-3 col-sm-6 col-xs-12 text-center\">\n        <div class=\"des_orange_circle\">\n          <img src=\"./assets/images/concept_icon2.png\" alt=\"concept_icon1\" />\n        </div>\n        <h5>\n          <strong><a href=\"javascript:;\" routerLink=\"{{ '/' + this._const('PATH.CONCEPTS.CHARTE.SELF') }}\">La charte\n              <br />de Qualité</a></strong>\n        </h5>\n      </div>\n      <div class=\"col-md-3 col-sm-6 col-xs-12 text-center\">\n        <div class=\"des_orange_circle\">\n          <img src=\"./assets/images/concept_icon3.png\" alt=\"concept_icon1\" />\n        </div>\n        <h5>\n          <strong><a href=\"javascript:;\" routerLink=\"{{\n                '/' + this._const('PATH.CONCEPTS.ENGAGEMENTS.SELF')\n              }}\">Nos <br />Engagements</a></strong>\n        </h5>\n      </div>\n      <div class=\"col-md-3 col-sm-6 col-xs-12 text-center\">\n        <div class=\"des_orange_circle\">\n          <img src=\"./assets/images/concept_icon4.png\" alt=\"concept_icon1\" />\n        </div>\n        <h5>\n          <strong>\n            <a href=\"javascript:;\" routerLink=\"{{\n                '/' + this._const('PATH.CONCEPTS.INFORMATIONS.SELF')\n              }}\">Informations<br />\n              Réglementaires</a></strong>\n        </h5>\n      </div>\n    </div>\n  </div>\n</div>\n<app-footer></app-footer>");

