/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n  <img src=\"./assets/images/jouer-tennis.jpg\" alt=\"Los Angeles\" />\n  <div class=\"inner_carousel\">\n    <h3>oh my Tennis</h3>\n  </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n  <div class=\"banner_container\">\n    <h3>Réservez un cours particulier</h3>\n    <div class=\"row\">\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input\n              class=\"form-control\"\n              id=\"\"\n              maxlength=\"6\"\n              placeholder=\"Code Postal\"\n              [(ngModel)]=\"Ville\"\n              type=\"text\"\n            />\n            <label><img src=\"./assets/images/ville_icon.png\"/></label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input\n              type=\"text\"\n              style=\"text-align:left!important;\"\n              [min]=\"min\"\n              class=\"form-control\"\n              id=\"\"\n              placeholder=\"Date\"\n              [(ngModel)]=\"Date\"\n              [owlDateTime]=\"dt1\"\n              [owlDateTimeTrigger]=\"dt1\"\n            />\n            <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n            <label><img src=\"./assets/images/date_icon.png\" /> </label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n        <button (click)=\"handleClick($event)\" class=\"btn black_btn\">\n          Recherche\n        </button>\n      </div>\n    </div>\n  </div>\n</div>\n<!-- Inner Search area ends -->\n\n<div class=\"lexique_content haspadd\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"lexique\">\n        <div class=\"page_title_div col-xs-12\">\n          <h1 class=\"page_title\">HISTOIRE DU TENNIS 1880-1930</h1>\n          <img src=\"./assets/images/title_border.png\" alt=\"title_border\" />\n        </div>\n        <div class=\"clearfix\"></div>\n        <div class=\"col-md-12 col-sm-12 col-xs-12\">\n          <div class=\"wrapper1 center-block\">\n            <div\n              class=\"panel-group\"\n              id=\"accordion\"\n              role=\"tablist\"\n              aria-multiselectable=\"true\"\n            >\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"headingOne\">\n                  <h4 class=\"panel-title\">\n                    <a\n                      role=\"button\"\n                      data-toggle=\"collapse\"\n                      data-parent=\"#accordion\"\n                      href=\"#collapseOne\"\n                      aria-expanded=\"true\"\n                      aria-controls=\"collapseOne\"\n                    >\n                      Le jeu de paume : ancêtre du tennis\n                    </a>\n                  </h4>\n                </div>\n\n                <div\n                  id=\"collapseOne\"\n                  class=\"panel-collapse collapse in\"\n                  role=\"tabpanel\"\n                  aria-labelledby=\"headingOne\"\n                >\n                  <div class=\"panel-body\">\n                    <p>\n                      Le jeu de paume fait son apparition en France les sports de raquettes comme le tennis, le badminton, le squash ou encore la pelote basque ont pour ancêtre le Jeu de Paume, au XIIIe siècle grâce à des moines qui voulaient faire un peu d’exercice. Avec l’utilisation du sol, des murs et des poutres du cloître ils pratiquaient avec une balle (l’esteuf) et la paume de la main. D’où le nom \"Jeu de Paume\". Il pouvait être joué soit avec les mains, soit avec des gants. A la fin du XVe siècle, les gants furent équipés avec des sortes de cordages car cela devenait trop douloureux pour la peau. Au XVIe siècle que la première raquette est créée avec un long manche et un cordage en boyaux de mouton. Le Jeu de Paume est pratiqué par la noblesse et fait donc partie des \"Jeu des Rois\" : François I, Henri II, Charles IX, Henri IV sont experts en la matière. Ce jeu se développe ensuite dans le monde entier sous diverses appellations. Le mot \"tennis\" vient de \"tennetz\", lors de la mise en jeu de la balle dans le jeu de Paume. En 1850, les Anglais créent le jeu de rackets. Plusieurs joueurs se retrouvent ainsi contre un \n\n                    </p>\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"headingTwo\">\n                  <h4 class=\"panel-title\">\n                    <a\n                      class=\"collapsed\"\n                      role=\"button\"\n                      data-toggle=\"collapse\"\n                      data-parent=\"#accordion\"\n                      href=\"#collapseTwo\"\n                      aria-expanded=\"false\"\n                      aria-controls=\"collapseTwo\"\n                    >\n                      1874 : l’invention du Major Wingfield\n                    </a>\n                  </h4>\n                </div>\n                <div\n                  id=\"collapseTwo\"\n                  class=\"panel-collapse collapse\"\n                  role=\"tabpanel\"\n                  aria-labelledby=\"headingTwo\"\n                >\n                  <div class=\"panel-body\">\n                    <p>\n                      La véritable histoire du tennis commence avec le major\n                      Walter Clopton Wingfield qui dépose un brevet pour un\n                      nouveau jeu qui deviendra en 1877 le Lawn-Tennis.\n                    </p>\n\n                    <p>\n                      Le concept est vendu sous forme d’une boîte  contenant : •\n                      Quatre raquettes de Paume légères. • Un filet avec ses\n                      piquets. • Des bandes pour tracer le terrain.\n                    </p>\n\n                    <p>\n                      Pour jouer et installer le terrain de tennis il est\n                      nécessaire de disposer d’une surface de gazon. (lawn veut\n                      dire pelouse en anglais).Au tout début les règles sont\n                      incomplètes et laissent place à toutes les fantaisies.\n                      C’est le Marylebone Cricket Club (l’autorité responsable\n                      des sports de rackets et du Jeu de Paume) en collaboration\n                      avec le major Wingfield qui fixera des règles plus\n                      simplifiées. Le All England Club est ensuite créé pour\n                      organiser le premier tournoi : Wimbledon est né !\n                    </p>\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"headingThree\">\n                  <h4 class=\"panel-title\">\n                    <a\n                      class=\"collapsed\"\n                      role=\"button\"\n                      data-toggle=\"collapse\"\n                      data-parent=\"#accordion\"\n                      href=\"#collapseThree\"\n                      aria-expanded=\"false\"\n                      aria-controls=\"collapseThree\"\n                    >\n                      Le Lawn-tennis à la conquête du monde\n                    </a>\n                  </h4>\n                </div>\n                <div\n                  id=\"collapseThree\"\n                  class=\"panel-collapse collapse\"\n                  role=\"tabpanel\"\n                  aria-labelledby=\"headingThree\"\n                >\n                  <div class=\"panel-body\">\n                    <p>\n                      A partir de 1880-1900, le Lawn-tennis se diffuse dans le monde entier (Italie, Espagne, France, Allemagne, Norvège, Pays bas, Portugal). Peu à peu le terme lawn-tennis est abandonné puisque plusieurs surfaces sont utilisées. Le mot «tennis» est adopté . En France, Le Havre, Dinard et Cannes sont les premiers clubs de tennis français. Vers 1890, le Racing Club de Paris, le Stade Français et le club sportif de l’île de Puteaux construisent des terrains de tennis. En juin 1891, les premiers championnats français de Lawn-tennis sont organisés sur l’île de Puteaux. Des tournois sont organisés et s’ouvrent aux étrangers\n                    </p>\n\n                    <p>\n                      Des courts de tennis sont construits sur les lieux de vacances et deviennent un véritable loisir (sous l’influence des touristes anglais). On peut noter que l’US Open apparaît en 1881 et l’Open d’Australie en 1905. En 1912, à Paris, la I.F.LT (Fédération Internationale de Lawn-tennis) est née. Elle deviendra ensuite la IFT (Fédération Internationale de Tennis). Son but est de faire la promotion et de protéger l' intérêt du tennis mondial.\n                    </p>\n\n                    <p>\n                      A partir de 1900, chaque pays organise des tournois nationaux organisés et internationaux. La coupe Davis créée en 1900 par Dwight Davis va se populariser et devenir la plus grande compétition par équipe du monde. De 1896 à 1924 le Lawn tennis sera présent aux Jeux Olympiques. Les années 20 sont peut-être la plus belle page de l’histoire du tennis mondial. En 1925 le championnat de France devient international, c’est la naissance de Roland-Garros le plus grand tournoi de terre battue. Les années 20 sont également la période du règne des Français sur le tennis mondial. Avec les mousquetaires (Jean Borotra Henri Cochet René Lacoste Toto brugnon).\n                    </p>\n                  </div>\n                </div>\n              </div>\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n\n  <app-footer></app-footer>\n</div>\n");

