/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n  <img src=\"./assets/images/jouer-tennis.jpg\" alt=\"Los Angeles\" />\n  <div class=\"inner_carousel\">\n    <h3>oh my Tennis</h3>\n  </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n  <div class=\"banner_container\">\n    <h3>Réservez un cours particulier</h3>\n    <div class=\"row\">\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input class=\"form-control\" id=\"\" maxlength=\"6\" placeholder=\"Code Postal\" [(ngModel)]=\"Ville\" type=\"text\" />\n            <label><img src=\"./assets/images/ville_icon.png\" /></label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input type=\"text\" style=\"text-align:left!important;\" [min]=\"min\" class=\"form-control\" id=\"\"\n              placeholder=\"Date\" [(ngModel)]=\"Date\" [owlDateTime]=\"dt1\" [owlDateTimeTrigger]=\"dt1\" />\n            <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n            <label><img src=\"./assets/images/date_icon.png\" /> </label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n        <button (click)=\"handleClick($event)\" class=\"btn black_btn\">\n          Rechercher\n        </button>\n      </div>\n    </div>\n  </div>\n</div>\n<!-- Inner Search area ends -->\n\n<div class=\"lexique_content haspadd\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"lexique\">\n        <div class=\"page_title_div col-xs-12\">\n          <h1 class=\"page_title\">HISTOIRE DU TENNIS 1973</h1>\n          <img src=\"./assets/images/title_border.png\" alt=\"title_border\" />\n        </div>\n        <div class=\"clearfix\"></div>\n        <div class=\"col-md-12 col-sm-12 col-xs-12\">\n          <div class=\"wrapper1 center-block\">\n            <div class=\"panel-group\" id=\"accordion\" role=\"tablist\" aria-multiselectable=\"true\">\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"headingOne\">\n                  <h4 class=\"panel-title\">\n                    <a role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapseOne\"\n                      aria-expanded=\"true\" aria-controls=\"collapseOne\">\n                      Naissance du classement ATP et WTA\n                    </a>\n                  </h4>\n                </div>\n\n                <div id=\"collapseOne\" class=\"panel-collapse collapse in\" role=\"tabpanel\" aria-labelledby=\"headingOne\">\n                  <div class=\"panel-body\">\n                    <p>\n                      Un an après, le 23 août 1973 , l’A.T.P. instaure un\n                      classement mondial. Cette référence est encore utilisée\n                      actuellement pour désigner le meilleur joueur du monde\n                      (N°1 mondial au classement ATP). Notons que chez les\n                      femmes il est crée la WTA en 1975 (Women’s tennis\n                      Association) qui est aussi encore d’actualité pour nommer\n                      la meilleure joueuse du monde. L’ère Open commencé depuis\n                      1968 permet au tennis moderne et professionnel de naitre\n                      véritablement. Les quatre tournois du Grand Chelem,\n                      rendez-vous majeurs de la saison abandonnent leur statut\n                      de tournoi réservé aux amateurs, et ouvrent leurs portes\n                      aux joueurs professionnels. Peu à peu, l'ensemble des\n                      joueurs de circuit se professionnalise. C'est à partir de\n                      cette date que l'on considère le tennis professionnel\n                      comme moderne ; l'ère des statistiques et des records\n                      commence..\n                    </p>\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"headingTwo\">\n                  <h4 class=\"panel-title\">\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\"\n                      href=\"#collapseTwo\" aria-expanded=\"false\" aria-controls=\"collapseTwo\">\n                      Une révolution en marche mais qui depuis est resté stable\n                      dans sa formule\n                    </a>\n                  </h4>\n                </div>\n                <div id=\"collapseTwo\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"headingTwo\">\n                  <div class=\"panel-body\">\n                    <p>\n                      Ilie Nastase devient le premier joueur classé N°1 mondial à l'ATP et Chris Evert la première\n                      joueuse N°1 mondiale WTA. L'utilisation de l'informatique permet d’analyser les matchs et étudier\n                      les séquences de jeu 6. Elle commence à présent à tenir une place importante dans l'évolution des\n                      joueurs, puisque les entraîneurs l'utilisent même de nos jours à un niveau amateur. Le circuit\n                      avec ses 4 tournois du Grand Chelem , son classement ATP et WTA n’a pas beaucoup évolué depuis 40\n                      ans. On peut noter la courte existence d’un tournoi de 1990 à 1999 qui essaya de concurrencer le\n                      Masters (réunion des 8 meilleurs joueurs de la saison) qui s'appelait la coupe du Grand Chelem. Ce\n                      tournoi a fait polémique en raison de sa dotation énorme (1,5 million de dollars) et ne faisait\n                      pas partie du circuit ATP (tournoi exhibition).\n                    </p>\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"headingThree\">\n                  <h4 class=\"panel-title\">\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\"\n                      href=\"#collapseThree\" aria-expanded=\"false\" aria-controls=\"collapseThree\">\n                      Le grand Chelem reste la référence\n                    </a>\n                  </h4>\n                </div>\n                <div id=\"collapseThree\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"headingThree\">\n                  <div class=\"panel-body\">\n                    <p>\n                      L'exploit majeur du tennis masculin comme féminin demeure le Grand Chelem : gagner les quatre\n                      tournois majeurs la même année. Donald Budge l'a réussi mais à une époque où les tournois amateurs\n                      et professionnels étaient séparés ; l'Australien Rod Laver a réussi l'exploit de le réaliser à\n                      deux reprises : en 1962, mais aussi en 1969 sous l'ère « Open » alors que tous les joueurs étaient\n                      réunis sur un circuit mondial (l'ère Open démarre pour le tennis en 1968), ce qui constitue un\n                      authentique exploit. Les femmes sont plus nombreuses à l'avoir réalisé, avec notamment\n                      l'Australienne Margaret Smith Court en 1970, et l'Allemande Steffi Graf en 1988.\n                    </p>\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"headingfour\">\n                  <h4 class=\"panel-title\">\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\"\n                      href=\"#collapsefour\" aria-expanded=\"false\" aria-controls=\"collapsefour\">\n                      Le tennis en France\n                    </a>\n                  </h4>\n                </div>\n                <div id=\"collapsefour\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"headingfour\">\n                  <div class=\"panel-body\">\n                    <p>\n                      La politique de dirigeants comme Philippe Chatrier, président de la Fédération internationale de\n                      tennis de 1977 à 1991, est déterminante sur le plan international, mais plutôt mal préparée au\n                      niveau national. En effet, si le tennis quitte son habit de sport pour privilégiés et devient\n                      accessible, la mise en place d'une opération dénommée « 5000 courts », lancée par Philippe\n                      Chatrier et la Fédération Française de tennis, aura pour effet de déstabiliser économiquement les\n                      clubs existants en France en créant des micros-clubs composés d'un ou deux terrains sans réelle\n                      structure d'accueil; l'effet de saupoudrage sur le plan des adhérents se fera ressentir pendant\n                      des décennies et sera à l'origine de la crise du tennis français 7. Le tennis se popularise et\n                      compte plus d'un million de licenciés en France depuis le début des années 1980.\n                    </p>\n                  </div>\n                </div>\n              </div>\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n<!-- section3 ends -->\n\n<app-footer></app-footer>");

