/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n  <img src=\"./assets/images/jouer-tennis.jpg\" alt=\"Los Angeles\" />\n  <div class=\"inner_carousel\">\n    <h3>oh my Tennis</h3>\n  </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n  <div class=\"banner_container\">\n    <h3>Réservez un cours particulier</h3>\n    <div class=\"row\">\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input\n              class=\"form-control\"\n              id=\"\"\n              maxlength=\"6\"\n              placeholder=\"Code Postal\"\n              [(ngModel)]=\"Ville\"\n              type=\"text\"\n            />\n            <label><img src=\"./assets/images/ville_icon.png\"/></label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input\n              type=\"text\"\n              style=\"text-align:left!important;\"\n              \n              class=\"form-control\"\n              id=\"\"\n              placeholder=\"Date\"\n              [(ngModel)]=\"Date\"\n              [owlDateTime]=\"dt1\"\n              [owlDateTimeTrigger]=\"dt1\"\n            />\n            <!-- [min]=\"min\" -->\n            <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n            <label><img src=\"./assets/images/date_icon.png\" /> </label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n        <button (click)=\"handleClick($event)\" class=\"btn black_btn\">\n          Rechercher\n        </button>\n      </div>\n    </div>\n  </div>\n</div>\n<!-- Inner Search area ends -->\n\n<!-- section3 starts -->\n<div class=\"lexique_content haspadd\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"lexique\">\n        <div class=\"page_title_div col-xs-12\">\n          <h1 class=\"page_title\">Ohmytennis: Offre de service coach tennis</h1>\n          <img src=\"./assets/images/title_border.png\" alt=\"title_border\" />\n        </div>\n        <div class=\"clearfix\"></div>\n        <div class=\"col-md-12 col-sm-12 col-xs-12\">\n          <div class=\"wrapper1 center-block\">\n            <div\n              class=\"panel-group\"\n              id=\"accordion\"\n              role=\"tablist\"\n              aria-multiselectable=\"true\"\n            >\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading active\" role=\"tab\" id=\"headingOne\">\n                  <h4 class=\"panel-title\">\n                    <a\n                      role=\"button\"\n                      data-toggle=\"collapse\"\n                      data-parent=\"#accordion\"\n                      href=\"#collapseOne\"\n                      aria-expanded=\"true\"\n                      aria-controls=\"collapseOne\"\n                    >\n                      Cours particulier de tennis ou collectif à la demande\n                    </a>\n                  </h4>\n                </div>\n\n                <div\n                  id=\"collapseOne\"\n                  class=\"panel-collapse collapse in\"\n                  role=\"tabpanel\"\n                  aria-labelledby=\"headingOne\"\n                >\n                  <div class=\"panel-body\">\n                    <p>\n                      <b>Qu’est ce qu’un cours particulier de tennis ?</b>\n                      c’est un cours de tennis avec un élève sur le terrain. Vous avez la possibilité d’avoir un discours personnalisé\n                      et de jouer avec le professeur pendant toute l’heure.\n                    </p>\n\n                    <p>\n                      <b>Qu’est ce qu’un cours collectif de tennis ?</b> c’est\n                      un cours de tennis avec au moins 2 personnes. L’intérêt\n                      principal de ce genre de cours est la mutualisation des\n                      coûts (location et cours). Lien contextualisé : savez-vous\n                      comment vous préparez pour être en forme physique pour\n                      jouer au tennis ?\n                    </p>\n\n                    <p>\n                      <b>Faites un test avec votre prof de tennis avant de vous engager sur du plus long terme</b\n                      >\n                      c’est le meilleur moyen pour savoir si prendre un cours de\n                      tennis vous plaira avec le professeur choisi. En effet\n                      votre cours vous permettra d’avoir un retour réel\n                      d’expérience et d’envisager par la suite de continuer…\n                      Lien contextualisé : découvrez également notre offre\n                      concernant les stages de tennis\n                    </p>\n\n                    <p>\n                      <b\n                        >Selon votre future consommation de cours, le professeur de tennis vous conseillera sur les possibilités de tarifications de location de terrain.\n                      </b>\n                      Que cela soit pour un test, quelques cours ou un envie de\n                      reprendre le tennis sérieusement à l’année , vous avez la\n                      possibilité de jouer sur les tarifs de location des\n                      terrains. Les professeurs sur place connaissent les prix\n                      pratiqués qui varient d’un lieu à l’autre (valeur à\n                      l’unité ou pour la saison le plus souvent). Lien \n                      contextualisé : choisissez bien votre matériel de tennis\n                      pour jouer\n                    </p>\n\n                    <p>\n                      <b>Réservation d’un coach de tennis via le planning  </b>\n                      notre planning en ligne vous permet d’avoir un visibilité\n                      sur la disponibilité des professeurs tout au long de\n                      l’année. La plupart dispensent des cours collectifs en\n                      club le soir et le samedi donc sont indisponibles. Il\n                      existe des exceptions en semaine selon certains cas mais\n                      aussi pendant les vacances scolaires.\n                    </p>\n\n                    <p>\n                      <b>Confirmation de la réservation du cours de tennis (= réservation du terrain) dans les 24 heures</b\n                      >\n                      Nous essayons de répondre au plus vite à votre demande dès\n                      que nous en avons pris connaissance. Le but est de\n                      réserver rapidement un terrain selon les moyens qui sont\n                      mis à notre disposition (internet, standard téléphonique)\n                      mais il se peut que nous soyons déjà sur le terrain, ne\n                      soyez pas impatients nous nous occupons de vous dès que\n                      possible.\n                    </p>\n\n                    <p>\n                      <b>Rendez-vous sur le terrain à l’heure et jour dit (le moniteur peut venir vous chercher dans certains cas).\n                      </b>\n                      Notre équipe est fiable et ponctuelle car notre\n                      professionnalisme commence par la ponctualité. En effet\n                      les plannings de chacun étant souvent chargés il est\n                      préférable que tout le monde soit à l’heure c’est une\n                      question de respect mutuel.\n                    </p>\n\n                    <p>\n                      <b>Les balles sont fournies ainsi que le matériel pédagogique.\n                      </b>\n                      Le moniteur arrive sur le terrain munis de balles dans un sceau ou panier (environ une trentaine ou plus),vous\n                      n’avez pas à vous encombrer avec cela lors de votre venue.\n                      Il se peut que le moniteur ait également des bandelettes, des plots pour matérialiser le terrain ou un élastique\n                      (fil rouge) pour avoir un surfilet. Du matériel physique\n                      peut faire son apparition sur le court dans certains cas\n                      si c’est nécessaire (échelle, step).\n                    </p>\n\n                    <p>\n                      <b>Raquettes de prêt ou raquette de tennis recordée apportée sur le terrain quand nécessaire.</b\n                      >Si c’est votre premier cours il est possible de vous\n                      prêter une raquette avant de vous engager de façon ferme.\n                      Plutôt que de se donner rendez-vous,autant vous apporter\n                      directement la raquette lors de votre prochain cours sauf\n                      si vous projetez de jouer avec un ami entre temps auquel\n                      cas il faudra sûrement rejoindre le moniteur sur terrain\n                      pendant qu'il sera avec un autre élève.\n                    </p>\n\n                    <p>\n                      <b\n                        >Les services complémentaires liés aux cours particuliers de tennis.</b\n                      >\n                      Il est possible de vivre un cours de tennis C’est souvent\n                      après votre douche voire le lendemain que les courbatures\n                      se font sentir donc n’hésitez pas à vous étirez après\n                      votre séance afin d’éviter les mauvaises surprises. Vous\n                      êtes plein de nouvelles résolutions car les thèmes abordés\n                      vous ont permis d’entrevoir de nouvelles possibilités dans\n                      votre jeu.\n                    </p>\n\n                    <p>\n                      <b\n                        >Il est préférable de garder le même professeur afin d’assurer un suivi lors de votre encadrement.\n                      </b>\n                      Il est possible de vivre un cours de tennis si votre \n                      professeur vous convient, ne changez surtout pas ! Cela\n                      permet une relation de confiance et d’établir une\n                      programmation sur du moyen ou du long terme. En effet, il\n                      sera plus facile de transmettre un savoir au fur et à\n                      mesure des séances si vous adhérez au discours de votre\n                      enseignant. L’assiduité est primordiale si vous souhaitez\n                      évoluer dans votre jeu.\n                    </p>\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"headingTwo\">\n                  <h4 class=\"panel-title\">\n                    <a\n                      class=\"collapsed\"\n                      role=\"button\"\n                      data-toggle=\"collapse\"\n                      data-parent=\"#accordion\"\n                      href=\"#collapseTwo\"\n                      aria-expanded=\"false\"\n                      aria-controls=\"collapseTwo\"\n                    >\n                      Cours collectifs de tennis à l’année\n                    </a>\n                  </h4>\n                </div>\n                <div\n                  id=\"collapseTwo\"\n                  class=\"panel-collapse collapse\"\n                  role=\"tabpanel\"\n                  aria-labelledby=\"headingTwo\"\n                >\n                  <div class=\"panel-body\">\n                    <p>\n                      <b>L’engagement moral sur l’année de tennis:</b> lorsque\n                      vous prenez la décision de vous inscrire à des cours\n                      collectifs c’est un engagement ferme dès le début de\n                      l’année. En effet, vous réglez la totalité des cours qui\n                      commencent dès le mois de septembre jusqu’au mois de juin (environ 30 séances hors vacances scolaires). Dans\n                      certains clubs vous devez vous engager dès le mois de juin\n                      avec la possibilité de régler en plusieurs fois. Les séances où vous êtes absents ne seront pas remboursées et\n                      si les leçons sont dispensées dehors le club doit\n                      s’engager sur un minimum de séances (cas de pluie, neige).\n                    </p>\n\n                    <p>\n                      <b>Prix tennis fixe à l’adhésion</b> a l’inverse des cours\n                      collectifs à la demande, le prix reste fixe à l’année avec\n                      la possibilité d’obtenir des réductions (dans certains\n                      clubs) si vous êtes plusieurs membres de la même famille à\n                      vous inscrire. Ce prix inclut également la licence qui est\n                      obligatoire pour être protégé des risques inhérents à la\n                      pratique sportive. L’adhésion au club entraîne de facto\n                      l’adhésion à la ligue de Tennis du département auquelle\n                      est rattachée le club et par la même occasion à la\n                      Fédération Française  de Tennis. Enfin il vous sera demandé\n                      un certificat médical de non contre indication à la\n                      pratique sportive (vous pouvez le faire via votre médecin\n                      généraliste).\n                    </p>\n\n                    <p>\n                      <b\n                        >Créneau fixe, même enseignant de tennis à l’année durant les périodes hors vacances scolaires</b\n                      >\n                      les cours sont proposés sur le principe du créneau horaire\n                      (exemple : lundi 19h à 20h) avec le même professeur\n                      pendant toute l‘année hors vacances scolaires. Des\n                      changements sont possibles durant les 2/3 premières séances\n                      si le niveau par exemple n’est pas homogène. Le but étant\n                      d’avoir un rendez vous régulier afin de pouvoir progresser\n                      dans le temps suivant une programmation établie par le\n                      moniteur.\n                    </p>\n\n                    <p>\n                      <b>Offres proposées via les clubs de tennis</b>\n                      s’inscrire dans un club de tennis vous oblige à respecter\n                      le règlement intérieur, vous permet de participer à la\n                      vie du club si vous le souhaitez (animations, tournois,\n                      bénévolat). Il est également possible d’acheter des places\n                      pour le tournoi de Roland Garros et Bercy, vous serez\n                      prévenu par email de l’ouverture des réservations par la\n                      Fédération Française de Tennis si vous acceptez d’en\n                      recevoir les informations.\n                    </p>\n\n                    <p>\n                      <b\n                        >remplir ou constituer des groupes (maximum 6 élèves) par terrain de tennis\n                      </b>\n                      le site Ohmytennis.com vous propose un maximum  de choix\n                      afin de compléter des groupes déjà existants ou de les\n                      constituer si vous connaissez des gens qui sont prêts à jouer avec vous. L’objectif étant de donner de la\n                      visibilité aux créneaux proposés pour les gens souhaitant\n                      s’inscrire dans un club de tennis.\n\n                    </p>\n                  </div>\n                </div>\n              </div>\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n\n<!-- section3 ends -->\n\n<app-footer></app-footer>\n");

