/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n    <img src=\"./assets/images/cours-particuliers-de-tennis.jpg\" alt=\"Los Angeles\" />\n    <div class=\"inner_carousel\">\n        <h3>Oh My Tennis</h3>\n    </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n    <div class=\"banner_container\">\n        <h3>Réservez un cours particulier</h3>\n        <div class=\"row\">\n            <form class=\"text-left\" [formGroup]=\"coachform\" (ngSubmit)=\"onSubmitCoach()\">\n                <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n                    <div class=\"form-group\">\n                        <div class=\"addon-lg\">\n                            <input class=\"form-control\" id=\"\" maxlength=\"6\" placeholder=\"Code Postal\" type=\"text\"\n                                formControlName=\"code_postal\" />\n                            <label><img src=\"./assets/images/ville_icon.png\" /></label>\n                        </div>\n                    </div>\n                </div>\n                <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n                    <div class=\"form-group\">\n                        <div class=\"addon-lg\">\n                            <input type=\"text\" style=\"text-align:left!important;\" [min]=\"min\" class=\"form-control\" id=\"\"\n                                placeholder=\"Date\" [owlDateTime]=\"dt1\" [owlDateTimeTrigger]=\"dt1\"\n                                formControlName=\"Date\" />\n                            <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n                            <label><img src=\"./assets/images/date_icon.png\" /> </label>\n                        </div>\n                    </div>\n                </div>\n                <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n                    <button type=\"submit\" [disabled]=\"!coachform.valid\" class=\"btn black_btn\">\n                        Rechercher\n                    </button>\n                </div>\n            </form>\n        </div>\n    </div>\n</div>\n<!-- Inner Search area ends -->\n\n<!-- section1 starts -->\n<div class=\"section1 content_secs des_titre_list haspadd\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"page_title_div\">\n                    <h1 class=\"page_title\">La combativité au tennis pour travailler son mental                    </h1>\n                    <img src=\"./assets/images/title_border.png\" alt=\"title_border\" />\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <p>\n                    Définition : en traduction littérale c’est le langage du corps. Notre corps va donner des informations à notre adversaire qu’il faut savoir maîtriser\n\n                </p>\n                <h3><strong>Situation de jeu pour être combatif sur le terrain de tennis :</strong></h3>\n                <p>\n                    Votre body langage s’exprime durant tout le match, c’est surtout durant les situations difficiles que l’on doit se montrer présent. C’est de toute façon une façon d’être qu’il faut avoir tout le temps pour ne pas montrer ses faiblesses à l’extérieur.\n\n                </p>\n                <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                    '/' + this._const('PATH.TENNIS.FORMEPHYSIQUE.SELF')\n                  }}\">Améliorer votre condition physique pour jouer au tennis</a></strong></p>\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/concept_present1.jpg\" class=\"center-block\"\n                    alt=\"tennis mental / le mental au tennis\" />\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/concept_present2.jpg\" class=\"center-block\"\n                    alt=\"tennis mental coaching / améliorer son mental tennis coaching\" />\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h2><strong>Objectifs du mental au tennis grâce à la combativité :\n\n                    </strong></h2>\n                <p>\n                    Il faut être capable de montrer à son adversaire que l’on existe du début à la fin du match. Cela va même commencer dès votre prise de contact avec une poignée de main franche ainsi qu’un regard droit dans les yeux afin de montrer que vous êtes simplement prêt à vous battre. \nDurant votre match restez bien droit avec le torse un peu bombé pour montrer que vous êtes fier. N’hésitez pas à croiser le regard de votre d’adversaire aux changements de côté. Faites des gestes lents et mesurés pour montrer votre calme. N’hésitez pas à serrer le point quand vous gagnez un point important en serrant le visage pour montrer votre combativité. Si vous souhaitez enfoncer le clou, criez « allez » lors d’un point gagné et regardez fixement votre adversaire pour le déstabiliser. \nIl est important de noter que tous ces gestes doivent être faits dans un souci de fair-play du jeu en respectant votre adversaire.\n\n                </p>\n               \n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h5><strong>Erreurs à éviter du body language au tennis \n\n                    </strong></h5>\n                    <p>\n                        Avoir le corps rentré sur lui-même et regarder constamment ses chaussures tête baissée. Éviter de montrer des gestes parasites qui pourrait souligner une certaine nervosité durant la partie surtout avec les bras ou les jambes. Dès que vous voyez des signes avant-coureurs, n’hésitez pas à souffler un grand coup pour évacuer toute votre frustration.\n\n                    </p>\n                    <h3><strong>Points essentiels à retenir pour le body language au tennis \n\n                    </strong></h3>\n                <p>\n                    -Regarder droit devant vous \n\n\n                </p>\n                <p>\n                    -Bomber le torse\n                </p>\n                <p>-Poing serré en criant allez sur les points importants</p>\n                <p>-Gestes calmes et lents</p>\n                <p>-Montrer à votre adversaire que vous êtes présents</p>\n                <h3><strong>La gestion des émotions au tennis en restant positif\n                </strong></h3>\n                <p>\n                    Définition : qui a un effet, un résultat favorable ou qui constitue une étape dans une progression\n\n\n\n                </p>\n              \n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/concept_present3.jpg\" class=\"center-block\"\n                    alt=\"coaching mental tennis /  travailler le mental au tennis\" />\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/jouer-au-tennis.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h3><strong>Situation de jeu pour rester positif  :</strong></h3>\n                <p>\n                    Vous êtes en train de perdre mais vous voyez bien que votre adversaire est à votre portée si vous jouez mieux. C’est un cas difficile à accepter qui peut vous rendre très énervé et produire plein de pensées négatives. La perte du premier set doit être une vraie alerte pour changer de comportement.\n\n                </p>\n                <h3><strong>Objectifs de la gestions des émotions au tennis :\n                </strong></h3>\n                <p>\n                    Rester impliqué dans votre jeu même si le score est en votre défaveur. Vous devez analyser ce qui ne fonctionne pas en priorité (technique ou tactique) afin de gagner plus de points. Votre objectif est de remonter au score point par point sans trop se projeter et surtout de maintenir cet effort. Soyez autocritique pour vous améliorer et encouragez vous lorsque vous gagnez des points pour montrer à votre adversaire que vous êtes toujours là.\n                    Si vous avez perdu le premier set, l’entame de la seconde manche est primordiale pour faire douter votre adversaire. Pas de problème ce premier set je l’oublie, c’est une nouvelle chance qui s’offre à moi. En effet, si rien ne change à ce moment-là, vous laissez la possibilité d’entrevoir la victoire en face.\n                    \n                </p>\n                <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                    '/' + this._const('PATH.TENNIS.APPRENDRETECHNIQUE.SELF')\n                  }}\">Savez vous également faire un coup droit au tennis ?</a></strong></p>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h3>Erreurs à éviter pour rester positif \n                </h3>\n                <p>\n                    Se lamenter sur son sort et voir tout de façon négative ne vous permettra pas d’être serein pour changer le cours du match. Pire encore si vous balancez la partie autant rentrer chez vous, si vous rentrez sur le terrain c’est pour tout donner jusqu’au dernier point et avoir la conscience tranquille pour ne pas avoir de regrets.\n                </p>\n                <h3><strong>Points essentiels à retenir pour rester positif\n                </strong></h3>\n                <p>-Ne pas s’énerver si vous perdez\n                </p>\n                <p>-Soyez autocritique sur votre jeu (technique ou tactique) pour vous améliorer vite</p>\n                <p>-Jouer point par point et penser toujours à la remontée du score</p>\n                <p>-Montrer à votre adversaire que vous exister encore (encouragez vous)</p>\n                <p>-Eviter de vous lamenter ou de balancer la partie </p>\n                <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                    '/' + this._const('PATH.TENNIS.APPRENDRETACTIQUE.SELF')\n                  }}\">Découvrez les bases de la tactique au tennis </a></strong></p>\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/concept1.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n            </div>\n        </div>\n    </div>\n</div>\n<!-- section1 ends -->\n<!-- section2 starts -->\n<div class=\"section2 des_titre_backtext\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"des_back_content\">\n                    <h4>\n                        Nous avons créé un univers spécialement dédié au tennis pour nos passionnés + flouter Wilson\n                        raquette\n                    </h4>\n                </div>\n            </div>\n        </div>\n    </div>\n</div>\n<app-footer></app-footer>");

