/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n    <img src=\"./assets/images/cours-particuliers-de-tennis.jpg\" alt=\"Los Angeles\" />\n    <div class=\"inner_carousel\">\n        <h3>Oh My Tennis</h3>\n    </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n    <div class=\"banner_container\">\n        <h3>Réservez un cours particulier</h3>\n        <div class=\"row\">\n            <form class=\"text-left\" [formGroup]=\"coachform\" (ngSubmit)=\"onSubmitCoach()\">\n                <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n                    <div class=\"form-group\">\n                        <div class=\"addon-lg\">\n                            <input class=\"form-control\" id=\"\" maxlength=\"6\" placeholder=\"Code Postal\" type=\"text\"\n                                formControlName=\"code_postal\" />\n                            <label><img src=\"./assets/images/ville_icon.png\" /></label>\n                        </div>\n                    </div>\n                </div>\n                <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n                    <div class=\"form-group\">\n                        <div class=\"addon-lg\">\n                            <input type=\"text\" style=\"text-align:left!important;\" [min]=\"min\" class=\"form-control\" id=\"\"\n                                placeholder=\"Date\" [owlDateTime]=\"dt1\" [owlDateTimeTrigger]=\"dt1\"\n                                formControlName=\"Date\" />\n                            <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n                            <label><img src=\"./assets/images/date_icon.png\" /> </label>\n                        </div>\n                    </div>\n                </div>\n                <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n                    <button type=\"submit\" [disabled]=\"!coachform.valid\" class=\"btn black_btn\">\n                        Rechercher\n                    </button>\n                </div>\n            </form>\n        </div>\n    </div>\n</div>\n<!-- Inner Search area ends -->\n\n<!-- section1 starts -->\n<div class=\"section1 content_secs des_titre_list haspadd\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"page_title_div\">\n                    <h1 class=\"page_title\">L’endurance et la préparation physique</h1>\n                    <img src=\"./assets/images/title_border.png\" alt=\"title_border\" />\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <p>\n                    Définition endurance: capacité à maintenir un effort avec la même intensité pendant une longue durée\n                </p>\n                <h3><strong>A quoi ça sert l’endurance au tennis ?</strong></h3>\n                <p>\n                    L’endurance est le socle fondamental de toute activité physique du débutant jusqu’au joueur\n                    professionnel. C’est un travail qui se fait régulièrement au moins une fois par semaine et qui\n                    permet l’augmentation de la charge d'entraînement (intensité et durée). Cela permet d’exprimer une\n                    volonté, une force de l’esprit car la résistance morale à la fatigue ce n’est pas inné. Courir n’est\n                    pas forcément l’activité la plus sympa , mais si on arrive à se faire violence alors on est prêt à\n                    tout mentalement !\n                </p>\n                <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                    '/' + this._const('PATH.TENNIS.APPRENDRETACTIQUE.SELF')\n                  }}\">Vous voulez apprendre une nouvelle tactique au tennis ?</a></strong></p>\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/concept_present1.jpg\" class=\"center-block\"\n                    alt=\"entrainement physique pour le tennis / entrainement physique du tennis\" />\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/concept_present2.jpg\" class=\"center-block\"\n                    alt=\"exercice physique tennis / travailler le physique au tennis\" />\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h2><strong>Descriptif du travail de l’exercice physique au tennis :  le footing\n                    </strong></h2>\n                <p>\n                    C’est peut être l’activité qui se met le plus facilement en place car il n’y pas beaucoup de\n                    contraintes. Si vous n’avez jamais couru de votre vie pas de problème , commencez par 5 ou 10\n                    minutes à une allure que vous pouvez tenir sans problème. Votre objectif sera toujours de faire\n                    mieux la prochaine fois en augmentant petit à petit le temps. Votre objectif sera d’être capable de\n                    tenir au moins 40 minutes par séance.\n                </p>\n                <p>\n                    Ne courez surtout pas sur le bitume mais plutot sur de la terre ou sur un tapis en salle. Prenez le\n                    temps de respirer par la bouche pendant l’effort pour oxygéner les muscles en ayant les mains\n                    relâchées. Il est nécessaire d’acheter des chaussures de running pour éviter de vous blesser très\n                    gravement. Les grandes différences avec les chaussures de tennis concernent l’amorti de la semelle\n                    non plate et la tenue de cheville qui reste plus libre : c’est normal car quand on coure on ne\n                    s’arrête pas !\n                </p>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h5><strong>Points clés  à retenir sur l’endurance pour la préparation physique tennis\n                    </strong></h5>\n                <p>\n                    - Etre capable de courir une fois par semaine\n                </p>\n                <p>\n                    - Acheter des chaussures de running pour éviter de se blesser gravement\n                </p>\n                <p>\n                    -Commencez petit à petit\n                </p>\n                <p>\n                    - Faire toujours mieux que la fois précédente\n                </p>\n                <p>\n                    - Objectif à terme 40 minutes\n                </p>\n                <p>\n                    - Respirez par la bouche et relâchez vos mains\n                </p>\n                <h3><strong>Travail de la motricité au tennis (exercice physique)</strong></h3>\n                <p>\n                    Définition motricité : Ensemble de fonctions musculaires et nerveuses permettant les mouvements\n                    volontaires ou automatiques du corps pour aller vers une balle et la frapper avec sa raquette.\n                </p>\n                <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                    '/' + this._const('PATH.TENNIS.APPRENDREMENTAL.SELF')\n                  }}\">Travailler son mental au tennis c'est possible , découvrez comment </a></strong></p>\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/concept_present3.jpg\" class=\"center-block\"\n                    alt=\"physique tennis / exercice physique  au tennis\" />\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/jouer-au-tennis.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h3><strong>A quoi ça sert la motricité au tennis ? </strong></h3>\n                <p>\n                    Retrouver les problématiques liées au terrain et l’urgence d’un échange. Lorsqu’un point est joué beaucoup de données sont à analyser afin d’éviter au maximum l’inconnu. Il faut donc introduire le maximum d’exercice avec une balle pour exercer l’œil et le corps à s’adapter à différents paramètres tels que la trajectoire, la vitesse, l’effet, le poids, la hauteur. Pour information il en existe d’autres également comme le vent, le soleil, la surface du terrain.\nTout ceci a pour objectif de visualiser un rebond de balle et votre future frappe devant votre corps et sur le côté pour être le plus efficace possible. Ce sera une condition préalable pour effectuer un déplacement précis et se mettre à bonne distance de la balle pour pouvoir exprimer à votre tour votre technique.\n\n                </p>\n                <h3><strong>Descriptif des exercices physiques liés à la motricité tennis:  \n                     </strong></h3>\n                <p>\n                    La motricité s’articule autour de 3 éléments principaux qu’il faut appliquer au tennis : \n                </p>\n                <ul>\n                    <li>Coordination : utilisation de notre mauvaise main (main gauche pour le droitier et main droite pour le gaucher) pour rattraper une balle. Synchronisation bras/jambe sur un mouvement déterminé.\n                    </li>\n                    <li>Dissociation du haut et du bas du corps : Utilisation en parallèle de la main et du pied avec deux actions différentes.\n                    </li>\n                    <li>Proprioception : être capable d’attraper une balle ou frapper une balle malgré un déséquilibre\n                    </li>\n                </ul>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h3>Points clés à retenir sur la motricité tennis </h3>\n                <ul>\n                    <li>Une balle envoyée est un ensemble de paramètre à analyser et à anticiper si possible pour appréhender le rebond\n                    </li>\n                    <li>Utiliser la motricité pour frapper idéalement une balle de tennis et ainsi être efficace.\n                    </li>\n                    <li>Coordination, proprioception, dissociation à travailler avec une balle de tennis</li>\n                </ul>\n                <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                    '/' + this._const('PATH.TENNIS.APPRENDRETECHNIQUE.SELF')\n                  }}\">Comment faire un coup droit au tennis ?</a></strong></p>\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/concept1.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n            </div>\n        </div>\n    </div>\n</div>\n<!-- section1 ends -->\n<!-- section2 starts -->\n<div class=\"section2 des_titre_backtext\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"des_back_content\">\n                    <h4>\n                        Nous avons créé un univers spécialement dédié au tennis pour nos passionnés + flouter Wilson\n                        raquette\n                    </h4>\n                </div>\n            </div>\n        </div>\n    </div>\n</div>\n<app-footer></app-footer>");

