/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n    <img src=\"./assets/images/cours-particuliers-de-tennis.jpg\" alt=\"Los Angeles\" />\n    <div class=\"inner_carousel\">\n        <h3>Oh My Tennis</h3>\n    </div>\n</div>\n<!-- Banner ends -->\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n    <div class=\"banner_container\">\n        <h3>Réservez un cours particulier</h3>\n        <div class=\"row\">\n            <form class=\"text-left\" [formGroup]=\"coachform\" (ngSubmit)=\"onSubmitCoach()\">\n                <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n                    <div class=\"form-group\">\n                        <div class=\"addon-lg\">\n                            <input class=\"form-control\" id=\"\" maxlength=\"6\" placeholder=\"Code Postal\" type=\"text\"\n                                formControlName=\"code_postal\" />\n                            <label><img src=\"./assets/images/ville_icon.png\" /></label>\n                        </div>\n                    </div>\n                </div>\n                <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n                    <div class=\"form-group\">\n                        <div class=\"addon-lg\">\n                            <input type=\"text\" style=\"text-align:left!important;\" [min]=\"min\" class=\"form-control\" id=\"\"\n                                placeholder=\"Date\" [owlDateTime]=\"dt1\" [owlDateTimeTrigger]=\"dt1\"\n                                formControlName=\"Date\" />\n                            <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n                            <label><img src=\"./assets/images/date_icon.png\" /> </label>\n                        </div>\n                    </div>\n                </div>\n                <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n                    <button type=\"submit\" [disabled]=\"!coachform.valid\" class=\"btn black_btn\">\n                        Rechercher\n                    </button>\n                </div>\n            </form>\n        </div>\n    </div>\n</div>\n<!-- Inner Search area ends -->\n\n<!-- section1 starts -->\n<div class=\"section1 content_secs des_titre_list haspadd\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"page_title_div\">\n                    <h1 class=\"page_title\">L’attaque au tennis avec la montée au filet concernant l’intention de jeu\n                    </h1>\n                    <img src=\"./assets/images/title_border.png\" alt=\"title_border\" />\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <p>\n                    Définition d’une intention de jeu : résolution prise par une personne d'agir et d'atteindre un ou\n                    des objectifs fixés à l'avance, cette décision est définitive\n\n                </p>\n                <h3><strong>Descriptif de la montée au filet au tennis :</strong></h3>\n                <p>\n                    Il est important de ne jamais changer d’intention de jeu au dernier moment (une fois placé sur la\n                    balle). Vous devez continuer votre démarche jusqu’au bout même si vous vous rendez compte que ce\n                    choix n’est pas le plus approprié. Le fait de changer d’avis au dernier instant sera encore pire au\n                    niveau de votre réalisation : le cerveau ne peut pas intégrer tous les paramètres à modifier en\n                    moins d’une seconde\n                </p>\n\n                <p><span>Zone : Pensez de façon assez simple et claire sur ce type de coup pour vous faciliter la tâche\n                        dans\n                        votre réalisation deux possibilités :</span></p>\n                <p>\n                <ol>\n                    <li>1) Vous essayez de jouer soit loin de votre adversaire (débordement) plutôt sur son revers .\n                    </li>\n                    <li>2) Vous essayez de jouer plein champ sur lui proche de ses pieds (fixation) , c’est plus risqué\n                        car il faut être précis mais c’est très déroutant pour le défenseur (aucun angle).\n                    </li>\n                </ol>\n                <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                    '/' + this._const('PATH.TENNIS.APPRENDRETECHNIQUE.SELF')\n                  }}\">Vous avez envie de progresser en coup droit au tennis ? </a></strong></p>\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/concept_present1.jpg\" class=\"center-block\"\n                    alt=\"apprendre tactique tennis / réaliser tactique tennis\" />\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/concept_present2.jpg\" class=\"center-block\"\n                    alt=\"tactique tennis debutant / progresser tactique tennis\" />\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n\n                <p>\n                    <span>Effet :</span>le but est d’utiliser un effet plat/légèrement lifté pour permettre à la balle\n                    de\n                    traverser l’air le plus rapidement possible et ainsi gagner du temps sur votre adversaire (plutôt\n                    utilisé sur le débordement).Vous pouvez également jouer coupé si vous préférez gêner votre\n                    adversaire (plutôt utilisé en fixation)\n\n\n                </p>\n                <p>\n\n                    <span>Risque :</span>votre rebond de balle doit se rapprocher des lignes . Il faut favoriser les\n                    trajectoires de\n                    balles plus courtes que d’habitude : préférence pour le long de ligne (moins de chemin parcouru par\n                    la balle que les balles croisées) , plus proche du filet (moins de hauteur donc moins de chemin\n                    parcouru par la balle).\n\n                </p>\n                <h2><strong>Points essentiels à retenir pour monter au filet au tennis : </strong></h2>\n                <ul>\n                    <li>Pas de changement d’avis au dernier moment\n                    </li>\n                    <li>Jouer simple (débordement ou fixation).\n                    </li>\n                    <li> Effet : plat/lifté (priver de temps son adversaire)ou coupé (gêner son adversaire)\n                        .\n                    </li>\n                    <li>Risque : plus proche des lignes , jouer long de ligne , moins haut par rapport au filet\n\n                    </li>\n                </ul>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h3><strong>La neutralité au tennis avec pour objectif de jouer long </strong></h3>\n                <p><span>Définition de votre objectif :</span> le but sur ce type de balle est d’obtenir une faute ou se\n                    procurer une balle courte</p>\n                <p>Ma position : Je vais commencer à m’éloigner de la ligne de fond de court pour essayer de me donner\n                    du temps pour réagir. Je me retrouve à plus de 50 cm voire 1 mètre derrière la ligne pour jouer ma\n                    prochaine frappe.\n                </p>\n                <p>La position de mon adversaire : mon adversaire est dans le terrain, il a quitté sa ligne de fond de\n                    court. Il a effectué un déplacement vers l’avant et ses deux pieds se rapprochent du carré de\n                    service.\n                </p>\n                <p>Il est important de noter que dans cette situation , ma position de défenseur est très délicate car\n                    je cède du temps et de l’espace sur mon adversaire. Ceci va induire des prises de décisions dans\n                    l’urgence m ‘empêchant de m’organiser comme je le souhaite.</p>\n\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/concept_present3.jpg\" class=\"center-block\"\n                    alt=\"montée filet tennis / améliorer la montée au filet tennis\" />\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/jouer-au-tennis.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h3><strong>Deux cas à retenir : </strong></h3>\n                <ul>\n                    <li>Coup réflexe suite à une balle très puissante : je n’ai même pas le temps de commencer à\n                        préparer , je suis déjà en retard.\n                    </li>\n                    <li>Je suis très loin la balle mais je sais que je vais (peut-être) la toucher : elle me dépasse ,\n                        je vais donc avoir un plan de frappe derrière moi et je ne pourrai pas jouer croisé\n                        (impossibilité de pivoter la hanche à la frappe). J’ai donc effectué un très grand déplacement\n                        avec un sprint du début à la fin.</li>\n                </ul>\n                <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                    '/' + this._const('PATH.TENNIS.APPRENDREMENTAL.SELF')\n                  }}\">Améliorer votre approche mental sur le terrain de tennis</a></strong></p>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h3>Points essentiels à retenir pour la situation défense au tennis </h3>\n                <ul>\n                    <li>J’ai délivré une balle courte (proche du filet) et lente</li>\n                    <li>Je manque de temps et d’espace (coup réflexe à jouer ou grand déplacement à faire) mais je\n                        vais toucher la balle\n                    </li>\n                    <li>Ma position est loin du centre\n                    </li>\n                    <li>Mon adversaire est dans le terrain\n                    </li>\n                    <li>Situation d’urgence absolue\n                    </li>\n                </ul>\n                <h3>La neutralité au tennis avec pour objectif de jouer long</h3>\n                <p>Définition de votre objectif : le but sur ce type de balle est d’obtenir une faute ou se procurer une\n                    balle courte</p>\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/concept1.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n            </div>\n        </div>\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/jouer-au-tennis.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h3><strong>Descriptif de la neutralité au tennis :</strong></h3>\n                <ol>\n                    <li>1) Obtenir une balle faute sur une situation de neutralité :\n                        On appelle ce type de faute , la faute non provoquée ou la faute directe. La prise de risque est\n                        très mesurée et permet de gagner le point. C’est la situation idéale pour ceux qui ont peur\n                        d’attaquer. Cela peut atteindre certaines limites lors de la finition du point (venir à la volée\n                        ou accélération de balle) et vous bloquer par la suite pour progresser. Vous serez amené à\n                        perdre des points à trop vouloir assurer , il faut savoir saisir sa chance . A noter également\n                        que ce type de faute arrive de moins en moins plus votre adversaire est fort.</li>\n                    <li>2) Se procurer une balle courte : on bascule dans la situation d’attaque (voir tactique –\n                        attaque). Votre rythme de jambes sur le déplacement vers la balle doit s’accélérer pour prendre\n                        du temps sur votre adversaire ainsi que de l’espace. Il faudra alors prendre plus de risque dans\n                        cette situation mais ils seront justifiés par la situation que vous aurez créée.</li>\n                </ol>\n                <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                    '/' + this._const('PATH.TENNIS.APPRENDRETACTIQUE.SELF')\n                  }}\">Envie de progresser également au niveau tactique au tennis ? </a></strong></p>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <p>Garder la balle dans le terrain tout en jouant long est la priorité du joueur de tennis lorsqu’il\n                    commence son échange dans le point. En effet, cela lui permet de repousser l’adversaire pour se\n                    protéger d’éventuelles attaques sans prendre trop de risques. Si votre adversaire est loin , il aura\n                    forcément moins de précisions dans ces coups. Les balles jouées ont des vitesses moyennes.</p>\n                <h3>Points essentiels à retenir pour la situation de défense au tennis</h3>\n                <ul>\n                    <li>- Je prends des risques mesurés en gardant la balle dans le terrain\n                    </li>\n                    <li>- Obtenir une balle faute\n                    </li>\n                    <li>- Se procurer une balle courte\n                    </li>\n                    <li>- Repousser l’adversaire et me protégeant d'éventuelles attaques\n                    </li>\n                    <li>- Vitesse moyenne de balle\n                    </li>\n                </ul>\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/concept1.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n            </div>\n        </div>\n\n\n    </div>\n</div>\n<!-- section1 ends -->\n<!-- section2 starts -->\n<div class=\"section2 des_titre_backtext\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"des_back_content\">\n                    <h4>\n                        Nous avons créé un univers spécialement dédié au tennis pour nos passionnés + flouter Wilson\n                        raquette\n                    </h4>\n                </div>\n            </div>\n        </div>\n    </div>\n</div>\n<app-footer></app-footer>");

