/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n    <img src=\"./assets/images/cours-particuliers-de-tennis.jpg\" alt=\"Los Angeles\" />\n    <div class=\"inner_carousel\">\n        <h3>Oh My Tennis</h3>\n    </div>\n</div>\n<!-- Banner ends -->\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n    <div class=\"banner_container\">\n        <h3>Réservez un cours particulier</h3>\n        <div class=\"row\">\n            <form class=\"text-left\" [formGroup]=\"coachform\" (ngSubmit)=\"onSubmitCoach()\">\n                <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n                    <div class=\"form-group\">\n                        <div class=\"addon-lg\">\n                            <input class=\"form-control\" id=\"\" maxlength=\"6\" placeholder=\"Code Postal\" type=\"text\"\n                                formControlName=\"code_postal\" />\n                            <label><img src=\"./assets/images/ville_icon.png\" /></label>\n                        </div>\n                    </div>\n                </div>\n                <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n                    <div class=\"form-group\">\n                        <div class=\"addon-lg\">\n                            <input type=\"text\" style=\"text-align:left!important;\" [min]=\"min\" class=\"form-control\" id=\"\"\n                                placeholder=\"Date\" [owlDateTime]=\"dt1\" [owlDateTimeTrigger]=\"dt1\"\n                                formControlName=\"Date\" />\n                            <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n                            <label><img src=\"./assets/images/date_icon.png\" /> </label>\n                        </div>\n                    </div>\n                </div>\n                <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n                    <button type=\"submit\" [disabled]=\"!coachform.valid\" class=\"btn black_btn\">\n                        Rechercher\n                    </button>\n                </div>\n            </form>\n        </div>\n    </div>\n</div>\n<!-- Inner Search area ends -->\n<!-- section1 starts -->\n<div class=\"section1 content_secs des_titre_list haspadd\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"page_title_div\">\n                    <h1 class=\"page_title\">Billetterie</h1>\n                    <img src=\"./assets/images/title_border.png\" alt=\"title_border\" />\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h3><strong>Où est-il possible d'acheter des billets tennis et pour quel événement ?</strong></h3>\n                <p>\n                    Tout au long de l'année les tournois de tennis de l'ATP sont organisés pour voir les joueurs\n                    professionnels évoluer sur les plus grands stades. Vous avez la possibilité sur chaque événement de\n                    trouver des billets qui sont mis en vente. Il existe différents réseaux permettant la mise en place\n                    d'une billetterie qu'elle soit propre à l'événement (site internet du tournoi) ou mis à disposition\n                    via des gros réseaux de distribution.\n                </p>\n                <h2><strong>Quand est-il possible de faire des achats de billets pour Roland Garros ou un autre tournoi ?</strong></h2>\n                <p>\n                    Il est évident que plus le tournoi est important qu' il faut s'y prendre en avance pour acheter des\n                    billets. Cela peut aller de quelques mois (exemple Roland-Garros ou BNP Paribas masters Bercy) à\n                    quelques semaines pour un tournoi de tennis ATP de moindre importance (exemple tournoi ATP 250). Les\n                    places de tennis pour assister à ces tournois sont très demandées.\n                </p>\n                <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                    '/' + this._const('PATH.TENNIS.CIRCUITATP_ACTUALITES.SELF')\n                  }}\">Suivez l'actu de vos joueurs de tennis préférés ici</a></strong></p>\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/concept_present1.jpg\" class=\"center-block\"\n                    alt=\"billet Roland Garros / billets Roland Garros\" />\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/concept_present2.jpg\" class=\"center-block\"\n                    alt=\"prix place Roland Garros / prix places Roland Garros\" />\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h5><strong>Quels sont les tournois de tennis organisés en France sur le circuit ATP ?</strong></h5>\n                <p>\n                    Il y a donc deux événements majeurs de tennis dans le calendrier qui sont Roland Garros en juin et\n                    le BNP Paribas masters Bercy en octobre. Vous avez également la possibilité\n                </p>\n                <h3><strong>d'assister à quatre tournois ATP 250 durant l'année comme :</strong></h3>\n                <p>\n                    -Open Sud France : Montpellier 21 au 28 février\n                </p>\n                <p>\n                    -Open de Moselle : Metz 19 au 26 septembre\n                </p>\n                <p>\n                    -Open 13 Provence : 7 au 14 mars à Marseille\n                </p>\n                <p>\n                    -Open Auvergne Parc Rhône-Alpes Lyon : 15 au 22 mai\n                </p>\n                <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                    '/' + this._const('PATH.TENNIS.CIRCUITATP_LIVESCORE.SELF')\n                  }}\">Découvrez en live les scores de tennis </a></strong></p>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h5><strong>Pourquoi acheter de la billetterie tennis ?\n                    </strong></h5>\n                <p>\n                    C'est une occasion unique de voir évoluer les joueurs professionnels en vrai afin de percevoir tous\n                    les éléments du tennis en vrai. Vous allez pouvoir décrypter en réel toute la technique, la\n                    tactique, le physique et le mental comme si vous étiez dans votre club de tennis. Le son de l'impact\n                    de balle, les déplacements sur le terrain de tennis, l'électricité des spectateurs, les émotions des\n                    joueurs sont amplifiés par rapport au spectacle télévisuel. Plus vous aurez la chance d'être près du\n                    cours de tennis et plus vous serez au cœur de l'événement. Ne vous inquiétez pas, même les sièges\n                    les plus hauts permettront d'assister à de très beaux matchs de tennis.\n                </p>\n                <h5><strong>Quel est le prix de vente d'un billet de tennis ?\n                    </strong></h5>\n                <p>\n                    Vous avez la possibilité d'avoir le choix dans les prix selon l'importance du tournoi et aussi du\n                    jour (tour) auquel vous venez. Il est évident que venir sur un match du premier tour vous coûtera\n                    moins cher que le jour de la finale. De la même façon, plus vous êtes proches des joueurs de tennis,\n                    plus la billetterie est chère. Vous devez aussi prendre en compte\n                </p>\n                <p>\n                    l'importance du tournoi en lui-même : le prix des places pour le tournoi de Roland Garros est plus\n                    cher que celui d'un tournoi ATP 250.\n                </p>\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/concept_present3.jpg\" class=\"center-block\"\n                    alt=\"place de Roland Garros / place pour Roland Garros\" />\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n\n        <div class=\"row split_marginbot \">\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <img src=\"./assets/images/jouer-au-tennis.jpg\" class=\"center-block\" alt=\"places Roland Garros / places Roland Garros\" />\n            </div>\n            <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n                <h5><strong>Qui peut acheter des places de tennis en billetterie ?\n                    </strong></h5>\n                <p>\n                    Si vous êtes licenciés dans un club de tennis, la fédération française vous permet d'avoir la\n                    priorité dans l'achat de certaines places voire même d'avoir des réductions. A priori tout le monde\n                    peut avoir accès à la billetterie tennis mais le nombre de places mises à disposition pour le grand\n                    public est très très limité. Nous vous conseillons de vous y prendre énormément à l'avance sur les\n                    tournois de tennis de grande importance et de vous renseigner sur la date mise en ligne de la\n                    billetterie car dans la journée les places les plus prisées peuvent être vendues. Nota bene certains\n                    événements de tennis font plusieurs vagues de ventes de billetterie.\n                </p>\n                <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                    '/' + this._const('PATH.TENNIS.CIRCUITATP_PRONOSTICS.SELF')\n                  }}\">Tous vos pronos tennis sont à voir ici</a></strong></p>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\n    </div>\n</div>\n<!-- section1 ends -->\n<!-- section2 starts -->\n<div class=\"section2 des_titre_backtext\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"des_back_content\">\n                    <h4>\n                        Nous avons créé un univers spécialement dédié au tennis pour nos passionnés + flouter Wilson\n                        raquette\n                    </h4>\n                </div>\n            </div>\n        </div>\n    </div>\n</div>\n<app-footer></app-footer>");

