/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n  <img src=\"./assets/images/jouer-tennis.jpg\" alt=\"Los Angeles\" />\n  <div class=\"inner_carousel\">\n    <h3>oh my Tennis</h3>\n  </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n  <div class=\"banner_container\">\n    <h3>Réservez un cours particulier</h3>\n    <div class=\"row\">\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input class=\"form-control\" id=\"\" maxlength=\"6\" placeholder=\"Code Postal\" [(ngModel)]=\"Ville\" type=\"text\" />\n            <label><img src=\"./assets/images/ville_icon.png\" /></label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input type=\"text\" style=\"text-align:left!important;\" [min]=\"min\" class=\"form-control\" id=\"\"\n              placeholder=\"Date\" [(ngModel)]=\"Date\" [owlDateTime]=\"dt1\" [owlDateTimeTrigger]=\"dt1\" />\n            <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n            <label><img src=\"./assets/images/date_icon.png\" /> </label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n        <button (click)=\"handleClick($event)\" class=\"btn black_btn\">\n          Rechercher\n        </button>\n      </div>\n    </div>\n  </div>\n</div>\n<!-- Inner Search area ends -->\n\n<!-- section1 starts -->\n<div class=\"section1 regle_content\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"license\">\n        <div class=\"page_title_div col-xs-12\">\n          <h1 class=\"page_title\">Historique des règles au tennis</h1>\n          <img src=\"./assets/images/title_border.png\" alt=\"title_border\" />\n        </div>\n        <div class=\"license_section\">\n          <div class=\"col-xs-12\">\n            <h5>1. Evolution des règles du tennis</h5>\n          </div>\n          <div class=\"clearfix\"></div>\n          <div class=\"col-md-8 col-sm-8 col-xs-12\">\n            <p class=\"license_txt\">\n              Les premières règles du tennis sont bien sûr celles du Lawn-tennis du major Wingfield (1874). Elles\n              étaient confuses et incomplètes. Néanmoins, on comptait de la même façon que le Jeu de Paume extérieur\n              (Longue Paume) : 15 - 30 - 45 - Jeu (origine des points au tennis). En cas d’égalité à 45, il fallait\n              gagner 2 points de suite pour remporter le jeu (Avantage - Jeu). Le match se gagnait en 6 jeux (un set)\n              avec deux jeux d’écart. Le service s'effectue à partir d’une zone en forme de losange tracée au milieu\n              d’un des côtés du terrain. La balle devait rebondir dans un rectangle délimité au fond de l’autre côté. Le\n              nombre de joueurs pouvait aller de 2 à 8. Le major Wingfield décida aussi qu’il fallait frapper la balle\n              soit à la volée, soit après un rebond. Le terrain était asymétrique et obligeait les équipes à changer de\n              côté pour servir. Il mesurait en longueur 18,29 mètres et en largeur : 6, 40 mètres au filet et 9, 20\n              mètres sur la ligne de fond. Le filet s’élevait à 1, 42 mètres.\n            </p>\n          </div>\n          <div class=\"col-md-4 col-sm-4 col-xs-12\">\n            <img src=\"./assets/images/comment compter les points au tennis.jpg\" class=\"center-block\" alt=\"regles tennis / regles principales tennis\n            \" />\n          </div>\n          <div class=\"clearfix\"></div>\n          <br />\n          <!-- \n\t\t\t\t\t\t<div class=\"col-md-5 col-sm-5 col-xs-12\">\n\t\t\t\t\t\t\t<img src=\"images/compter-points-tennis.jpg\" class=\"img-responsive\">\n\t\t\t\t\t\t</div> -->\n          <div class=\"col-md-12 col-sm-12 col-xs-12\">\n            <p class=\"license_txt\">\n              Le 24 mai 1875, le M.C.C. (Marylebone Cricket Club) et le major\n              Wingfield se réunissent afin de codifier 25 règles du Lawn-Tennis.\n              Désormais, le service s’effectue à partir de la ligne de fond et\n              dans une zone allant jusqu’au filet. Quant aux dimensions, on\n              allonge le terrain jusqu'à atteindre 23, 77 mètres en longueur.\n            </p>\n            <p class=\"license_txt\">\n              En 1877, avant le premier Wimbledon, le All England Club et son\n              directeur Henry Jones décident d’améliorer en profondeur les\n              règles du Lawn-Tennis. A partir de cette année, le Lawn-tennis va\n              enfin avoir un règlement officiel, clair et fixe.\n            </p>\n\n            <div class=\"clearfix\"></div>\n          </div>\n        </div>\n        <div class=\"clearfix\"></div>\n        <div class=\"col-md-12 col-sm-12 col-xs-12\">\n          <h4 style=\"margin-top:17px;\">\n            <b>Depuis 1877, les règles du Tennis ont peu changé. Toutefois,\n              quelques améliorations ont été apportées dans les années 70 et 90.\n              En voici, les principales :</b>\n          </h4>\n          <div class=\"col-md-8 col-sm-8 col-xs-12\">\n            <ul class=\"regles_points\">\n              <li>\n                Les points se comptent maintenant de la façon suivante : 15 - 30\n                - 40 - Jeu. En cas d’égalité à 40, il faut gagner deux points de\n                suite : avantage - Jeu. Le chiffre 40 remplace ainsi 45. Ce\n                changement vient probablement du fait que durant un match,\n                \"forty\" (40 en anglais) était plus facile à dire que \"forty\n                five\".\n              </li>\n              <li>La hauteur du filet passe de 1,52 mètres à 0,915 mètre.</li>\n              <li>On a 2 balles au service.</li>\n              <li>\n                La ligne de service mesure désormais 7,92 mètres (puis ramenée à\n                6,40 mètres) à partir du filet.\n              </li>\n              <li>\n                Le terrain devient rectangulaire (cf. image ci-après). Il n’est\n                plus la peine de changer de côté pour servir. Le terrain est\n                délimité, pour un simple, à 23,77 mètres en longueur et à 8,33\n                mètres en largeur.\n              </li>\n            </ul>\n            <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n              '/' + this._const('PATH.TENNIS.DIMENSIONS.SELF')\n            }}\">Découvrez toutes les dimensions d’un terrain de tennis.</a></strong></p>\n          </div>\n          <div class=\"col-md-4 col-sm-4 col-xs-12\">\n            <img src=\"./assets/images/compter-points-tennis.jpg\" class=\"img-responsive\" alt=\"regles du tennis / regles jeu tennis\" />\n          </div>\n        </div>\n        <div class=\"col-md-12 col-sm-12 col-xs-12\">\n          <h4 style=\"margin-top:17px;\">\n            <b>Depuis 1877, les règles du Tennis ont peu changé. Toutefois,\n              quelques améliorations ont été apportées dans les années 70 et 90.\n              En voici, les principales :</b>\n          </h4>\n          <div class=\"col-md-8 col-sm-8 col-xs-12\">\n            <ul class=\"regles_points\">\n              <li>\n                <b>1958 :</b> Le serveur peut sauter, y compris, au-dessus de la\n                ligne de fond lorsqu'il sert. Avant, le joueur au service devait\n                garder les pieds en contact avec le sol.\n              </li>\n              <li>\n                <b>1970 :</b> Apparition du jeu décisif. Il est joué à 8 jeux\n                partout sauf au dernier set du match où la règle des 2 jeux\n                d’écart reste en vigueur.\n              </li>\n              <li><b>1973 :</b> Le jeu décisif est joué à 6 jeux.</li>\n              <li><b>1989 :</b> Apparition du jeu décisif en Coupe Davis.</li>\n              <li>\n                <b>1994 :</b> Le repos de 10 minutes à la fin du 3e set est\n                aboli en Coupe Davis.\n              </li>\n              <li>\n                <b>1999-2000 :</b> La FFT (Fédération Française de Tennis) tente\n                d’instaurer en France les sets en 4 jeux (les shorts-set) et la\n                suppression de l’avantage et du let.\n              </li>\n              <li>\n                <b>2000 :</b> Le repos après le premier jeu de chaque set est\n                supprimé (les joueurs se contentent de changer de côté). En\n                revanche, le repos de 2 minutes intervient à la fin de chaque\n                set, même si le nombre de jeux est pair.\n              </li>\n            </ul>\n          </div>\n          <div class=\"col-md-4 col-sm-4 col-xs-12\">\n            <img src=\"./assets/images/tennis-comptage-des-points.jpg\" class=\"img-responsive\"  alt=\"comptage des points au tennis/ comptage tennis\"/>\n          </div>\n        </div>\n        <div class=\"col-md-12 col-sm-12 col-xs-12\">\n          <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n            '/' + this._const('PATH.TENNIS.ELEMENTS.SELF')\n          }}\">>Quels sont les elements du court de tennis ?\n        </a></strong></p>\n          <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n            '/' + this._const('PATH.TENNIS.PRINCIPLE.SELF')\n          }}\">>Retrouver également la réglementation du matériel de\n          tennis</a></strong></p>\n          \n          <br />\n          <h5>2. Origine du comptage des points au tennis</h5>\n          <p class=\"license_txt\">\n            La façon de compter au tennis (15/30/40/Jeu) vient, naturellement,\n            du jeu de Paume où l'on comptait les points de la manière suivante :\n            15/30/45/Jeu. Mais pour expliquer l’origine de ce système de\n            comptage, on met en avant 4 hypothèses.\n          </p>\n\n          <h4><b>2.1 Hypothèse 1</b></h4>\n          <p class=\"license_txt\">\n            En 1579, Jean GOSELIN, libraire du roi de France, aurait expliqué\n            cette façon de compter en se rapportant à l'astronomie. Un signe\n            physique (sixième partie du cercle) est divisé par imagination en 60\n            degrés, chaque degré en 60 minutes, chaque minute en 60 secondes, si\n            bien que 15 degrés pris 4 fois (15-30-45-60) valent un signe\n            physique.\n          </p>\n\n          <h4><b>2.2 Hypothèse 2</b></h4>\n\n          <p class=\"license_txt\">\n            Un célèbre Paumier du XIX°siècle, Charles Delahaye, aurait raconté que le nombre 15 représentait une mesure\n            de longueur. Dans sa jeunesse, Charles Delahaye aurait assisté à un match de longue Paume où l'on ne\n            comptait pas de points, mais où le serveur avançait (pour servir de nouveau) de 15 pieds vers le filet\n            lorsqu’il remportait un coup. S'il gagnait le coup suivant, il continuait d'avancer de 15 pieds et ainsi de\n            suite jusqu' à avoir remporté 4 coups, il arrivait au filet. L'adversaire faisait de même. Lorsque les deux\n            joueurs avaient avancé chacun de 45 pieds, ils devaient gagner deux points de suite.\n          </p>\n\n          <h4><b>2.3 Hypothèse 3 </b></h4>\n\n          <p class=\"license_txt\">\n            Pendant longtemps, les paris d'argent étaient très fréquents lors\n            des rencontres de jeu de Paume. A l'époque, en France, la monnaie\n            dérivait du système sexagésimal (c'est-à-dire, relatif au nombre\n            60). Il y avait le \"double d'or\" qui valait 60 sous et le \"denier\n            d'or\" qui valait 15 sous. Lors des rencontres, les parieurs auraient\n            pris l'habitude de compter les points en valeur monétaire,\n            c'est-à-dire en multiple de 15.\n          </p>\n          <h4><b>2.4 Hypothèse 4 : </b></h4>\n          <p class=\"license_txt\">\n            En 2001, le Français Jacques Thédié, trésorier du club de Paume de Fontainebleau, a suggéré une nouvelle\n            hypothèse. Selon lui, la façon de compter les points au tennis ou au Jeu de Paume (15-30-40-Jeu) vient tout\n            simplement du système d'unité de l'époque. Au Moyen-âge - période où est né le Jeu de Paume - nos ancêtres\n            avaient l'habitude de compter ou de mesurer par paquets de 60. Ils baignaient dans les soixantaines comme\n            nous baignons aujourd'hui dans les dizaines, les centaines et les milliers. Notre système est décimal et\n            certains jeux se basent là-dessus. Exemples : le bridge (une manche se joue en 100 points), le patinage\n            artistique et la gymnastique où la notation se fait sur 10, les 10 meilleurs sportifs d'une course ou d'un\n            classement, etc. A l'époque du Jeu de Paume, 60 était donc la base. C'est ainsi que les points au Jeu de\n            Paume se comptaient jusqu'à 60, qui est devenu au fil du temps \"jeu\". Mais Jacques Thédié n'explique pas\n            pourquoi le jeu devait se marquer en 4 points : 15-30-45-60. Quant au \"45\", il s'est transformé au fur à\n            mesure en \"40\". \"Cela semble un raccourci verbal\" explique Thédié. Aujourd'hui, aucune de ces hypothèses\n            n’ont été vérifiées. Seules la troisième et la quatrième semblent être les plus séduisantes. Les débuts du\n            jeu de Paume rythmés beaucoup avec argent.\n          </p>\n          <p>\n            <strong><a class=\"content_link\" href=\"\">Découvrez les origines du tennis et son histoire.</a></strong>\n          </p>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n<!-- section1 ends -->\n\n<app-footer></app-footer>");

