/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n  <img src=\"./assets/images/jouer-tennis.jpg\" alt=\"Los Angeles\" />\n  <div class=\"inner_carousel\">\n    <h3>oh my Tennis</h3>\n  </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n  <div class=\"banner_container\">\n    <h3>Réservez un cours particulier</h3>\n    <div class=\"row\">\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input class=\"form-control\" id=\"\" maxlength=\"6\" placeholder=\"Code Postal\" [(ngModel)]=\"Ville\" type=\"text\" />\n            <label><img src=\"./assets/images/ville_icon.png\" /></label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input type=\"text\" style=\"text-align:left!important;\" [min]=\"min\" class=\"form-control\" id=\"\"\n              placeholder=\"Date\" [(ngModel)]=\"Date\" [owlDateTime]=\"dt1\" [owlDateTimeTrigger]=\"dt1\" />\n            <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n            <label><img src=\"./assets/images/date_icon.png\" /> </label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n        <button (click)=\"handleClick($event)\" class=\"btn black_btn\">\n          Rechercher\n        </button>\n      </div>\n    </div>\n  </div>\n</div>\n<!-- Inner Search area ends -->\n\n<!-- section1 starts -->\n<div class=\"regle_content\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"license\">\n        <div class=\"page_title_div col-xs-12\">\n          <h1 class=\"page_title\">Ohmytennis : Les dimensions d’un terrain de tennis</h1>\n          <img src=\"./assets/images/title_border.png\" alt=\"title_border\" />\n        </div>\n        <div class=\"col-xs-12\">\n          <p class=\"license_txt\">\n            Le terrain sur lequel on peut jouer au tennis est nommé court (de\n            tennis) qui étymologiquement signifie endroit fermé. Il est constitué\n            d'une surface de jeu, d'un filet et de grillages le délimitant.\n          </p>\n        </div>\n        <div class=\"clearfix\"></div>\n        <div class=\"~license_section\">\n          <!-- section -->\n          <div class=\"col-md-8 col-sm-8 col-xs-12\">\n            <h2 style=\"font-size:25px\"><strong>Dimensions du court de tennis </strong></h2>\n            <p class=\"license_txt\">\n              Tous les courts de tennis homologués c'est-à-dire ceux sur\n              lesquels des compétitions peuvent avoir lieu possèdent les mêmes\n              dimensions contrairement à un terrain de football (homologué) par\n              exemple à qui on peut donner des tailles différentes. Les\n              dimensions d'un terrain de tennis sont données ci-dessous sur le\n              schéma.\n            </p>\n            <p class=\"license_txt\">\n              On peut remarquer que les longueurs et largeurs du terrain de\n              tennis sont précises au millimètre, elles sont données sur le\n              schéma en mètres et correspondent à des mesures en unités\n              anglo-saxonnes (pouces, pieds, yards). Il faut noter aussi que les\n              quatre rectangles au centre du court du tennis les plus proches du\n              filet sont appelés, par abus de langage, carrés de services.\n            </p>\n          </div>\n          <div class=\"col-md-4 col-sm-4 col-xs-12\">\n            <img src=\"./assets/images/dimensions-terrain-de-tennis.png\" class=\"center-block\" alt=\"dimension terrain de tennis / tennis dimensions\" />\n          </div>\n          <div class=\"col-md-12 col-sm-12 col-xs-12\">\n            <p class=\"license_txt\">\n              Le court de tennis est la surface sur laquelle la balle doit être\n              mise en jeu, il faut cependant une surface supplémentaire sur les\n              côtés et dans le fond du court pour pouvoir se déplacer. Cet\n              espace est variable, il doit néanmoins mesurer au minimum de 5,50\n              m derrière chaque ligne de fond de court (recul) et 3,05 m sur\n              chaque côté (dégagement). Les courts principaux des stades\n              accueillant des tournois internationaux ont un recul et un\n              dégagement plus importants (de l'ordre de la dizaine de mètres)\n              afin de permettre l'installation de tribunes tout autour du\n              terrain.\n            </p>\n            <p class=\"license_txt\">\n              Les lignes de tennis portent des noms spécifiques : lignes de fond\n              de court, lignes de côté de simple, ligne de côté de double,\n              lignes des carrés de service, ligne médiane.\n            </p>\n            <p class=\"license_txt\">\n              Les deux rectangles situés allongés sont les couloirs au tennis,\n              ils servent uniquement au jeu en double (voir par ailleurs).\n            </p>\n\n            <p class=\"license_txt\">\n              La ligne médiane a une épaisseur de 5 cm, les autres lignes\n              peuvent être de 2,5 cm à 5 cm sauf la ligne de fond de court qui\n              est limitée à 10 cm (notamment sur les grands courts pour que\n              cette dernière soit bien visible pendant les retransmissions\n              télévisées).\n            </p>\n            <p class=\"license_txt\">\n              Toutes ces mesures commencent à l'extérieur des lignes et elles\n              doivent avoir une couleur uniforme.\n            </p>\n            <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n              '/' + this._const('PATH.TENNIS.COMPTER.SELF')\n            }}\">Pour continuer vous pouvez aussi lire l’historique des règles\n            du tennis..</a></strong></p>\n          </div>\n\n          <div class=\"clearfix\"></div>\n        </div>\n        <!-- section -->\n\n        <!-- section -->\n        <div class=\"regles_section_2\" style=\"margin-top: 15px;\">\n          <div class=\"col-md-4 col-sm-4 col-xs-12\">\n            <img src=\"./assets/images/tennis-dimensions.jpg\" class=\"center-block\" alt=\"hauteur filet tennis / filet tennis hauteur\"\n              style=\"margin-bottom: 23px;\" />\n          </div>\n\n          <div class=\"col-md-8 col-sm-8 col-xs-12\">\n            <h2 style=\"font-size:25px\"><strong>La hauteur du filet du court de tennis</strong></h2>\n            <p class=\"license_txt\">\n              Le filet de tennis sépare le côté de chacun des joueurs, il\n              mesure 3 pieds soit 0,914 m au centre. Il est relié, par\n              l'intermédiaire d'un câble métallique à des poteaux mesurant\n              1,07 m (3,5 pieds) et il est tenu en son milieu par une sangle\n              au sol que l'on peut régler pour ajuster correctement la hauteur\n              du filet.\n            </p>\n            <p class=\"license_txt\">\n              Les poteaux du filet de tennis sont placés à la même distance de\n              la ligne de côté de double que la hauteur du filet soit 0,914 m,\n              cette longueur de filet est celle du terrain de double.\n            </p>\n            <p class=\"license_txt\">\n              Pour jouer en simple, il est indispensable d'ajouter des piquets\n              de simple, ils sont amovibles et se fixent sous le câble pour\n              qu'ils soient bien stables. Ils mesurent la même taille que les\n              poteaux et sont placés à 0,914 m de la ligne de côté de simple.\n            </p>\n          </div>\n          <div class=\"col-md-12 col-sm-12 col-xs-12\">\n            <p class=\"license_txt\">\n              Il faut noter que les poteaux et la partie du filet qui se\n              trouve à l’extérieur des piquets de simple sont des dépendances\n              permanentes et ne sont pas considérés comme étant des poteaux de\n              filet ou comme faisant partie du filet. Une balle les heurtant\n              sera donc considérée comme faute.\n            </p>\n           \n            <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n              '/' + this._const('PATH.TENNIS.PRINCIPLE.SELF')\n            }}\">Connaissez-vous la règlementation du matériel de tennis ?\n          </a></strong></p>\n\n          <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n            '/' + this._const('PATH.TENNIS.ELEMENTS.SELF')\n          }}\">Connaissez-vous tous les éléments d’un terrain de tennis ?\n\n        </a></strong></p>\n          </div>\n\n          <div class=\"clearfix\"></div>\n\n          <!-- section -->\n\n          <!-- section -->\n          <div class=\"regles_section_3\" style=\"margin-top: 21px;\">\n            <div class=\"col-md-8 col-sm-8 col-xs-12\">\n              <h2 style=\"font-size: 25px;\"><strong>Dimension du court de tennis en double</strong></h2>\n              <p class=\"license_txt\">\n                Le terrain de double au tennis est le terrain de simple auquel des couloirs sont ajoutés. Etant donné\n                que 2 joueurs se partagent le court , celui-ci est agrandi afin d’avoir plus de surface de jeu.\n              </p>\n            </div>\n            <div class=\"col-md-4 col-sm-4 col-xs-12\">\n              <img src=\"./assets/images/taille-court-de-tennis.jpg\"  alt=\"hauteur d’un filet de tennis/ hauteur du filet de tennis\"/>\n            </div>\n            <br /><br />\n            <div class=\"clearfix\"></div>\n          </div>\n          <!-- section -->\n\n          <!-- section -->\n          <div class=\"regles_section_3\" style=\"margin-top: 26px;\">\n            <div class=\"col-md-4 col-sm-4 col-xs-12\">\n              <img src=\"./assets/images/tennis-dimensions.jpg\"  alt=\"dimension terrain tennis / dimension terrain tennis\"/>\n            </div>\n            <div class=\"col-md-8 col-sm-8 col-xs-12\">\n              <h2 style=\"font-size: 25px;\">\n                <strong>Dimension du court de tennis spécifiques en compétition\n                  jeunes</strong>\n              </h2>\n              <p class=\"license_txt\">\n                Les dimensions du court de tennis présentées précédemment sont dédiées à la pratique des adultes ou des\n                jeunes de plus de 11 ans. Dans les compétitions de jeunes, des dispositions spécifiques existent\n                notamment quant à la taille du terrain.\n              </p>\n              <p class=\"license_txt\"><b>La compétition homologuée :</b></p>\n              <ul class=\"regles_points para_nomargin\">\n                <li>\n                  dès 8 ans se déroule sur un terrain de 18 m de long et de 8,23 m\n                  de large, la hauteur du filet se situe à 0,80 m dit terrain\n                  orange.\n                </li>\n                <li>\n                  dès 9 ans se déroule soit sur un terrain orange soit sur un\n                  terrain de 23,77 m de long et de 8,23 m de large, avec une\n                  hauteur de filet de 0,914 m appelé terrain vert.\n                </li>\n                <li>\n                  dès 10 ans se déroule soit sur un terrain vert soit sur un\n                  terrain orange soit sur un terrain ordinaire appelé terrain\n                  jaune.\n                </li>\n              </ul>\n            </div>\n            <div class=\"clearfix\"></div>\n          </div>\n          <!-- section -->\n\n          <!-- section -->\n          <div class=\"regles_section_3\" style=\"margin-top: 23px;\">\n            <div class=\"col-md-8 col-sm-8 col-xs-12\">\n              <h2 style=\"font-size: 25px;\">\n                <strong>Les différentes surfaces de jeu d’un terrain de tennis</strong>\n              </h2>\n              <p class=\"license_txt\">\n                La surface est généralement de la terre battue (mélange de brique\n                pilée et de colorant sur un encaissement de différentes épaisseurs\n                de cailloux, terre, gravier), en terbal (mélange de brique pillée\n                déposée sur une surface goudronnée), en dur (résine qui est comme\n                une peinture déposée sur un sol en dur, béton poreux ou quick) ou\n                plus rarement en gazon ou parquet.\n              </p>\n              <p class=\"license_txt\">\n                Les surfaces diffèrent par leur rapidité (hauteur du rebond de la\n                balle après impact et vitesse après rebond), par leur action sur\n                la balle (favorisant certains effets ou non) et aussi par leur\n                souplesse (les courts en dur font davantage mal aux\n                articulations). Il existe une classification des courts faisant\n                intervenir ces différents paramètres.\n              </p>\n            </div>\n\n            <div class=\"col-md-4 col-sm-4 col-xs-12\">\n              <img src=\"./assets/images/taille-court-de-tennis.jpg\" alt=\"dimensions terrain tennis / dimensiosn terrains tennis\"/>\n            </div>\n            <div class=\"clearfix\"></div>\n          </div>\n          <!-- section -->\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n<!-- section1 ends -->\n\n<app-footer></app-footer>");

