/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n  <img src=\"./assets/images/jouer-tennis.jpg\" alt=\"Los Angeles\" />\n  <div class=\"inner_carousel\">\n    <h3>oh my Tennis</h3>\n  </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n  <div class=\"banner_container\">\n    <h3>Réservez un cours particulier</h3>\n    <div class=\"row\">\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input\n              class=\"form-control\"\n              id=\"\"\n              maxlength=\"6\"\n              placeholder=\"Code Postal\"\n              [(ngModel)]=\"Ville\"\n              type=\"text\"\n            />\n            <label><img src=\"./assets/images/ville_icon.png\"/></label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input\n              type=\"text\"\n              style=\"text-align:left!important;\"\n              [min]=\"min\"\n              class=\"form-control\"\n              id=\"\"\n              placeholder=\"Date\"\n              [(ngModel)]=\"Date\"\n              [owlDateTime]=\"dt1\"\n              [owlDateTimeTrigger]=\"dt1\"\n            />\n            <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n            <label><img src=\"./assets/images/date_icon.png\" /> </label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n        <button (click)=\"handleClick($event)\" class=\"btn black_btn\">\n          Rechercher\n        </button>\n      </div>\n    </div>\n  </div>\n</div>\n<!-- Inner Search area ends -->\n\n<!-- section3 starts -->\n<div class=\"lexique_content haspadd\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"lexique\">\n        <div class=\"page_title_div col-xs-12\">\n          <h1 class=\"page_title\">Lexique du tennis</h1>\n          <img src=\"./assets/images/title_border.png\" alt=\"title_border\">\n        </div>\n        <div class=\"clearfix\"></div>\n        <div class=\"col-md-12 col-sm-12 col-xs-12\">\n          <div class=\"wrapper1 center-block\">\n            <div class=\"panel-group\" id=\"accordion\" role=\"tablist\" aria-multiselectable=\"true\">\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading active\" role=\"tab\" id=\"headingOne\">\n                  <h4 class=\"panel-title\">\n                    <a role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapseOne\"\n                      aria-expanded=\"true\" aria-controls=\"collapseOne\">\n                      Lexique du tennis commençant par la lettre A :\n                    </a>\n                  </h4>\n                </div>\n\n                <div id=\"collapseOne\" class=\"panel-collapse collapse in\" role=\"tabpanel\" aria-labelledby=\"headingOne\">\n                  <div class=\"panel-body\">\n                    <p><b>A:</b> Cette lettre est employée pour indiquer une égalité de points pendant un jeu, soit 15-A\n                      pour 15-15, 30-A pour 30-30 et 40-A pour 40-40 lors d’un match de tennis.</p>\n\n                    <p><b>Ace:</b> Service au tennis qui n’est pas touché par l&#39;adversaire, ce qui permet donc au\n                      serveur de remporter directement le point. Il est plus souvent réalisé lors du premier service car\n                      il est possible de prendre plus de risques par rapport à une deuxième balle. </p>\n\n                    <p><b>Amorti ou amortie:</b> Véritable coup de toucher l’amorti(e) est effectué dans le but de faire\n                      rebondir la balle près du filet de tennis. Par exemple lorsque l’adversaire se situe loin derrière\n                      sa ligne de fond de court, on peut\n                      facilement le surprendre. Son efficacité réside aussi bien dans le masquage de sa préparation que\n                      dans sa réalisation (effet coupé). L&#39;amorti est un coup technique au tennis qui ralentit le\n                      jeu, qui crée une rupture de\n                      rythme et qui sert à faire avancer l&#39;adversaire (tactique du tennis).</p>\n\n                    <p> <b>Anti-vibrateur:</b> De forme arrondie, triangulaire ou même en longueur, ce système permet\n                      d&#39;atténuer les\n                      vibrations causées par la frappe de la balle de tennis. Il peut s&#39;agir d&#39;un objet inséré\n                      entre les cordes à la base du\n                      cadre ou d&#39;un système intégré à la raquette. Les anti-vibrateurs permettent notamment de\n                      limiter les risques de\n                      tennis-elbow (tendinite du coude). </p>\n\n                    <p><strong><a class=\"content_link\" href=\"\">Quels sont les accessoires tennis dans son sac ?\n                          (conseils).</a></strong></p>\n\n                    <p><b>Arbitre de chaise (ou parfois juge de chaise):</b> Nom donné à l&#39;arbitre principal assis\n                      sur une chaise surélevée,\n                      située au milieu du terrain près du filet de tennis. Il fait le tirage au sort, accorde 5 minutes\n                      pour l’échauffement\n                      de tennis, et annonce notamment le score et les changements de côtés, rappelle les joueurs et le\n                      public à l&#39;ordre,\n                      etc. lors du match. Il est assisté dans sa tâche par plusieurs juges de ligne. C&#39;est\n                      généralement lui qui a le dernier\n                      mot mais, en cas de problème ou litige particulièrement difficile à gérer, il peut faire appel au\n                      juge-arbitre du\n                      tournoi (référent organisateur).</p>\n\n                    <p><strong><a class=\"content_link\" href=\"\">Découvrez les différents éléments d’un terrain de\n                          tennis.</a></strong></p>\n\n                    <p><b>Arroser:</b> Expression familière employée pour qualifier un coup de fond de court (coup droit\n                      ou revers) envoyé\n                      très nettement en dehors des dimensions du court de tennis.</p>\n\n                    <p><b>ATP:</b> Association de tennis qui organise les tournois de l&#39;ATP Tour au niveau\n                      international.</p>\n\n                    <p><b>ATP Tour:</b> Circuit professionnel principal masculin. On parle également de circuit ATP.</p>\n\n                    <p><b>Attaquant de fond de court:</b> Se dit d&#39;un joueur qui, le plus souvent installé devant sa\n                      ligne de fond de court,\n                      cherche par des prises d&#39;initiatives constantes et répétées, à déborder son adversaire ou à\n                      lui faire commettre la\n                      faute en premier. Ce sont des joueurs qui s’appuient sur une technique de tennis de fond de court\n                      (coup droit ou\n                      revers ou les deux) cataloguée comme étant leur point fort.</p>\n\n                    <p><b>Au filet ou à la volée:</b> Un joueur est au filet lorsqu&#39;il est à une distance\n                      suffisamment courte du filet pour lui\n                      permettre de jouer des volées. (balle de tennis renvoyée sans rebond).</p>\n\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"headingTwo\">\n                  <h4 class=\"panel-title\">\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\"\n                      href=\"#collapseTwo\" aria-expanded=\"false\" aria-controls=\"collapseTwo\">\n                      Termes du tennis débutant par la lettre B :\n                    </a>\n                  </h4>\n                </div>\n                <div id=\"collapseTwo\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"headingTwo\">\n                  <div class=\"panel-body\">\n\n                    <p><b>Bâche de tennis:</b> Pièce en matière plastique utilisée pour recouvrir les courts de tennis\n                      extérieurs afin de les protéger des intempéries. Les bâches sont généralement disposées au fond du\n                      court afin que l&#39;on puisse les dérouler rapidement. Disposées également à la verticale, elles\n                      permettent d’amortir les balles de tennis qui ne sont pas touchées par les joueurs. Certains\n                      sponsors utilisent cet espace pour mettre en valeur leurs logos : l’exemple le plus célèbre est\n                      celui de BNP PARIBAS et Roland Garros qui existe depuis les années 70.\n                    </p>\n\n                    <p><b>Ball clip:</b> Accessoire en matière plastique que le joueur ou la joueuse accroche à la\n                      ceinture de son short ou sa jupe pour avoir une deuxième balle rapidement à portée de main lors du\n                      service au tennis. Ce système permet de pallier l&#39;absence de poche dans son short ou jupe de\n                      tennis.\n                    </p>\n\n                    <p><b>Balle de tennis:</b> Projectile renvoyé par les joueurs et le coup délivré pour renvoyer la\n                      balle. On parle de balle bonne quand elle retombe dans les limites du terrain de tennis , et de\n                      balle faute quand elle tombe hors des limites du court. L’expression « remettre la balle »\n                      signifie que le point joué précédemment n'est pas pris en compte et qu’il est a rejoué. C’est souvent\n                      lors d’un litige de jugement de balle ou lors d’un service let que cette situation arrive. </p>\n                    <p><a class=\"content_link\" href=\"\">Connaissez-vous le diamètre d'une balle de tennis\n                          ?</a></p>\n                    <p><b>Balle de match:</b> Point à jouer offrant le gain de la rencontre au joueur menant au score.\n                      Consécutives, on parle\n                      de « double » ou de « triple » balle de match au tennis. Les expressions balle de set, balle de\n                      jeu et balle de break\n                      sont également très usitées. Ces expressions ne sont pas annoncées par l&#39;arbitre de chaise\n                      mais peuvent l&#39;être par\n                      les commentateurs et journalistes sportifs.\n                    </p>\n\n                    <p><b>Balle parachute (ou moonball en anglais):</b> Terme péjoratif qui désigne un coup peu risqué\n                      qui passe largement\n                      au-dessus du filet. Ce type de coup droit ou revers au tennis est généralement employé pour briser\n                      le rythme d&#39;un\n                      échange et pour avoir davantage de temps pour le replacement. Cette technique au tennis permet au\n                      défenseur de\n                      revenir dans le point.\n                    </p>\n\n                    <p><b>Bande du filet:</b> Partie supérieure du filet de tennis, haute de 10 à 13 cm et blanche.\n                      C&#39;est cette bande que la\n                      balle touche lors d&#39;un let au service (qui est à rejouer) ou pendant l’échange (le point\n                      continue).\n                    </p>\n\n                    <p><b>Bois:</b> Expression utilisée lorsque la balle de tennis touche le cadre de la raquette de\n                      tennis. Cela fait référence\n                      aux premières raquettes qui ont vu le jour et qui étaient en bois.\n                    </p>\n\n                    <p><b>Blanc:</b> Un jeu blanc est gagné au tennis lorsque l’adversaire ne marque aucun point. Le\n                      score est donc de 40-0\n                      et 4 points sont gagnés successivement par le même joueur.\n                        </p>\n\n                    <p><b>Blanchir la ligne:</b> Expression employée lorsqu&#39;une balle touche une ligne au cours\n                      d&#39;un échange. La plupart du\n                      temps sur un court en terre battue, une balle qui rebondit sur une ligne retire la terre déposée à\n                      l&#39;endroit de\n                      l&#39;impact. La ligne est par conséquent « blanchie » ce qui permet de mieux visualiser et\n                      appréhender les\n                      dimensions du terrain de tennis. Par extension, cette expression est également utilisée lors des\n                      matchs se\n                      déroulant sur d&#39;autres surfaces.\n                        </p>\n\n                    <p><b>Boxing tennis:</b> Locution inventée par le commentateur et ancien joueur de tennis Patrice\n                      Dominguez, pour\n                      qualifier un joueur de fond de cours qui frappe le plus fort possible tous ses coups (coup droit,\n                      revers, volée, service) et qui, en quelque sorte, met KO ses adversaires. Ce type de jeu nécessite\n                      une préparation physique\n                      spécifique au tennis car l’intensité est extrême.\n                        </p>\n\n                    <p><b>Break ou bris:</b> Un break est réalisé lorsqu&#39;un joueur gagne un jeu alors qu&#39;il est\n                      receveur (il n’est pas au\n                      service). On dit alors qu&#39;il a pris le service de son adversaire. Il donne un avantage certain\n                      au joueur qui le\n                      réalise. C’est une réelle rupture car l’avantage du jeu est toujours donné aux serveurs de tennis.\n                      Les breaks sont\n                      plus fréquents chez les femmes car leurs services sont moins efficaces. Que ceux des hommes\n                      (principalement\n                      parce qu&#39;elles sont en moyenne plus petites que les hommes). On parle de double-break\n                      lorsqu&#39;un joueur a réalisé\n                      deux breaks. Par extension, on dit qu&#39;un joueur a un break d&#39;avance lorsqu&#39;il a\n                      réalisé un break dans le set. On dit\n                      qu&#39;un joueur confirme son break s&#39;il remporte son jeu de service juste après avoir réalisé\n                      un break. Breaker son\n                      adversaire donne un avantage certain pour aller remporter un set.\n                        </p>\n\n                    <p><b>Brosse-pied:</b> Matériel permettant de débarrasser les chaussures d&#39;un joueur de tennis\n                      de la terre battue qui s&#39;y est\n                      collée. Ce matériel est parfois utilisé aux abords de certains gymnases pour veiller à\n                      l&#39;absence de caillou sous la\n                      semelle avant d&#39;entrer sur une surface synthétique en indoor, afin d&#39;éviter de\n                      l&#39;abîmer.\n                    </p>\n\n                    <p><b>Bye:</b> Faveur octroyée, dans certains tournois de tennis, aux têtes de série l(joueurs les\n                      mieux classés) qui se\n                      voient dispensées de disputer le premier tour. On peut noter que cela n’est jamais le cas dans les\n                      tournois du\n                      Grand Chelem (Roland Garros, Wimbledon, Open d’Australie, US Open) mais dans tous les autres\n                      tournois du\n                      circuit ATP cela existe. </p>\n\n                  </div>\n                </div>\n              </div>\n\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"headingThree\">\n                  <h4 class=\"panel-title\">\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\"\n                      href=\"#collapseThree\" aria-expanded=\"false\" aria-controls=\"collapseThree\">\n                      Lexique du tennis commençant par la lettre C :\n                    </a>\n                  </h4>\n                </div>\n                <div id=\"collapseThree\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"headingThree\">\n                  <div class=\"panel-body\">\n                    <p><b> Cadre:</b> Partie de la raquette de tennis qui délimite le tamis. Il peut être de plusieurs\n                      tailles pour une même référence et plus il est grand plus la puissance devient grande.</p>\n\n                    <p><b> Carré de service:</b> Surface presque carrée située devant le filet de tennis. Il en existe\n                      quatre sur un court. Laballe du service doit nécessairement y rebondir pour être valable afin de\n                      commencer à jouer le point.</p>\n\n                    <p><b> Circuit:</b> Ensemble des tournois disputés à un niveau donné (ATP, WTA, Challenger...). On\n                      parle de circuit masculin ou féminin pour désigner l&#39;ensemble des tournois\n                      professionnels.disputés par les joueurs ou joueuses de tennis.\n                    </p>\n\n                    <p><b> Chaise d&#39;arbitre:</b> Chaise surélevée permettant à l&#39;arbitre principal (appelé\n                      arbitre de chaise de mieux voir le jeu et les échanges. La chaise est placée au niveau du filet de\n                      tennis.</p>\n\n                    <p><b> Challenge:</b> Terme anglais pour désigner la demande faite par un joueur ou un arbitre\n                      d&#39;utiliser le Hawk-Eye pour déterminer le vainqueur d&#39;un point. Chaque joueur possède deux\n                      chances par set plus une si un tie break est joué.Si le joueur de tennis a raison il garde son\n                      challenge. Depuis sa création il y a quelques années, cette possibilité de contredire le jugement\n                      de l’arbitre est  devenue de plus en plus populaire lors des matchs de tennis. Malheureusement cette\n                      innovation technique sur les terrains de tennis est très coûteuse (environ 10 000 euros) et\n                      seuls les courts principaux des tournois en bénéficient.Les matchs de tennis se jouant sur les\n                      courts annexes n’ont donc pas cette possibilité.</p>\n\n                    <p><b> Challenge round:</b> Finale d&#39;un tournoi de tennis pour laquelle le champion de\n                      l&#39;année précédente est directement qualifié (sans donc devoir jouer aucun autre match). Il se\n                      voit alors opposé au gagnant d&#39;un tableau à élimination directe préalablement disputé. Ce\n                      système était notamment en vigueur pour les premières éditions du tournoi de Wimbledon et de\n                      l&#39;US National Championship (actuel US Open), à la King&#39;s Cup ainsi qu&#39;en Coupe Davis\n                      jusqu&#39;en 1972.</p>\n\n                    <p><b> Challenger:</b> Circuit secondaire professionnel masculin de tennis géré par l&#39;ATP. C’est\n                      en quelque sorte l’anti-chambre des tournois où le niveau reste très relevé mais les gains\n                      financiers obtenus très bas. Cela reste une très bonne école d’apprentissage pour les jeunes\n                      joueurs de tennis professionnels qui se lancent sur le circuit car leurs classements ne leur\n                      permettent pas d’entrer directement dans les gros tournois. Le terme peut également qualifier\n                      un joueur qui ne part pas favori dans une rencontre (synonyme de outsider).</p>\n\n                    <p><b> Chandelle:</b> Coup, souvent involontaire, où la balle suit une trajectoire bombée avec peu\n                      de vitesse. La balle de tennis monte ainsi très haut. Il est souvent peu dangereux pour\n                      l&#39;adversaire mais ce genre de balle est souvent peu négociée et suivant le score du match\n                      tennis elle peut devenir très embarrassante. Lorsque l&#39;adversaire est au filet et qu&#39;un\n                      coup similaire est volontaire, on parle de lob de tennis.</p>\n\n                    <p><b> Chanfrein:</b> Partie spécifique du manche de la raquette de tennis se situant sur les côtés.\n                      Changement de balles de tennis: phase d&#39;un match durant laquelle toutes les balles de tennis\n                      usagées sont remplacées par des balles neuves. Chaque tournoi détermine, dans son règlement, le\n                      nombre de jeux durant lesquels les balles sont utilisées. Dans tous les cas, le changement\n                      intervient au terme d&#39;un nombre impair de jeux, afin que ce ne soit pas toujours le même\n                      joueur qui bénéficie de balles neuves en servant. C&#39;est l&#39;arbitre de chaise qui annonce le\n                      changement de balles et ce sont les ramasseurs qui procèdent au remplacement. La plupart du temps, tous les 9 jeux on assiste à ce changement sachant que l’échauffement est équivalent à deux jeux\n                      joués.</p>\n\n                    <p><b> Changement de côté(s):</b> Phase d&#39;un match durant laquelle les joueurs changent de côté\n                      de terrain de tennis, lorsque la somme des jeux joués est impaire et tous les six points lors\n                      d&#39;un tie-break. Sauf pendant les tie-breaks, les joueurs bénéficient de 90 secondes pour\n                      s&#39;asseoir et se reposer. Notons qu'à la fin de chaque set la pause est de deux minutes. Ils en\n                      profitent pour analyser le déroulement du match de tennis, s&#39;alimenter, récupérer, se\n                      désaltérer, changer de matériel, etc. S&#39;ils font appel à un kinésithérapeute ou un médecin, le\n                      temps d&#39;arrêt peut se\n                      voir allonger jusqu&#39;à trois minutes. L&#39;arbitre de chaise annonce la fin de la pause :\n                      “Reprise” ou “Time”.\n                    </p>\n\n                    <p><b> Chop ou coup chopé:</b> Un chop est un effet imprimé à la balle afin que sa rotation soit\n                      dans le sens contraire de son déplacement sur le terrain de tennis. La balle a une trajectoire\n                      relativement droite et est freinée au moment du rebond pour s’arrêter assez nettement. Lorsque\n                      l&#39;effet est très prononcé, la balle peut partir vers l&#39;arrière après le rebond (effet\n                      rétro). Ce type d&#39;effet est fréquemment utilisé pour la réalisation des amorties et de coups\n                      d&#39;attente en remise qui sont alors difficilement attaquables par l&#39;adversaire. Ils peuvent\n                      servir à casser le rythme de l’échange de tennis. Il est par contre très rarement utilisé pour des\n                      coups d&#39;attaques en vue de gagner immédiatement le point mais plutôt en vue de monter à la\n                      volée. Steffi graf était connue pour employer quasiment systématiquement cet effet côté revers.\n                      L&#39;effet inverse est le lift.\n                    </p>\n\n                    <p><b> Classement protégé:</b> Faveur accordée au cas par cas par l&#39;ATP ou la WTA. Souvent après\n                      de longues absences, ce système permet à un joueur ou une joueuse de tennis de bénéficier, durant\n                      une période transitoire, de son ancien classement technique à son retour. Le joueur peut ainsi\n                      entrer directement dans les tableaux sans passer par les qualifications grâce à ce statut et jouer\n                      des matchs de son niveau. Il ne s&#39;agit toutefois pas de son vrai classement technique, qui\n                      continue à être calculé et qui entre en vigueur à la fin de la période transitoire.</p>\n\n                    <p><b>Classement technique ou classement de référence :</b> système de classement des joueurs et des\n                      joueuses de tennis adopté depuis le début de l&#39;ère Open en 1973. Le premier joueur à avoir été\n                      classé numéro un mondial est le célèbre llie Nastase. Basé sur les performances établies les douze\n                      derniers mois, le calcul est mis à jour chaque semaine, en général le lundi. Ce classement est\n                      utilisé pour déterminer les joueurs de tennis qui entrent directement dans le tableau final\n                      d&#39;un tournoi sans passer par les qualifications et pour désigner les têtes de série (les\n                      joueurs les mieux classés du tournoi sont disposés selon un ordre bien précis dans le tableau ,\n                      par exemple la tête de série numéro un est en haut et la tête de série numéro deux est en bas).\n                    </p>\n\n                    <p><b> Coach:</b> Terme anglais désignant l’entraîneur du joueur de tennis. Véritable observateur, il\n                      intervient sur la technique du tennis, la tactique et le mental lors des entraînements. La\n                      préparation physique au tennis est souvent déléguée à un autre spécialiste.\n                    </p>\n\n                    <p><b> Cogneur:</b> Joueur qui, de façon régulière, frappe puissamment dans la balle de tennis afin\n                      de réaliser un maximum de points gagnants ou de provoquer les fautes à son adversaire. C’est\n                      souvent au niveau du coup droit et du revers (coups de tennis de fond de court) que l’on retrouve\n                      ce profil.\n                    </p>\n\n                    <p><b> Continentale:</b> Est l’équivalent de la prise marteau. Cette prise est très utilisée dans le\n                      tennis pour les coups suivants : volée, service et revers coupé. Il y a une vingtaine d'années elle\n                      était utilisée pour les coups de fond de court au tennis mais depuis l’arrivée du lift elle est de\n                      moins en moins utilisée.</p>\n\n                    <p><b> Contre-amortie:</b> Coup amorti réalisé en réponse à une amortie (balle envoyée près du filet\n                      de tennis).</p>\n\n                    <p><b> Contre-pied:</b> Un joueur est pris à contre-pied lorsqu&#39;il reçoit une balle du côté\n                      opposé à son sens de déplacement (jeu de jambes) sur le court de tennis. Il a alors peu de chances\n                      de toucher la balle. Par extension, on parle de contre-pied pour désigner un coup qui prend à\n                      contre-pied un joueur.</p>\n\n                    <p><b> Contre-break, débreak ou contre-bris :</b> Break réalisé par un joueur lui-même déjà mené par\n                      au moins un break. Cette action permet souvent de revenir au score et mettre la pression sur celui\n                      qui mène.</p>\n\n                    <p><b> Cordage:</b> Ensemble des cordes qui constitue le tamis de la raquette de tennis. Elles\n                      peuvent être en boyau naturel, en matière synthétique, hybride et sont tendues parallèlement aux\n                      axes de symétrie du cadre de la raquette (les montants et les travers). La tension des cordes\n                      choisie varie en fonction du jeu et des sensations du joueur, mais aussi en fonction des\n                      conditions climatiques (température, humidité) si le cordage est en boyau\n                      naturel. Il est possible d’avoir une tension entre 20 et 30 kg dans les cas les plus extrêmes.\n                      Plus la tension est faible, plus l&#39;élasticité est forte et permet un renvoi plus rapide de la\n                      balle mais un contrôle plus difficile de la trajectoire.</p>\n\n                    <p><b> Couloir:</b> Zones se situant sur les parties latérales du court de tennis. Une balle qui\n                      tombe dans le couloir durant un échange est jugée faute en simple et bonne en double.</p>\n\n                    <p><b> Coup:</b> Action de frapper la balle avec la raquette de tennis.</p>\n\n                    <p><b> Coup boisé:</b> Coup involontaire frappé avec le cadre (autrefois en bois) de la raquette de\n                    tennis et qui provoque un effet inhabituel à la balle.</p>\n\n                    <p><b> Coup d&#39;approche:</b> Coup réalisé en préparation à une montée au filet pour réaliser une\n                      volée. Coup de débordement : coup de tennis (coup droit ouvers) souvent puissant et joué près des\n                      lignes qui met en difficulté l&#39;adversaire.</p>\n\n                    <p><b> Coup droit:</b> Coup effectué bras ouvert, du côté de la main qui tient la raquette de\n                      tennis. De rares joueurs effectuent leur coup droit avec une prise à deux mains, tels deux anciens\n                      numéros un mondiaux (Pancho Segura et Monica Seles). Cette prise de tennis demeure plus usitée sur\n                      le circuit féminin.\n                    </p>\n\n                    <p><b> Coup en touché :</b> Coup judicieux où la précision a été privilégiée à la puissance.</p>\n\n                    <p><b> Coup gagnant:</b> Permet au joueur de gagner directement le pojnt sans que l’adversaire ne\n                      puisse remettre la balle, voir point gagnant.\n                    </p>\n\n                    <p><b> Coup plat ou coup à plat:</b> Coups de tennis (coup droit ou revers) sans effet, très\n                      pratiqué dans les années 1970et 1980 par les américains.\n                    </p>\n\n                    <p><b> Coupe de la Fédération:</b> Voir fed cup, compétition féminine de tennis par équipe\n                      nationale.\n                    </p>\n\n                    <p><b> Coupe Davis:</b> Compétition masculine de tennis annuelle par équipe nationale.</p>\n\n                    <p><b> Court:</b> Terrain de tennis.\n                    </p>\n\n                    <p><b> Crocodile:</b> Terme péjoratif employé pour désigner un joueur de tennis qui est toujours\n                      loin derrière sa ligne de fond en renvoyant des balles liftées et qui attends la faute directe de\n                      son adversaire (à l&#39;inverse de l&#39;attaquant de fond de court). Ces joueurs aiment le combat\n                      physique au tennis pour épuiser leurs adversaires. Il est souvent utilisé pour qualifier les\n                      spécialistes exclusifs de terre battue. Le terme rameur, plus péjoratif encore, est également\n                      usité.</p>\n\n                    <p><b> Croisé:</b> Coup au tennis exécuté dans la diagonale du court, qui est la plus longue\n                      distance que peut parcourir une balle sur le court (trajectoire de sécurité), ou selon une ligne à\n                      peu près parallèle à la diagonale (par exemple lors d&#39;une volée de tennis croisée).</p>\n\n                    <p><b> Cuillère:</b> Service envoyé par le bas mais toujours sans rebond comme un coup droit.\n                      Michael chang l’a rendu célébre à roland garros contre ivan lendl en 1989. Il est aussi appelé le\n                      service à la cuillère.</p>\n\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"heading4\">\n                  <h4 class=\"panel-title\">\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse4\"\n                      aria-expanded=\"false\" aria-controls=\"collapse4\">\n                      Glossaire du tennis commençant par la lettre D :\n                    </a>\n                  </h4>\n                </div>\n                <div id=\"collapse4\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"heading4\">\n                  <div class=\"panel-body\">\n                    <p><b>Débreak:</b> Action de prendre le jeu de service de son adversaire (ou contre-break)</p>\n\n                    <p><b>Decoturf:</b> Surface de terrain de tennis en synthétique (dur) très rapide que l’on retrouve\n                      sur la saison américaine d’été (notamment l’US Open)</p>\n\n                    <p><b>Dehors:</b> Expression utilisée sur un jugement de balle lors d’un match de tennis pour\n                      exprimer une balle faute.</p>\n\n                    <p><b>Demi-volée:</b> Frappe de balle réalisée juste après le rebond</p>\n\n                    <p><b>Deuce:</b> Expression anglaise lors d’un match de tennis pour indiquer 40-40 ou égalité</p>\n\n                    <p><b>Deuxième balle ou deuxième service:</b> Deuxième chance attribuée à celui qui effectue un\n                      service au tennis\n                    </p>\n\n                    <p><b>Deux sets gagnants:</b> Match où il est nécessaire de remporter deux set pour gagner</p>\n\n                    <p><b>Disqualification:</b> Sanction éliminatoire pour cause par exemple de mauvais comportement, de\n                      retard (convocation)\n                    </p>\n\n                    <p><b>Double:</b> Match entre deux équipes de deux joueurs, chaque équipe étant de part et\n                      d&#39;autre du filet. On parle de double dames, de double messieurs ou de double mixte. Les\n                      couloirs du terrain de tennis sont utilisés lors de ces matchs et un même joueur peut frapper\n                      plusieurs fois de suite la balle lors d’un échange.\n                    </p>\n\n                    <p><b>Double faute:</b> Match entre deux équipes de deux joueurs, chaque équipe étant de part et\n                      d&#39;autre du filet. On parle de double dames, de double messieurs ou de double mixte. Les\n                      couloirs du terrain de tennis sont utilisés lors de ces matchs et un même joueur peut frapper\n                      plusieurs fois de suite la balle lors d’un échange.\n                    </p>\n\n                    <p><b>Double mixte:</b> Match de double dans lequel chaque équipe comprend une joueuse et un joueur.\n                      Seuls les tournois du Grand Chelem (Open d’Australie, Roland garros, Wimbledon, US Open) et la\n                      Hopman cup (Coupe Davis exhibition sur une semaine juste avant Roland Garros) avec trois matches :\n                      simple homme, simple femme et double mixte).</p>\n\n                    <p><b>Drive:</b> Anglicisme parfois utilisé pour désigner un coup droit ou un revers joué en\n                      longueur. </p>\n\n                    <p><b>Dunk:</b> Terme emprunté au basket-ball pour désigner un smash effectué les deux pieds\n                      décollés du sol. Noah, Pete Sampras étaient des adeptes de ce coup rare, spectaculaire réalisé\n                      souvent pendant  l'enchaînement service/volée.</p>\n\n                    <p><b>Dur:</b> Expression générique utilisée pour les surfaces dures, par opposition à la terre\n                      battue et au gazon. Les courts en dur sont en ciment ou en matière synthétique( Décoturf).</p>\n                  </div>\n                </div>\n              </div>\n\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n\n<!-- section3 ends -->\n\n<app-footer></app-footer>\n");

