"use strict";
__webpack_require__.r(__webpack_exports__);
/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n  <img src=\"./assets/images/jouer-tennis.jpg\" alt=\"Los Angeles\" />\n  <div class=\"inner_carousel\">\n    <h3>oh my Tennis</h3>\n  </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n  <div class=\"banner_container\">\n    <h3>Réservez un cours particulier</h3>\n    <div class=\"row\">\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input\n              class=\"form-control\"\n              id=\"\"\n              maxlength=\"6\"\n              placeholder=\"Code Postal\"\n              [(ngModel)]=\"Ville\"\n              type=\"text\"\n            />\n            <label><img src=\"./assets/images/ville_icon.png\"/></label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input\n              type=\"text\"\n              style=\"text-align:left!important;\"\n              [min]=\"min\"\n              class=\"form-control\"\n              id=\"\"\n              placeholder=\"Date\"\n              [(ngModel)]=\"Date\"\n              [owlDateTime]=\"dt1\"\n              [owlDateTimeTrigger]=\"dt1\"\n            />\n            <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n            <label><img src=\"./assets/images/date_icon.png\" /> </label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n        <button (click)=\"handleClick($event)\" class=\"btn black_btn\">\n          Rechercher\n        </button>\n      </div>\n    </div>\n  </div>\n</div>\n<!-- Inner Search area ends -->\n\n<div class=\"lexique_content haspadd\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"lexique\">\n        <div class=\"page_title_div col-xs-12\">\n          <h1 class=\"page_title\">Lexique du tennis</h1>\n          <img src=\"./assets/images/title_border.png\" alt=\"title_border\">\n        </div>\n        <div class=\"clearfix\"></div>\n        <div class=\"col-md-12 col-sm-12 col-xs-12\">\n          <div class=\"wrapper1 center-block\">\n            <div class=\"panel-group\" id=\"accordion\" role=\"tablist\" aria-multiselectable=\"true\">\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading active\" role=\"tab\" id=\"headingOne\">\n                  <h4 class=\"panel-title\">\n                    <a role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapseOne\"\n                      aria-expanded=\"true\" aria-controls=\"collapseOne\">\n                      Jargon du tennis commençant par la lettre E :\n                    </a>\n                  </h4>\n                </div>\n\n\n                <div id=\"collapseOne\" class=\"panel-collapse collapse in\" role=\"tabpanel\" aria-labelledby=\"headingOne\">\n                  <div class=\"panel-body\">\n                    <p><b>Échange:</b> Ensemble des coups (coup droit , revers , service , voléee) au tennis réalisé\n                      pendant un point.</p>\n                    <p><b>Eastern :</b> Prise de raquette de tennis surtout utilisée pour le coup droit. Pour un joueur\n                      droitier, le bas de la\n                      paume (éminence hypothénar) est appliquée sur le chanfrein haut-droit du manche.\n                    </p>\n\n                    <p><b>Effet:</b> Rotation de la balle dans l’air. Selon son sens, l&#39;effet est qualifié de lifté,\n                      coupé, slicé ou kické. Un coup sans effet est dit à plat. Un effet peut modifier substantiellement\n                      la trajectoire d&#39;une balle.</p>\n\n                    <p><b>Effet coupé :</b> Voir expression « chop » a la lettre C.</p>\n\n                    <p><b>Effet kické :</b> Terme employé principalement pour qualifier un service lifté où le joueur de\n                      tennis frappe la balle le plus souvent en position cambrée. Il coiffe véritablement la balle pour\n                      lui donner une trajectoire bombée. Cet effet est utilisé sur second service car il minimise le\n                      risque d&#39;erreur tout en rendant le retour de service difficile à contrôler.</p>\n\n                    <p><b>Effet lifté :</b> Effet imprimé à la balle afin que sa rotation soit dans le sens de son\n                      déplacement. Une balle liftée a une trajectoire bombée et prend de la vitesse au moment du rebond.\n                      C’est un coup très physique qui nécessite une action du poignet. L&#39;effet lifté est très\n                      efficace sur terre battue car la surface est particulièrement sensible aux effets. Rod Laver,\n                      Vilas et Björn Borg font partie des premiers champions à avoir utilisé l&#39;effet lifté dans les\n                      échanges. Rafael Nadal est considéré comme l&#39;un des meilleurs lifteurs des années 2000.</p>\n\n                    <p><b>Effet slicé ou coup slicé :</b> Un slice est un effet latéral imprimé à la balle. L&#39;effet\n                      slicé est souvent utilisé au service (notamment pour les gauchers pour trouver le revers de\n                      l’adversaire) et parfois au cours des échanges et permet de donner une trajectoire incurvée à la\n                      balle (déviation vers la gauche ou vers la droite) pour obtenir une rebond avec effet latéral\n                      (déviation).</p>\n\n                    <p><b>Effet rétro:</b> Effet coupé très prononcé en conséquence duquel la balle part en arrière\n                      après le rebond. C’est le seul coup du tennis où l’adversaire est autorisé de passer sa raquette\n                      au dessus du filet dans le terrain adverse pour rattraper la balle.</p>\n\n                    <p><b>Égalité :</b> (En anglais deuce) terme utilisé lorsque les joueurs sont à égalité de point\n                      après un avantage perdu. L&#39;expression 40-A ou 40 partout est toutefois normalement usitée pour\n                      désigner la toute première égalité précédant le premier avantage.\n                    </p>\n\n                    <p><b>Ère Open :</b> Période débutée en 1968, à laquelle les joueurs amateurs et professionnels ont\n                      été autorisés à disputer les tournois du Grand Chelem contre rémunération </p>\n\n                    <p><b>Entraîneur de tennis ou coach :</b> Personne qui entraîne un joueur ou une équipe. Dans la\n                      plupart des tournois professionnels, les entraîneurs ne sont pas autorisés à communiquer avec leur\n                      joueur. La Coupe Davis et la Fed Cup font figure d&#39;exceptions. Voir expression « coach » a la\n                      lettre C. On peut citer parmi les plus célèbres entraineurs de tennis Nick Bollettieri ou encore\n                      Patrice Hagelhauer.\n                    </p>\n\n                    <p><b>Épicondylite:</b> Inflammation au coude courante chez les joueurs de tennis, généralement\n                      causée par les vibrations de la raquette lors de la frappe. Une mauvaise technique avec notamment\n                      un bras plié à la frappe favorise ce genre de traumatisme. L&#39;utilisation d&#39;anti-vibrateurs\n                      permet de limiter les risques.\n                    </p>\n\n                    <p><b>Exhibition:</b> Match sans enjeu disputé en marge du circuit professionnel dans un but\n                      évènementiel. Parmi les exhibitions connues, on peut citer la bataille des sexes opposant Billie\n                      Jean King et Bobby Riggs en 1973 ou la bataille des surfaces entre Roger Federer et Rafael Nadal\n                      en 2007 (gazon d&#39;un côté du filet, terre battue de l&#39;autre).</p>\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"headingTwo\">\n                  <h4 class=\"panel-title\">\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\"\n                      href=\"#collapseTwo\" aria-expanded=\"false\" aria-controls=\"collapseTwo\">\n                      Expression du tennis commençant par la lettre F :\n                    </a>\n                  </h4>\n                </div>\n                <div id=\"collapseTwo\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"headingTwo\">\n                  <div class=\"panel-body\">\n                    <p><b>Faute :</b> Une balle est annoncée faute lorsqu&#39;elle rebondit en dehors des limites du\n                      court et sans toucher les lignes.\n                      Le point est alors gagné par l’adversaire. Lors du service, la balle est annoncée faute si elle\n                      rebondit en dehors du carré de service situé de l&#39;autre côté du filet dans la diagonale.\n                      Lorsqu&#39;une balle est faute, le juge de ligne annonce faute, dehors ou encore out. Il est\n                      possible également de lever juste l’index pour indiquer à son adversaire le jugement de la balle\n                      (en présence de bruit). A l’inverse une balle annoncée bonne est indiquée avec la paume de la main\n                      vers le sol avec la main plate.</p>\n\n                    <p><b>Faute directe (ou faute non provoquée) :</b> Coup manqué (dans le filet de tennis ou en dehors\n                      des limites du\n                      terrain) par un joueur de tennis sans aucune raison. Il s&#39;agit d&#39;un coup apparemment\n                      facile à réaliser. Plus un\n                      joueur a un tempérament risqué et plus son nombre de fautes directes sera grand.\n                    </p>\n\n                    <p><b>Faute de pied :</b> Une faute de pied est commise lorsqu&#39;un pied du serveur mord la ligne\n                      de fond de court (même\n                      du bout du pied). Pour éviter cette faute il doit sauter au dessus de la ligne pendant qu’il sert.\n                      Le receveur doit\n                      rester également dans sa moitié de terrain, avant que la balle ne soit frappée par le serveur.\n                      Cette faute est\n                      signalée par un juge de ligne du fond de court qui regarde les pieds du joueur de tennis lors de\n                      son service.\n                    </p>\n\n                    <p><b>Faute provoquée :</b> Coup manqué (dans le filet ou annoncé faute) par un joueur sous la\n                      contrainte de son adversaire sur une attaque ou un changement de variation durant l’échange. Le\n                      décompte des fautes provoquées, comme celui des fautes directes, est partiellement subjectif.\n                      Fed Cup (Coupe de la Fédération jusqu&#39;en 1994) : compétition féminine annuelle par équipe\n                      nationale\n                      regroupant les meilleures joueuses de tennis.\n                    </p>\n\n                    <p><b>Filet de tennis :</b> Elément délimitant les deux parties du court, tendu entre deux poteaux.\n                      Ils se mettent a l’intérieur des couloirs pour des matches de simples (on prend la longueur du\n                      poteau a partir de la ligne de couloir coté simple en l’allongeant par terre pour déterminer la\n                      distance adéquate, en double ils sont enlevés). Un joueur n&#39;est pas autorisé à le toucher\n                      durant l&#39;échange, ni avec une partie du corps, ni avec la raquette de tennis, au risque de\n                      perdre le point. Il est impossible de passer la raquette au dessus et de pénétrer dans le côté\n                      adverse, cependant seul un coup rétro de l’adversaire permet un passage au dessus du filet de\n                      tennis. On peut noter également que la hauteur du filet est différente au milieu du terrain (0,914\n                      cm) et à ses extrémités (1,07m) soit 15 cm d’écart ! On peut comprendre pourquoi certains serveurs\n                      sont très coutumiers de la fameuse ligne médiane et de l’ace sur le T !</p>\n\n                    <p><b>Forfait :</b> Victoire par disqualification de l’adversaire (scratch) en raison d’un mauvais\n                      comportement par exempele ou, beaucoup plus fréquemment, par forfait de l&#39;adversaire.\n                      (blessure, maladie) Abrégé W.O.ou walkl over.</p>\n\n                    <p><b>Frappe :</b> Voir coup a la lettre C.</p>\n\n                    <p><b>Future :</b> Circuit professionnel secondaire (équivalent de la 3 ème division), géré par\n                      l&#39;ITF, de niveau inférieur au circuit Challenger (2ème division) pour les hommes, et\n                      équivalent de ces Challenger pour les femmes : voir ITF\n                      Women&#39;s Circuit.</p>\n                  </div>\n                </div>\n              </div>\n\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"headingThree\">\n                  <h4 class=\"panel-title\">\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\"\n                      href=\"#collapseThree\" aria-expanded=\"false\" aria-controls=\"collapseThree\">\n                      Terme de tennis commençant par la lettre G :\n                    </a>\n                  </h4>\n                </div>\n                <div id=\"collapseThree\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"headingThree\">\n                  <div class=\"panel-body\">\n\n                    <p><b>Gazon ou herbe :</b> Surface sur laquelle se dispute notamment le tournoi de Wimbledon et\n                      quelques tournois préparatoires. C&#39;est une surface dite rapide sur laquelle le rebond des\n                      balles de tennis est bas voire fusant et qui était très en vogue jusque dans les années 1970.\n                      Aujourd’hui les joueurs de tennis professionnels jouent sur cette surface environ 1 mois par an.\n                      L&#39;Open d&#39;Australie s&#39;est disputé sur herbe jusqu&#39;en 1985 et l’US Open (ex Forest\n                      Hills) également jusqu’en 1974.</p>\n\n                    <p><b>Glissade :</b> Technique de déplacement employée surtout sur terre battue pour réaliser des\n                      coups de tennis en bout de course ou pour remplacer les petits pas d’ajustement. C’est une\n                      véritable science de déplacement qui a souvent fait défaut aux grands attaquants à Roland garros.\n                    </p>\n\n                    <p><b>Grand Chelem :</b> Désigne les quatre tournois de tennis les plus importants sur le circuit\n                      ATP : l&#39;Open d&#39;Australie, Roland-Garros, Wimbledon et l&#39;US Open. On dit qu&#39;un\n                      joueur de tennis réalise un Grand Chelem lorsqu&#39;il remporte tous les tournois la même année.\n                      En simple, depuis l&#39;ère Open, seuls Rod Laver (1969) chez les hommes, Margaret Smith Court\n                      (1970) et Steffi Graf (1988) chez les dames ont réalisé cet exploit. Lorsqu&#39;une personne\n                      parvient à gagner les quatre tournois d&#39;affilée à cheval sur deux ans, on parle parfois de\n                      Grand Chelem mais il est considéré comme moins prestigieux et on précise généralement « sur deux\n                      années ».</p>\n\n                    <p><b>Golden Grand Chelem (ou Golden Slam) :</b> Désigne la victoire des 4 tournois du Grand Chelem\n                      sur la même année en plus des jeux olympiques. Seule steffi graf l&#39;a réussi en 1988.</p>\n\n                    <p><b>Grand tableau :</b> Désigne les tours d&#39;un tournoi de tennis disputés après la phase de\n                      qualification (du premier tour jusqu&#39;en finale). Il regroupe les joueurs de tennis les mieux\n                      classés pouvant y participer.</p>\n                    <p><b>Greenset :</b> Surface rapide en ciment utilisée notamment aux Etats Unis sur la tournée\n                      américaine des tournois de tennis conduisant a l’US Open.</p>\n                    <p><b>Grip :</b> Matière en synthétique ou cuir recouvrant le manche de la raquette de tennis afin\n                      de permettre une meilleure prise. Lorsqu&#39;il est usé, on peut le recouvrir d&#39;un sur-grip ou\n                      over-grip pour un meilleur confort.</p>\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"heading4\">\n                  <h4 class=\"panel-title\">\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse4\"\n                      aria-expanded=\"false\" aria-controls=\"collapse4\">\n                      Tout sur le tennis  commençant par la lettre H :\n                    </a>\n                  </h4>\n                </div>\n                <div id=\"collapse4\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"heading4\">\n                  <div class=\"panel-body\">\n                    <p><b>Hawk-Eye :</b> Terme anglais « œil de faucon » : système d&#39;assistance-vidéo pour les\n                      arbitres de chaise durant les\n                      matchs de tennis. Chaque joueur de tennis a le droit de « challenger » l’arbitre 2 fois par set\n                      (une fois\n                      supplémentaire si il y a tie break). Si après vérification le hawk eye donne raison au joueur, son\n                      challenge n’est pas comptabilisé. Utilisé sur certains courts de tennis du circuit professionnel\n                      de tennis WTA et ATP car son coût d’entretien est très onéreux (environ 10 000 euros par jour). Ce\n                      mode d’arbitrage est pluôt utilisé sur les courts de tennis centraux des tournois.</p>\n                    <p><b>Herbe :</b> Surface des terrains de tennis rapide utilisée pour le tournoi du Grand Chelem de\n                      Wimbledon. Autre terme utilisé le gazon.\n                    </p>\n                    <p><b>Heureux perdant :</b> Traduction de l’anglais lucky looser ou repêché : joueur de tennis qui a\n                      perdu pendant les qualifications d’un tournoi mais qui profite du désistement d&#39;un autre\n                      joueur (blessé ou malade) pour disputer la phase finale d&#39;un tournoi. (Abrégé en LL).</p>\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"heading5\">\n                  <h4 class=\"panel-title\">\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse5\"\n                      aria-expanded=\"false\" aria-controls=\"collapse5\">\n                      Expressions sur le tennis  commençant par la lettre I :\n                    </a>\n                  </h4>\n                </div>\n                <div id=\"collapse5\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"heading5\">\n                  <div class=\"panel-body\">\n                    <p><b>Indoor :</b> Terme anglais utilisé pour désigner un terrain de tennis se jouant en intérieur\n                      (en salle) qu’importe la surface.</p>\n                    <p><b>International Series :</b> Tournois de l&#39;ATP Tour (circuit des joueurs professionnels),\n                      moins prestigieux que les tournois du Grand Chelem et que les Masters 1000. Ils représentent la\n                      plus grande partie des tournois de tennis disputés durant l’année.\n                    </p>\n                    <p><b>Invitation :</b> Possibilité reçue par un joueur professionnel de disputer un tournoi auquel\n                      il n’a pas le droit de participer en raison de son classement trop faible. Elles sont au nombre de\n                      8 par exemple sur un tournoi du Grand Chelem. Il accède directement au tableau final sans même\n                      passer par les qualifications. Elle est généralement attribuée à un joueur de tennis revenant de\n                      blessure, un ancien gagnant de ce tournoi de tennis ou à un jeune espoir national. L’utilisation\n                      abrégée est W.C. pour Wild Card. Attribuées à la discrétion des organisateurs des tournois de\n                      tennis, elles ne sont pas sans susciter des polémiques.\n                    </p>\n                    <p><b>ITF :</b> International tennis federation (Fédération internationale de tennis ). Elle a en\n                      charge la gestion de la Fed Cup, les 4 tournois du Grand Chelem, (Open d’Australie, Roland garros,\n                      Wimbledon, Us Open), de la Coupe Davis, de la Coupe Hopman, des tournois Challenger(équivalent de\n                      la 2eme division du circuit ATP), Future et Satellite (équivalent de la 3eme division du circuit\n                      ATP).</p>\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"heading6\">\n                  <h4 class=\"panel-title\">\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse6\"\n                      aria-expanded=\"false\" aria-controls=\"collapse6\">\n                      Terme de tennis  commençant par la lettre J\n                    </a>\n                  </h4>\n                </div>\n                <div id=\"collapse6\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"heading6\">\n                  <div class=\"panel-body\">\n                    <p><b>Jeu :</b> Désigne un total de 4 points disputés et gagné par un joueur de tennis avec 2 points\n                      d’écart. On compte 0,\n                      15, 30, 40 et jeu si les deux joueurs arrivent a 40-40 il y a Avantage puis Jeu (2 points\n                      d’écart). Pendant un jeu, c&#39;est toujours le même joueur qui sert et qui alterne une fois a\n                      droite et une fois a gauche du terrain de tennis. Un set est gagné par un joueur s&#39;il atteint\n                      le nombre de 6 jeux avec deux jeux d&#39;écart ou s&#39;il gagne le jeu décisif lorsque cette\n                      règle est appliquée.</p>\n                    <p><b>Jeu blanc :</b> Jeu durant lequel un joueur gagne 4 points consécutivement depuis le début. Il\n                      est souvent réalisé par le serveur. On parle aussi de break blanc lorsqu&#39;un joueur réalise un\n                      jeu blanc sur le service de son adversaire. (souvent réalisé en début de match quand le joueur\n                      n’est pas chaud).</p>\n                    <p><b>Jeu de jambe(s) :</b> Capacité d&#39;un joueur à se déplacer et se replacer sur le court de\n                      pour arriver près de la balle de tennis. On distingue le grand jeu de jambes (foulées allongées\n                      des pas de course) du petit jeu de jambes (petits pas d’ajustement) avant la frappe de balle.\n                    </p>\n                    <p><b>Jeu décisif, tie-break ou bris d&#39;égalité :</b> Jeu particulier départageant les joueurs de\n                      tennis à la fin d&#39;un set lorsque le score est de 6-6 en jeux. Le premier joueur à remporter au\n                      moins sept points avec deux points d&#39;écart remporte le set. L’ordre des serveurs est ainsi :\n                      le premier joueur a servir est celui qui a retourné lors du jeu précédent le tie-break, il sert\n                      pour un point et ensuite on change de serveur tous les 2 points. On change également de coté tous\n                      les 6 points joués (4-2, 6-6 par exemple).\n                    </p>\n                    <p><b>Jeu, set et match :</b> Phrase prononcée en fin de match par l&#39;arbitre de chaise pour\n                      signifier la victoire d&#39;un des joueurs, et donc la fin de la rencontre.</p>\n                    <p><b>Jouer long :</b> Joueur qui envoie des balles de tennis bonnes proches de la ligne de fond à\n                      environ 1m/1m,50 afin de repousser au maximum l’adversaire pour se protéger et éviter de se faire\n                      attaquer. C’est une des premières tactiques de base au tennis.</p>\n                    <p><b>Juge-arbitre :</b> Arbitre général d&#39;un tournoi (administrateur) auquel l&#39;arbitre de\n                      chaise fait appel en cas de problème ou litige particulier dans les tournois professionnels\n                      (interruption d’un match ou litige avec un joueur par exemple). Dans beaucoup de tournois\n                      amateurs, il s&#39;agit du seul arbitre car les joueurs s&#39;auto-arbitrent comptant sur leur\n                      fair-play.</p>\n                    <p><b>Juge de chaise :</b> Voir arbitre de chaise.</p>\n                    <p><b>Juge de filet :</b> Arbitre placé à hauteur du filet avec sa main en contact avec la bande du\n                      filet et qui annonce le let lors du service. Ils sont aujourd’hui remplacés par un système de\n                      détection automatique.</p>\n                    <p><b>Juge de ligne :</b> Arbitre placé en marge du court de tennis (derrière ou sur les cotés) et\n                      dont la tâche est de vérifier si la balle est bonne ou non. C’est à l’aide de leurs bras qu’ils\n                      indiquent leur jugement (si le bras est tendu vers un coté c’est que la balle est sortie, si les\n                      deux bras se rejoignent par les mains ils indiquent que la balle est bonne). L&#39;un d&#39;eux a\n                      également pour rôle de vérifier les fautes de pied lors du service. (juge de la ligne de fond de\n                      court). Le nombre de juges de ligne peut varier entre sept et neuf : deux pour les lignes de fond,\n                      quatre pour les couloirs, un pour la ligne de service (qui change de côté tous les deux jeux, en\n                      décalé par rapport au changement de côté des joueurs) et éventuellement deux pour la ligne médiane\n                      lors du service (leur rôle peut être endossé par\n                      un juge de couloir qui se place vers la ligne médiane puis se déplace vers son couloir une fois le\n                      service\n                      effectué). Ces juges sont des assistants de l&#39;arbitre de chaise, lequel a le dernier mot en\n                      cas de doute.</p>\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"heading7\">\n                  <h4 class=\"panel-title\">\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse7\"\n                      aria-expanded=\"false\" aria-controls=\"collapse7\">\n                      Vocabulaire du tennis  commençant par la lettre K :\n                    </a>\n                  </h4>\n                </div>\n                <div id=\"collapse7\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"heading7\">\n                  <div class=\"panel-body\">\n                    <b>Kick ou effet kické :</b> Terme employé principalement pour qualifier un service comportant un\n                    effet lifté. Il est possible d’employer cette option pour effectuer une service – volée pour se\n                    laisser le temps de monter au filet de tennis. Cet effet est également employé la plupart du temps\n                    lors du second service car il minimise le risque d&#39;erreur tout en rendant la mise en jeu\n                    difficile à retourner.\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"heading8\">\n                  <h4 class=\"panel-title\">\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse8\"\n                      aria-expanded=\"false\" aria-controls=\"collapse8\">\n                      Vocabulaire de tennis  commençant par la lettre L :\n                    </a>\n                  </h4>\n                </div>\n                <div id=\"collapse8\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"heading8\">\n                  <div class=\"panel-body\">\n                    <b>Lance-balles ou cracheuse de balles :</b> Matériel automatique permettant à un joueur de tennis\n                    de s&#39;entraîner seul sur un terrain ou lors d’un cours particulier afin de corriger en temps réel\n                    son élève. Le coût de ce matériel étant relativement élevé, une grande partie des joueurs amateurs\n                    s&#39;entraînent face à un mur lorsqu&#39;ils sont seuls.<br /><br />\n                    <b>Let (ou parfois net) :</b> Un service est annoncé let lorsque la balle de tenis touche la bande\n                    du filet sans être faute. Le joueur est alors invité à refaire un service (donc un let sur une\n                    seconde balle permet seulement de rejouer une seconde balle). L&#39;arbitre peut également annoncer\n                    let au cours d&#39;un point de tennis dans des cas bien spécifiques (balle qui tombe de la poche\n                    d&#39;un joueur, un cri dans le public gênant les joueurs, over-rule de l’arbitre, événement\n                    extérieur interrompant le match de tennis). Le point est alors à rejouer.\n                    <br /><br />\n                    <b>Lift ou coup lifté :</b> Un lift est un effet imprimé à la balle afin que sa rotation soit dans\n                    le sens de son déplacement. Une balle liftée a une trajectoire bombée et prend de la vitesse au\n                    moment du rebond pour jaillir et repousser l’adversaire car elle devient incontrôlable. L&#39;effet\n                    lifté est très efficace sur terre battue car la surface est particulièrement sensible aux effets.\n                    Beaucoup de joueurs Espagnols et Sud-Américains emploient cet effet dans\n                    la majorité de leurs frappes. Guillermo Vilas ou encore Bjorn Borg font partie des premiers\n                    champions à avoir\n                    utilisé très fréquemment l&#39;effet lifté dans les échanges. Rafael Nadal est considéré comme\n                    l&#39;un des meilleurs\n                    lifteurs des années 2000.<br /><br />\n                    <b>Ligne :</b> Bande blanche au sol, qui délimite le court de tennis et certaines zones de jeu. Il\n                    existe plusieurs types de.<br /><br />\n\n                    <b>Ligne de côté ou des couloirs :</b> Au nombre de quatre (voire deux sur certains courts spéciaux\n                    ne comportant\n                    pas de couloirs), elles mesurent 23,77 m.\n                    <br /><br />\n                    <b>Ligne de fond :</b> Ligne délimitant le fond du court au délà de celle-ci la balle est faute. Au\n                    nombre de deux, elles\n                    mesurent 8,23 m en simple et 10,97 m en double.\n                    <br /><br />\n                    <b>Ligne de service :</b> Ligne délimitant le fond des carrés de service. Au nombre de deux, elles\n                    mesurent 8,23 m et\n                    sont situées à 6,40 m du filet.\n                    <br /><br />\n                    <b>Ligne médiane :</b> Ligne séparant en deux les carrés de service. Perpendiculaire au filet,\n                    qu&#39;elle traverse, elle mesure 12,80 m. Cette ligne est rappelée par un petit trait placé, dans\n                    son prolongement, sur les lignes de fond. Ce trait permet au joueur de se placer du bon côté pour\n                    servir en diagonale.\n                    <br /><br />\n                    <b>Lob :</b> Coup de tennis réalisé par un joueur lorsque son adversaire est avancé dans le terrain\n                    (près du filet). Il consiste à faire passer la balle par dessus l&#39;adversaire tout en la gardant\n                    dans les limites du court de tennis. L&#39;effet\n                    lifté est fréquemment employé pour l&#39;exécution de ce coup car il permet d&#39;accentuer\n                    l&#39;angle de la trajectoire\n                    parabolique de la balle et ainsi emporte le joueur adverse vers le fond. Un lob trop court peut\n                    entraîner un smash\n                    de l&#39;adversaire qui est souvent gagnant. Un lob peut être réalisé dans une optique offensive (en\n                    vue de gagner le\n                    point tout en essayant de viser le revers adverse) ou en dernier recours lorsque que le joueur est\n                    débordé. Dans ce\n                    dernier cas, le lob est exécuté dans l&#39;urgence avec une effet coupé et est rarement efficace\n                    mais il a l&#39;avantage de\n                    donner du temps pour le replacement.\n                    <br /><br />\n                    <b>Long de ligne :</b> Coup exécuté le long d&#39;une ligne du couloir, pratiquement parallèle à\n                    celle-ci. C&#39;est un coup\n                    particulièrement risqué car le filet est plus haut sur les côtés du court. Et le risque de voir sa\n                    balle dévié est\n                    grand. Il est principalement utilisé pour les attaques du fond de court ou les passings-shots.\n                    <br /><br />\n                    <b>Longueur de balle :</b> Caractérise une balle plus ou moins proche de la ligne de fond (environ 2\n                    mètres minimum).\n                    On dit qu&#39;un joueur trouve une bonne longueur de balle quand il remet des balles bonnes\n                    régulièrement proches\n                    de la ligne de fond afin de se protéger contre des possibles attaques.\n                    <br /><br />\n                    <b>Love :</b> Terme utilisé en anglais pour dire zéro lors du décompte des points (15-0 est donc\n                    annoncé fifteen-love).<br /><br />\n                    <b>Lucky loser (littéralement « Perdant chanceux ») ou repêché :</b> joueur qui a perdu son match\n                    pendant les qualifications au dernier tour mais qui profite du désistement de dernière minute\n                    d&#39;un autre joueur (blessure, maladie) pour disputer la phase finale d&#39;un tournoi. (Abrégé en\n                    LL).\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"heading9\">\n                  <h4 class=\"panel-title\">\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse9\"\n                      aria-expanded=\"false\" aria-controls=\"collapse9\">\n                      Tout sur le tennis  commençant par la lettre M :\n                    </a>\n                  </h4>\n                </div>\n                <div id=\"collapse9\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"heading9\">\n                  <div class=\"panel-body\">\n                    <b>Manche : </b>Dans le language du tennis le mot set peut être remplacé par le mot manche. Exemple:\n                    andré Agassi vient de gagner la première manche 6/1\n                    <br /><br />\n                    <b>Manche de raquette:</b> Le manche de raquette de tennis désigne la partie inférieure de la\n                    raquette de tennis ( ou le joueur appose sa main). Le manche de la raquette de tennis est constitué\n                    de meplat et chanfrein. Le joueur de tennis peut aussi poser sur le manche de la raquette un surgrip\n                    afin de protéger sa main des frottements du.\n                    <br /><br />\n                    <b>manche de la raquette Manchette :</b> Petit morceau de tissu qui entoure le poignet du joueur de\n                    tennis. Ceci afin de\n                    permettre au joueurs ou joueuses de tennis d&#39;essuyer la sueur qu&#39;ils peuvent avoir sur leur\n                    front.\n                    <br /><br />\n                    <b>Marteau (la prise marteau) :</b> Il ne faut pas confondre la tenue de la raquette de tennis et la\n                    prise. La tenue de\n                    raquette de tennis désigne la hauteur ou le joueur de tennis pose sa main sur le manche de la\n                    raquette de tennis.\n                    La prise marteau s&#39;effectue lorsque l&#39;on pose l&#39;eminence hypothenar sur le chanfrein\n                    supérieur, plus simplement\n                    prenez votre raquette de la même façon qu&#39;un marteau.\n                    <br /><br />\n                    <b>Masters :</b> Les masters est un des tournois de tennis des plus prestigieux de la planète. Il\n                    regroupe chaque année\n                    les 8 meilleurs joueurs du monde dans un tournoi de tennis sous forme de poule de 4 joueurs ou les\n                    deux\n                    meilleurs de chaque poules sorte sur un tableau final.\n                    <br /><br />\n                    <b>Masters séries :</b> Les masters séries sont les tournois de tennis les plus important du monde.\n                    Chaque masters\n                    séries de tennis rapporte plus de 1000 points atp pour le vainqueur. A l&#39;heure actuelle nous\n                    comptons 9 masters\n                    séries.\n                    <br /><br />\n                    <b>Match :</b> Un match de tennis se déroule la plupart du temps au meilleur des 3 manches. Un match\n                    de tennis\n                    oppose deux joueurs en simple et 4 joueurs en double.\n                    <br /><br />\n                    <b>Meilleur des 3 sets :</b> Dans la plupart des tournois de tennis professionnels comme amateur\n                    pour gagner un match\n                    il faut gagner 2 sets, si il y a égalité de set au terme des deux premiers sets du match de tennis\n                    il y aura alors un\n                    3e set pour départager les joueurs.\n                    <br /><br />\n                    <b>Meilleur des 5 manches :</b> Lors des tournois du grand chelem et des matchs de coupe davis\n                    chaque match se\n                    déroulera au meilleur des 5 manches, il faudra donc gagner 3 set pour remporter la rencontre.\n                    <br /><br />\n                    <b>Le meplat :</b> Il désigne une des arrêtes latérales du manche de la raquette de tennis.\n                    <br /><br />\n                    <b>Le mini tennis:</b> Le mini tennis est une pré-initiation au tennis pour les enfants de 5 ans. Le\n                    mini tennis permet\n                    d&#39;apprendre le tennis aux enfants a l&#39;aide de jeux et de matériaux adaptés. Tout ceci pour\n                    leur apprendre les\n                    régles et les premieres notions de jeux du tennis.\n                    <br /><br />\n                    <b>Mise en jeu :</b> La mise en jeu désigne la premiere balle jouée par le serveur au tennis.\n                    <br /><br />\n                    <b>Mixte :</b> Les joueuses et les joueurs de tennis ont la possibilité de participer a des tournois\n                    de tennis en double mixte, c&#39;est a dire d&#39;une équipe composée d’un joueur et d’une joueuse\n                    de tennis.\n                    <br /><br />\n                    <b>Montée en chaussette :</b> Au tennis une montée en chaussette est caractérisée par une montée au\n                    filet de tennis très hasardeuse.\n                    <br /><br />\n                    <b>Montée a la volée :</b> Une montée a la volée ou au filet est caractérisé par le déplacement du\n                    joueur vers le filet afin d effectuer des volées de fixation ou de finition.\n                    <br /><br />\n                    <b>Mur d&#39;entrainement :</b> Le mur d&#39;entrainement au tennis est un élément indispensable\n                    d&#39;un club de tennis. Il permet aux joueurs de s&#39;entrainer seul en envoyant la balle vers un\n                    mur. ( généralement une ligne blanche horizontale est tracé sur celui-ci afin de représenter le\n                    filet de tennis ).\n                  </div>\n                </div>\n              </div>\n\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n\n<!-- section3 ends -->\n\n<app-footer></app-footer>\n");

