__webpack_require__.r(__webpack_exports__);
/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n  <img src=\"./assets/images/jouer-tennis.jpg\" alt=\"Los Angeles\" />\n  <div class=\"inner_carousel\">\n    <h3>oh my Tennis</h3>\n  </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n  <div class=\"banner_container\">\n    <h3>Réservez un cours particulier</h3>\n    <div class=\"row\">\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input\n              class=\"form-control\"\n              id=\"\"\n              maxlength=\"6\"\n              placeholder=\"Code Postal\"\n              [(ngModel)]=\"Ville\"\n              type=\"text\"\n            />\n            <label><img src=\"./assets/images/ville_icon.png\"/></label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input\n              type=\"text\"\n              style=\"text-align:left!important;\"\n              [min]=\"min\"\n              class=\"form-control\"\n              id=\"\"\n              placeholder=\"Date\"\n              [(ngModel)]=\"Date\"\n              [owlDateTime]=\"dt1\"\n              [owlDateTimeTrigger]=\"dt1\"\n            />\n            <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n            <label><img src=\"./assets/images/date_icon.png\" /> </label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n        <button (click)=\"handleClick($event)\" class=\"btn black_btn\">\n          Rechercher\n        </button>\n      </div>\n    </div>\n  </div>\n</div>\n<!-- Inner Search area ends -->\n\n\n\n<div class=\"lexique_content haspadd\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"lexique\">\n        <div class=\"page_title_div col-xs-12\">\n          <h1 class=\"page_title\">Lexique du tennis</h1>\n          <img src=\"./assets/images/title_border.png\" alt=\"title_border\">\n        </div>\n        <div class=\"clearfix\"></div>\n        <div class=\"col-md-12 col-sm-12 col-xs-12\">\n          <div class=\"wrapper1 center-block\">\n            <div class=\"panel-group\" id=\"accordion\" role=\"tablist\" aria-multiselectable=\"true\">\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading active\" role=\"tab\" id=\"headingOne\">\n                  <h4 class=\"panel-title\">\n                    <a role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapseOne\"\n                      aria-expanded=\"true\" aria-controls=\"collapseOne\">\n                      Lexique sur le tennis  commençant par la lettre R :\n                    </a>\n                  </h4>\n                </div>\n\n                <div id=\"collapseOne\" class=\"panel-collapse collapse in\" role=\"tabpanel\" aria-labelledby=\"headingOne\">\n                  <div class=\"panel-body\">\n                    <p><b>Race:</b> Classement des joueurs et des joueuses de tennis adoptés depuis 2000 (pour la petite\n                      histoire Fabrice Santoro est le premier numéro mondial de la Race). Le classement se calcule sur\n                      les performances établies pendant l&#39;année en cours et détermine les joueurs de tennis\n                      sélectionnés pour le Masters de fin d&#39;année. Il est publié chaque semaine et remis à zéro à\n                      chaque début de saison en janvier. Il existe un second mode de. classement: Le classement\n                      technique.</p>\n\n                    <p><b>Rallye:</b> Echange de tennis avec beaucoup de frappes de la part des joueurs.</p>\n\n                    <p><b>Ramasseur (de balles de tennis) :</b> Personne, souvent mineure, et passionnée de tennis qui\n                      se charge de ramasser la balle à la fin d&#39;un point afin de garder le terrain de tennis propre.\n                      Ils sont cinq ou six ramasseurs sur le court de. Tennis: Un dans chaque coin et un ou deux au\n                      niveau des poteaux du filet de tennis. Les ramasseurs font rouler les balles de tennis par terre\n                      entre eux afin de fournir le serveur en balles. Le ramasseur garde aussi la serviette du joueur de\n                      tennis.</p>\n\n                    <p><b>Rameur:</b> Joueur de tennis qui est prêt à rester longtemps sur sa ligne de fond de court\n                      pour gagner le point sans attaquer. Ce type de jeu convient aux personnes endurantes qui aiment\n                      taper beaucoup de balles de tennis avant de gagner le point.\n                    </p>\n\n                    <p><b>Raquette:</b> Materiel utilisé par les joueurs de tennis pour exécuter des frappes sur le\n                      terrain.</p>\n\n                    <p><b>Rebound Ace:</b> Surface des courts de tennis de l&#39;Open d&#39;Australie de 1998 à 2008\n                      jugée moins rapide avec un rebond de balle assez haut.</p>\n\n                    <p><b>Rencontre:</b> Terme qui désigne un match de tennis mais aussi un ensemble de matches dans le\n                      cas d&#39;opposition entre clubs de tennis (amateur) ou encore de pays (coupe davis).\n                      Repêché joueur de tennis ne devant pas accéder au tableau final d&#39;un tournoi de tennis mais\n                      suite à une défection rentre dans le tableau final.\n                    </p>\n\n                    <p><b>Replacement:</b> Course effectuée par un joueur de tennis après la frappe de la balle. Il peut\n                      se faire soit en pas chassés (si le joueur est dans les temps) soit en pas courus (si le joueur de\n                      tennis est en retard).\n                    </p>\n\n                    <p><b>Reprise ou time:</b> Terme annoncé par l&#39;arbitre de chaise à la fin du temps écoulé au\n                      changements de côtés (il est de 1 minute 30 secondes durant le set et de 2 minutes a la fin de\n                      chaque set).</p>\n\n                    <p><b>Retour: </b>Premiere frappe effectuée par l'adversaire pour engager le point. C'est un coup de tennis un peu à part car l'organisation de la gestuelle est assez réduite car le temps de réaction est logiquement diminué.\n                    </p>\n\n                    <p><b> Revers: </b> Coup effectué du côté opposé à la main qui tient la raquette. Cette frappe peut\n                      être jouée avec une prise à une main ou à deux mains.\n                    </p>\n\n                    <p><b> Roue de bicyclette:</b> Lorsqu&#39;un des joueurs de tennis ne marque aucun jeu durant le set\n                      joué, il se prend un roue de bicyclette ou une bulle soit 0 jeu marqué.\n                    </p>\n\n                    <p><b> Round robin:</b> Dans une compétition et plus précisément au Masters, c&#39;est un tour\n                      particulier (poule) où les joueurs de tennis se rencontrent chacun entre eux.</p>\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"heading1\">\n                  <h4 class=\"panel-title\">\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse1\"\n                      aria-expanded=\"false\" aria-controls=\"collapse1\">\n                      Terme du tennis commençant par la lettr S :\n                    </a>\n                  </h4>\n                </div>\n                <div id=\"collapse1\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"heading1\">\n                  <div class=\"panel-body\">\n                    <p><b>Saison régulière:</b> Correspond au calendrier des tournois de tennis atp et wta qui se\n                      déroule de janvier à novembre.</p>\n\n                    <p><b>Tournois satellite:</b> Les tournois de tennis satellites représentent des épreuves moins\n                      importantes que les challengers et et futures ( moins de points ATP à gagner).</p>\n\n                    <p><b>Scratch:</b> Un joueur de tennis est scratché lorsqu&#39;il ne se présente pas à la convocation du juge arbitre.</p>\n\n                    <p><b>Seconde balle de service:</b> Au service le joueur de tennis a le droit a deux chances pour\n                      rentrer dans le point. La seconde balle est donc la dernière chance pour le serveur pour pouvoir\n                      engager le point contre son adversaire.\n                    </p>\n\n                    <p><b>Serveur:</b> Le serveur est le joueur qui commence le point au tennis par un service.</p>\n\n                    <p><b>Service gagnant:</b> Un service est dit gagnant lorsque le receveur n&#39;arrive pas à renvoyer la balle de tennis. Si le receveur ne touche pas la balle alors le serveur a fait un axe.\n                    </p>\n\n                    <p><b>Service volée :</b> Le service volée est une tactique qui consiste à suivre la balle que\n                      l&#39;on vient de servir au filet de tennis. Cela permet de moins laisser de temps au receveur.\n                    </p>\n\n                    <p><b>Simple:</b> Le simple est un des deux formats de jeu du tennis. Il est le format le plus\n                      courant match de tennis entre deux joueurs. Le double est l&#39;autre format de jeu.\n                    </p>\n\n                    <p><b>Slice:</b> Le slice est un effet de rotation que le joueur de tennis donne à la balle de\n                      tennis. Il est utilisé la plupart du temps au service pour sortir latéralement le joueur du\n                      terrain de tennis.\n                    </p>\n\n                    <p><b>Smash:</b> Le smash est le coup le plus puissant du tennis, il consiste à rabattre la balle\n                      vers le sol (comme au service ).Le smash s&#39;effectue généralement proche du filet.\n                    </p>\n\n                    <p><b>Spécialiste:</b> Un spécialiste est un joueur de tennis qui préfère plus particulièrement une\n                      surface de jeu plutôt qu&#39;une autre. Un spécialiste peut être aussi un joueur qui préfère aussi\n                      en fonction de ses points forts effectuer une tactique particulière ( service volée, fond de court\n                      ).\n                    </p>\n\n                    <p><b>Super tie-break:</b> Lors de certains match de tennis d&#39;exhibition  à 1 set partout le 3e set se déroule en un Super tie-break en 10 points. Le premier joueur à gagner au moins 10 points avec deux points d'écart aura alors gagné la rencontre.\n                    </p>\n\n                    <p><b>Surface: </b>La surface de jeux est la matière utilisée pour fabriquer les courts de tennis\n                      terre battue, gazon, résine, synthétique.\n                    </p>\n\n                    <p><b>Surgrip:</b> Un surgrip est une bande que l&#39;on applique sur le manche de la raquette de\n                      tennis afin d&#39;éviter les frottements entre le manche et la main.\n                    </p>\n\n                    <p><b>Synthétique:</b> Est une surface de jeu au tennis ( paris bercy ).</p>\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"heading2\">\n                  <h4 class=\"panel-title\">\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse2\"\n                      aria-expanded=\"false\" aria-controls=\"collapse2\">\n                      Jargon sur le tennis commençant par la lettre T :\n                    </a>\n                  </h4>\n                </div>\n                <div id=\"collapse2\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"heading2\">\n                  <div class=\"panel-body\">\n                    <p><b>T:</b> Ligne centrale sur le terrain de tennis, désignée par la forme que prend le croisement\n                      de celle-ci avec la ligne de service. On dit qu&#39;un service est sur le T lorsque la balle de\n                      tennis touche cette ligne.</p>\n                    <p><b>Tableau de qualifications:</b> Voir expression qualification. Tableau final ou principal: voir\n                      grand tableau.</p>\n\n                    <p><b>Tamis:</b> Partie de la raquette de tennis en forme ovale, composée de cordes, avec laquelle\n                      est frappée la balle de tennis. Le tamis est délimité par le cadre de la raquette de tennis.\n                    </p>\n\n                    <p><b>Taraflex:</b> Surface du terrain de tennis en synthétique très rapide utilisée dans certains\n                      tournois indoor.\n                    </p>\n\n                    <p><b>Tennis elbow:</b> Inflammation au coude propre aux joueurs de tennis, généralement causée par\n                      les vibrations de la\n                      raquette de tennis lors de l&#39;impact de balle. L&#39;utilisation d&#39;anti-vibrateurs permet\n                      de limiter les risques de blessure\n                      récurrente.\n                    </p>\n\n                    <p><b>Tennisman, tenniswoman (faux anglicisme) :</b> Voir joueur de tennis.\n                    </p>\n\n                    <p><b>Tennistique:</b> Relatif à l'univers du tennis.\n                    </p>\n\n                    <p><b>Tension:</b> Voir cordage de la raquette de tennis.\n                    </p>\n\n                    <p><b>Terre battue:</b> Surface de terrain de tennis sur laquelle se déroulent plusieurs tournois de\n                      tennis, dont Roland Garros, Monte Carlo, Rome C&#39;est une surface dite lente qui est très\n                      sensible aux effets de balle de tennis et sur laquelle le rebond des balles de tennis est\n                      relativement haut.\n                    </p>\n\n                    <p><b>Terrien:</b> Joueur de tennis spécialiste de terre battue qui est la surface d&#39;un terrain\n                      de tennis.\n                    </p>\n\n                    <p><b>Tête de série:</b> Joueur de tennis suffisamment bien classé pour avoir un tirage au sort\n                      favorable dans un tournoi de tennis. Les têtes de série ne se rencontrent pas avant le troisième\n                      tour d&#39;un tournoi de tennis. Les têtes de série numéros 1 et 2 ne peuvent pas se rencontrer\n                      avant la finale (ni non plus les têtes de série numéros 3 et 4).\n                    </p>\n\n                    <p><b>Thermobag:</b> Sac de rangement de raquettes de tennis doublé d&#39;un système isolant\n                      thermique, pour protéger le cordage des raquettes des changements de température susceptibles de\n                      modifier leur tension.\n                    </p>\n\n                    <p><b>Tie-break:</b> Voir jeu décisif.\n                    </p>\n\n                    <p><b>Time:</b> Voir reprise.\n                    </p>\n\n                    <p><b>Tirer un passing:</b> Voir passer.\n                    </p>\n\n                    <p><b>Toss ou Tirage au sort:</b> Tirage au sort fait par l&#39;arbitre au début d&#39;un match de\n                      tennis à l&#39;aide d&#39;une pièce ou avec une raquette de tennis chez les amateurs avec le logo\n                      (à l'envers ou à l'endroit). Le joueur de tennis qui gagne le tirage au sort a le choix de\n                      servir ou de recevoir pour le premier jeu laissant à son adversaire le second choix.\n                    </p>\n\n                    <p><b>Toucher de balle:</b> Voir effet.\n                    </p>\n\n                    <p><b>Tour du défi:</b> Voir challenge round.\n                    </p>\n\n                    <p><b>Tournoi du Grand Chelem:</b> Voir grand chelem.\n                    </p>\n\n                    <p><b>Trois sets gagnants:</b> Voir meilleur des cinq sets trouver une bonne longueur de balle :\n                      voir jouer long, le but ici est de repousser le joueur de tennis le plus loin de sa ligne de fond\n                      de court.\n                    </p>\n\n                    <p><b>Tweener:</b> Coup entre les jambes parfois tapé par un joueur de tennis lorsqu&#39;il est lobé\n                      et dos au filet de tennis pour tenter de remettre la balle dans le terrain. Parfois utilisé face\n                      au filet de tennis pour distraire les spectateurs ou provoquer l&#39;adversaire.</p>\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"heading3\">\n                  <h4 class=\"panel-title\">\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse3\"\n                      aria-expanded=\"false\" aria-controls=\"collapse3\">\n                      Tout sur le tennis  commençant par la lettre V :\n                    </a>\n                  </h4>\n                </div>\n                <div id=\"collapse3\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"heading3\">\n                  <div class=\"panel-body\">\n                    <p><b>Volée:</b> Coup effectué avant le rebond de la balle de tennis. C&#39;est une frappe executée\n                      près du filet de tennis.\n                    </p>\n\n                    <p><b>Volleyeur:</b> Cela concerne un joueur de tennis frappant une volée ou une expert de la volée.\n                      Voir aussi : attaquant de fond de court.\n                    </p>\n\n                    <p><b>Volleyer: </b>Action d&#39;effectuer une volée au tennis.</p>\n                  </div>\n                </div>\n              </div>\n\n              <div class=\"panel panel-default\">\n                <div class=\"panel-heading\" role=\"tab\" id=\"heading4\">\n                  <h4 class=\"panel-title\">\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse4\"\n                      aria-expanded=\"false\" aria-controls=\"collapse4\">\n                      Lexique sur le tennis  commençant par la lettre W :\n                    </a>\n                  </h4>\n                </div>\n                <div id=\"collapse4\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"heading4\">\n                  <div class=\"panel-body\">\n                    <p><b>Walk over:</b> (Victoire par disqualification (scratch) ou, beaucoup plus fréquemment, par\n                      forfait de l&#39;adversaire. Abrégé dans les tableaux en W.O.).</p>\n\n                    <p><b>Western:</b> Voir prise western.</p>\n\n                    <p><b>Wild card:</b> Ou invitation privilégiée : Autorisation exceptionnelle permise à un sportif ou\n                      à une équipe de jouer une compétition de tennis sans répondre aux critères communs de sélection.\n                    </p>\n\n                    <p><b>WTA Tour ou simplement WTA:</b> Association qui supervise les principaux tournois de tennis\n                      féminins professionnels dans le monde. On parle aussi du circuit WTA.</p>\n                  </div>\n                </div>\n              </div>\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n\n<!-- section3 ends -->\n\n<app-footer></app-footer>\n");

