/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n  <img src=\"./assets/images/cours-particuliers-de-tennis.jpg\" alt=\"Los Angeles\" />\n  <div class=\"inner_carousel\">\n    <h3>Oh My Concept</h3>\n  </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n  <div class=\"banner_container\">\n    <h3>Réservez un cours particulier</h3>\n    <div class=\"row\">\n      <form class=\"text-left\" [formGroup]=\"coachform\" (ngSubmit)=\"onSubmitCoach()\">\n        <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n          <div class=\"form-group\">\n            <div class=\"addon-lg\">\n              <input class=\"form-control\" id=\"\" maxlength=\"6\" placeholder=\"Code Postal\" type=\"text\"\n                formControlName=\"code_postal\" />\n              <label><img src=\"./assets/images/ville_icon.png\" /></label>\n            </div>\n          </div>\n        </div>\n        <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n          <div class=\"form-group\">\n            <div class=\"addon-lg\">\n              <input type=\"text\" style=\"text-align:left!important;\" [min]=\"min\" class=\"form-control\" id=\"\"\n                placeholder=\"Date\" [owlDateTime]=\"dt1\" [owlDateTimeTrigger]=\"dt1\" formControlName=\"Date\" />\n              <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n              <label><img src=\"./assets/images/date_icon.png\" /> </label>\n            </div>\n          </div>\n        </div>\n        <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n          <button type=\"submit\" [disabled]=\"!coachform.valid\" class=\"btn black_btn\">\n            Rechercher\n          </button>\n        </div>\n      </form>\n    </div>\n  </div>\n</div>\n<!-- Inner Search area ends -->\n\n<!-- section1 starts -->\n<div class=\"section1 content_secs des_titre_list haspadd\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-12 col-sm-12 col-xs-12\">\n        <div class=\"page_title_div\">\n          <h1 class=\"page_title\">GUIDE PRATIQUE</h1>\n          <img src=\"./assets/images/title_border.png\" alt=\"title_border\" />\n        </div>\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-12 col-sm-12 col-xs-12\">\n        <h2><strong>C’est quoi un guide pratique des terrains de tennis ?</strong></h2>\n        <p>\n          Le guide pratique vous permet de trouver des terrains de tennis sur un département sélectionné. C’est un\n          véritable outils d’aide à la pratique qui permet tout à chacun de découvrir des lieux insoupçonnés. Au dela de\n          ça, il est intéressant d’avoir des informations complémentaires vous permettant d’affiner vos choix si cela\n          est possible.\n          En effet il n’existe pas deux même lieux, chacun a ses spécificités qui peuvent parfois vous pousser à vous\n          décider si vous êtes hésitants.\n        </p>\n        <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n          '/' + this._const('PATH.CONSEILS.PREMIEREPARTIE.SELF')\n        }}\">Commencez votre première partie au tennis  </a></strong></p>\n      </div>\n      <!-- <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/concept_present1.jpg\" class=\"center-block\"\n          alt=\"cours tennis / trouver un cours de tennis\" />\n      </div> -->\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <!-- <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/concept_present2.jpg\" class=\"center-block\"\n          alt=\"cours particulier tennis / prendre cours de tennis\" />\n      </div> -->\n      <div class=\"col-lg-12 col-sm-12 col-xs-12\">\n        <h2><strong>Informations complémentaires sur les courts de tennis</strong></h2>\n        <p>\n          C’est sympa de savoir si il existe un terrain à tel endroit mais chacun a ses exigences parfois sur certains\n          paramètres qui ne sont pas évidemment les mêmes pour tout le monde :\n        </p>\n        <h2><strong>Stade ou complexe pour jouer au tennis ?</strong></h2>\n        <p>S’agit il d’un stade ou d’un complexe ? En effet on a beaucoup plus de chances d’avoir froid en hiver dans un\n          stade que dans un complexe. On peut noter que certains complexes sont même chauffés (envrion 15 degrés) ce qui\n          peut être un élément différenciant quand en plein hiver il fait très froid sous les courts bullés d’un stade\n          (proche de 0 degré) mais attention cela à souvent un coût d’entretien qui se répercute sur le prix de location\n          !</p>\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h2><strong>Terrain de tennis couvert ou découvert ? </strong></h2>\n        <p>\n          Le froid c’est une chose mais si la pluie s’en mêle, le terrain peut devenir vite impraticable (glissade,\n          chute et blessures dans le pire des cas). Dans ce genre de situation il faut éviter de s’entêter à vouloir\n          absolument jouer car votre santé physique est en jeu. La plupart du temps les agent d’accueil des stades\n          déclinent toute responsablité en cas d’accident et ne vous font pas payer voire vous interdisent l’accès aux\n          terrains. Un petit coup d’œil sur un site ou un appli météo (lien méteo France) vous permettra de savoir si il\n          pleut le jour dit ou même une heure avant.\n        </p>\n        <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n          '/' + this._const('PATH.CONSEILS.FORMEPHYSIQUE.SELF')\n        }}\">Quelques conseils pour vous préparez à l’effort </a></strong></p>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/concept_present3.jpg\" class=\"center-block\"\n          alt=\"tennis libre / l tennis tennis\" />\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/jouer-au-tennis.jpg\" class=\"center-block\" alt=\"jouer au tennis/ tennis gratuit paris\" />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h2><strong>Possibilité de jouer gratuit grâce au mur de tennis ?</strong></h2>\n        <p>\n          Certains lieux possèdent un mur, le terrain par excellence pour commencer à taper dans la balle quand on est\n          débutant. La plupart du temps ils sont gratuits d’accès et vous permettent de répéter vos frappes à l’infini\n          (c’est toujours le mur qui gagne !). Le seul inconvénient de cet outils est qu’il ne retranscrit pas bien\n          l’effet de la balle puisque au contact du mur la rotation de la balle est forcément altérée. Si vous n’avez\n          pas trouvé d’adversaire ou si vous souhaitez vous défoulez , rien de mieux.\n        </p>\n        <h2><strong>Surface du terrain de tennis rapide ou lente ?</strong></h2>\n        <p>Que cela soit sur terre battue , synthétique ou béton poreux (quick) les joueurs ont leur préférences pour\n          différentes raisons : préventions des articulations (et donc des blessures) sur terre battue ou préférence de\n          filiere de jeu rapide sur courts en syhthétiques , le but est d’optimiser son rendement sur le terrain.</p>\n\n          <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n            '/' + this._const('PATH.CONSEILS.PREMIERMATCH.SELF')\n          }}\">Voici quelques conseils si vous jouer au tennis votre premier match amical </a></strong></p>\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h2>Quel est le nombre de terrains de tennis sur site ?\n        </h2>\n        <p>\n          Cela peut paraître bête mais plus il y a de terrains et plus vous avez de la chance de jouer si il y a une\n          forte demande (soir et week end par exemple). Il faut savoir qu’en période hivernale les gens se battent pour\n          jouer en structure couverte donc prêter attention aux conditions de réservations des terrains pour éviter de\n          vous faire avoir et ne pas jouer !\n        </p>\n        <h2>Terrain de tennis ou terrain multi sport ?\n        </h2>\n        <p>\n          Le terrain multisport est la hantuse de tout joueur de tennis. En effet les lignes de basketball ou handball\n          perturbent les jugements de balles , les répères sur le terrain et pour peu que vous soyez daltonien c’est la\n          totale ! Ce n’est pas forcément l’idéal pour commencer , rien de mieux qu’un terrain bien dégager pour avoir\n          une vision claire de l’espace de jeu.\n        </p>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/concept1.jpg\" class=\"center-block\" alt=\"terrain de tennis / court de tennis\" />\n      </div>\n    </div>\n  </div>\n</div>\n<!-- section1 ends -->\n<!-- section2 starts -->\n<div class=\"section2 des_titre_backtext\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-12 col-sm-12 col-xs-12\">\n        <div class=\"des_back_content\">\n          <h4>\n            Nous avons créé un univers spécialement dédié au tennis pour nos passionnés + flouter Wilson raquette\n          </h4>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n<app-footer></app-footer>");

