"use strict";
__webpack_require__.r(__webpack_exports__);
/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n  <img src=\"./assets/images/cours-particuliers-de-tennis.jpg\" alt=\"Los Angeles\" />\n  <div class=\"inner_carousel\">\n    <h3>Oh My Tennis</h3>\n  </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n  <div class=\"banner_container\">\n    <h3>Réservez un cours particulier</h3>\n    <div class=\"row\">\n      <form class=\"text-left\" [formGroup]=\"coachform\" (ngSubmit)=\"onSubmitCoach()\">\n        <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n          <div class=\"form-group\">\n            <div class=\"addon-lg\">\n              <input class=\"form-control\" id=\"\" maxlength=\"6\" placeholder=\"Code Postal\" type=\"text\"\n                formControlName=\"code_postal\" />\n              <label><img src=\"./assets/images/ville_icon.png\" /></label>\n            </div>\n          </div>\n        </div>\n        <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n          <div class=\"form-group\">\n            <div class=\"addon-lg\">\n              <input type=\"text\" style=\"text-align:left!important;\" [min]=\"min\" class=\"form-control\" id=\"\"\n                placeholder=\"Date\" [owlDateTime]=\"dt1\" [owlDateTimeTrigger]=\"dt1\" formControlName=\"Date\" />\n              <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n              <label><img src=\"./assets/images/date_icon.png\" /> </label>\n            </div>\n          </div>\n        </div>\n        <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n          <button type=\"submit\" [disabled]=\"!coachform.valid\" class=\"btn black_btn\">\n            Rechercher\n          </button>\n        </div>\n      </form>\n    </div>\n  </div>\n</div>\n<!-- Inner Search area ends -->\n\n<!-- section1 starts -->\n<div class=\"section1 content_secs des_titre_list haspadd\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-12 col-sm-12 col-xs-12\">\n        <div class=\"page_title_div\">\n          <h1 class=\"page_title\">Ohmytennis : Les classements de tennis en France</h1>\n          <img src=\"./assets/images/title_border.png\" alt=\"title_border\" />\n        </div>\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <p>\n          Le classement français permet de se situer par rapport aux autres compétiteurs et s’etablit selon une\n          hierarchie avec différents pallier de niveaux qu’on appelle les séries. Il existe 4 séries en France\n          permettant de regrouper les compétiteurs par échelon (classement) de plus faible au plus fort </p>\n        <p>\n          4ème série (classement 40,30/5,30/4,30/3,30/2,30/1)\n        </p>\n        <p>\n          3ème série (classement 30,15/5,15/4,15/3,15/2,15/1)\n        </p>\n        <p>\n          2ème série (classement 15,5/6,4/6,3/6,2/6,1/6,0,-2/6,-4/6,-15 puis numéro 100 français, 99,98,97 etc …on les\n          appelle joueurs numérotés)\n        </p>\n        <p>\n          1ère série (34 premiers joueurs français)\n        </p>\n        <p>C’est une pyramide des classements qui s’établit naturellement car plus on avance dans le niveau et moins on\n          trouve de monde , ca semble logique ! </p>\n\n        <p>NB : En France il y a environ 1 million de licenciés (personnes inscrites en club) et 447 000 personnes qui\n          sont « classées ».\n        </p>\n\n        <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n          '/' + this._const('PATH.CONSEILS.PREMIERTOURNOI.SELF')\n        }}\">Comment préparer sa première compétition de tennis </a></strong></p>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/pyramide.png\" class=\"center-block\" alt=\"classement tennis/classement de tennis\" />\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/concept_present2.jpg\" class=\"center-block\"\n          alt=\"calcul classement tennis/ tennis calcul classement \" />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h5><strong>Commençons par la 4 ème série au tennis (Classement 40,30/5,30/4,30/3,30/2,30/1) \n          </strong></h5>\n        <p>\n          C’est la série qui regroupe les gens qui débutent la compétition, 6 classements la compose mais déjà on peut\n          observer une grosse disparité de niveau entre une personne classée 40 (plus faible classement de la série) et\n          un 30/1 (classement plus fort de la série)\n        </p>\n        <p>- Classement 40 et 30/5</p>\n        <p>\n          Le premier classment 40 est d’ailleurs obtenu en participant à une compétition dans l’année. Le deuxième\n          classement 30/5 lui s’obtient avec une premiere victoire dans un tournoi officiel.\n        </p>\n        <p>-Classement 30/4,30/3</p>\n        <p>\n          Ces personnes ont l’expérience des tournois et ont déjà gagner plusieurs matchs dans une même saison (12\n          mois). Ils arrivent plus ou moins à gérer le stress, la combativité lors des compétitions. Ils sont à ce\n          classement pour deux principales raisons : de grosses lacunes les empêchent de progresser au classement (soit\n          techniques, physiques) , la deuxième est qu’ils ne jouent pas beaucoup en tournoi (ca peut paraître bête mais\n          c’est vrai !)\n        </p>\n        <p>- Classement 30/2 et 30/1</p>\n        <p>\n          A ces classements il n’est pas rare de voir des joueurs ou joueuses de tennis qui commencent à bien jouer avec\n          l’utilisation d’un coup fort qui leur ramène beaucoup de points (ca aide pour la mise en place tactique) avec\n          une certaine régularité qui se met en place.Le paramètre physique commence à rentrer comme paramètre mais\n          n’est pas forcément prépondérant, en revanche la dimension mentale commence à se faire sentir.\n        </p>\n\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h5><strong>La 3ème série au tennis(Classement 30,15/5,15/4,15/3,15/2,15/1) \n          </strong></h5>\n        <p>\n          - Classement 30,15/5\n        </p>\n        <p>\n          Le principal paramètre qui évolue lorqu’on est 3ème série c’est sans contestation le physique. La puissance ,\n          la vitesse , l’endurance sont autant de qualités qui permettent au pratiquants de se démarquer de la 4ème\n          série. Ils ont souvent un coup fort leur permettant d’asseoir leur tactique et on peut voir émerger dès ce\n          niveau de véritables combattants sur le terrain.\n        </p>\n        <p>\n          - Classement 15/4,15/3\n        </p>\n        <p>\n          Le joueur a forcément une lacune visible dans son jeu lui bloquant l’accès à un niveau supérieur. Cela peut\n          être le service, le revers ou plus rarement la régularité quand ca commence à jouer vite. Les qualités\n          physiques sur le terrain commencent à s’exprimer mais selon l’âge et notamment chez les jeunes il est possible\n          d’assiter à des déroutes mentales en match. Jusqu'à ce niveau la plupart des joueurs jouent en fond de court\n          (filière longue)\n        </p>\n        <p>\n          - Classement 15/2 , 15/1\n        </p>\n        <p>\n          C’est à ce niveau qu’il est possible de passer son diplôme d’Etat et d’envisager d’enseigner de façon\n          professionnelle le tennis à plein temps. A ce classement le joueur sait pratiquement réaliser tous les coups\n          du tennis mais manque de regularité dans certains secteurs par rapport aux joueurs de 2éme série (à partir du\n          classement 15).Ils peuvent posséder deux coups forts ce qui leur permet de développer plusieurs tactiques en\n          match. Des filières de jeu courtes commencent à se faire voir avec des joueurs qui finissent parfois les\n          points au filet.\n        </p>\n\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/concept_present3.jpg\" class=\"center-block\"\n          alt=\"fft classement tennis / classement tennis fft\" />\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/jouer-au-tennis.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h5><strong>La 2ème série au tennis (Classement 15,5/6,4/6,3/6,2/6,1/6,0,-2/6,-4/6,-15,top 100)\n          </strong></h5>\n        <p>\n          -Classement 15,5/6,4/6\n        </p>\n        <p>\n          La plupart des enseignants tennis se trouvent à ces classements. Ils possèdent une technique propre , ca peut\n          jouer très vite et même servir à 200 km/heure comme les professionnels Il est possible de voir des athlètes\n          sur le terrain , la préparation physique commence à prendre une part importante des entrainements en dehors du\n          terrain (en salle de sport par exemple). Les défaillances mentales sont largement encore possibles, les\n          tactiques sont en place selon les filières de jeu et il n’y a pas d’hésitation pour finir les points au filet.\n        </p>\n        <p>-Classement 3/6,2/6,1/6,0\n        </p>\n        <p>\n          Mentalement et physiquement plus fort que les joueurs qui sont en début de seconde série, ces joueurs sont des\n          athlètes très préparés physiquement. Il va de soi que leur technique est complètement aboutie L’hygiène de vie\n          (fumer, boire , sortir , manque de récupération) peut commencer à faire la différence à ce niveau car les\n          ressources demandées sur le terrain sont au détails près. Un joueur classé 0 c’est environ le 700 eme français\n          , autant de vous dire qu’on est pas à ce niveau par harsard !\n        </p>\n        <p>-Classement -2/6,-4/6,-15 , top 100, top 60 (joueurs numérotés)\n        </p>\n        <p>\n          On peut considérer qu’à ce niveau les joueurs sont des semi professionnels : c’est à dire qu’ils commencent à\n          toucher des chèques en tournoi officiels national (de 100 euros à 1000 euros). Ce sont des joueurs très doués,\n          accomplis techniquement souvent très forts quand ils étaient jeunes. On a parfois l’impression que cela joue\n          comme les professionnels à la télévision.On retrouve des anciens espoirs déchus qui continuent à jouer même\n          s’ils savent qu’ils ne pourront jamais embrasser une vraie carrière professionnelle.\n        </p>\n        <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n          '/' + this._const('PATH.TENNIS.PRATIQUER_TO_COMPETITIONMODEEMPLOI.SELF')\n        }}\">Mode d’emploi pour participer à votre première compétition de tennis\n      </a></strong></p>\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h5>Classement 1ère série au tennis (34 meilleurs joueurs français)</h5>\n        <p>\n          C’est l’élite du tennis français , ce sont des joueurs professionnels qui consacrent toute leur journée au\n          tennis. Ils peuvent en vivre ou en vivoter et voyager pour d’autres selon leur niveau. Leur niveau leur\n          permettent de se déplacer à l’étranger par exemple mais il faut gagner des matchs pour pouvoir se rembourser\n          des frais de déplacement (voyage, hébergement, nourriture). Certains obtiennent des bourses de la Fédération\n          Française de tennis mais ce n’est pas le cas pour tout le monde !\n        </p>\n        <p>Nota Béné :</p>\n        <p>La FFT établit trois classements intermédiaires (en janvier, en avril et en juillet) et un classement final\n          (en octobre). Votre classement peut donc évoluer au cours de l’année si vous progresser. La saison commence le\n          1er octobre pour se finir le 30 septembre de la l’année suivante. Les compétitions homologuées ne sont\n          ouvertes qu’aux joueurs titulaires de la licence FFT.</p>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/concept1.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/victoires.png\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h3>Comment fait on pour calculer son classement ?\n\n        </h3>\n        <p>\n          Pour faire évoluer son classement (la montée) il faut gagner des matchs , si vous n’en gagnez aucun il n’y\n          aura pas de mauvaise surprise ce sera la descente ! Tout joueur ou joueuse de tennis recherche durant la\n          saison ce qu’on appelle des performances (« des perfs » dans notre jargon) c’est à dire gagner au dessus de\n          notre classement actuel car c’est la qu’on gagne le plus de points. Voici le tableau sur lequel tout les\n          joueurs se reportent concernant les\n        </p>\n        <p><span>victoires :</span></p>\n        <h3>Principe général , c’est peut être la phrase la plus importante à comprendre : À l’issue du calcul\n          informatique, les compétiteurs sont classés à un échelon quand leur bilan est égal ou supérieur au nombre\n          minimum de points requis à cet échelon.\n        </h3>\n      </div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h5>Mais ca veut dire quoi le calcul du classement tennis informatique ? \n        </h5>\n        <p>- Un joueur bat des adversaires durant la saison (avant juillet), nous appelons ça le premier tour de\n          l’ordinateur qui est un calcul brut utilisé pour les classements intermédiaires (janvier, avril , juillet).\n          Dans cette situation il n’y a pas de surprise c’est un calcul , un bilan , un classement coorespondant. On\n          l’appelle aussi le classement calculé.</p>\n        <p>Un joueur bat des adversaires durant la saison, il doit attendre la fin de saison pour savoir quel sera le\n          classement final de son adversaire (valeur référence de l’adversaire pour ce calcul) : nous appelons ça le\n          deuxieme tour de l’ordinateur utilsé pour son propre classement final (en octobre). On l’appelle aussi le\n          classement harmonisé. Des surprises (mauvaises ou bonnes) peuvent arrivées en fonction du classement final de\n          votre adversaire (en octobre aussi) donc il faut suivre leur palmarès durant la saison ! (ils peuvent être\n          susceptibles de monter ou descendre de classement donc il faut faire des projections …)\n        </p>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/prof-tennis.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/victoires.png\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h5>Mais ca veut dire quoi : les compétiteurs sont classés à un échelon quand leur bilan est égal ou supérieur au nombre minimum de points requis à cet échelon ? </h5>\n        <p>\n          Prenons l’exemple d’un joueur classé 15/5 , si ce joueur souhaite monter de classement donc 15/4 , il faut\n          calculer ses points comme si il était 15/4 et il doit avoir un nombre points au minimum pour se maintenir\n          correspondant au nombre de points de normes classement 2016\n        </p>\n        <p>(cf tableau). Son bilan minimum doit être de minimum 310 points sur le tableau pour les hommes) , vous me\n          suivez ? (et c’est pas fini …)</p>\n\n        <p>Prenons un 3 exemples pour montrer une situation de montée , de maintient ou de descente :\n\n        </p>\n      </div>\n    </div>\n\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h3>Exemple avec un joueur qui monte au classement :\n        </h3>\n        <p>Un joueur classé 15/5 bat durant sa saison (résultat fin septembre avec le classement futur de leurs\n          adversaires) 3 joueurs classés 15/4 (1 échelon en plus), 2 joueurs classés 15/3 (2 échelons en plus), 1 joueur\n          classé 15/5 (échelon égal) et 1 joueur classé 30/1(2 échelons inférieurs), son total de points calculé en tant\n          que 15/5 sera donc de</p>\n        <p>3x90 (3x15/4) + 2x120 (2x15/3)+ 60 (1x15/5)+ 20 (1x30/1) = 590 points , , le joueur se maintient à son\n          classement de 290 points (il faut 300 points)</p>\n\n        <p><span>Calculons maintenant en considérant ce même joueur au classement 15/4</span> le total des points de la\n          saison :\n        </p>\n        <p>3x60 (3x15/4) + 2x90 (2x15/3)+ 30 (1x15/5)+ 15 (1x30/1) = 405 points</p>\n        <p>Le joueur a assez de points pour monter 15/4 , voyons si il peut monter encore\n        </p>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/prof-tennis.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/victoires.png\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h3>Calculons maintenant en considérant ce même joueur au classement 15/3 le total des points de la saison :\n        </h3>\n        <p>\n          3x30 (3x15/4) + 2x60 (2x15/3)+ 15 (1x15/5)+ 0 (1x30/1) = 225 points\n\n        </p>\n        <p>Le joueur n’a pas assez de points pour monter au classement car il lui faut 320 points </p>\n\n        <p>Conclusion : le joueur monte au classement 15/4 </p>\n\n\n        <h3>Exemple avec un joueur qui se maintient au classement :\n        </h3>\n        <p>Un joueur classé 15/5 bat durant sa saison (résultat fin septembre avec le classement futur de leurs\n          adversaires) 2 joueurs classés 15/3 (2 échelons en plus), 1 joueur classé 15/5 (échelon égal) et 1 joueur\n          classé 30/1(2 échelons inférieurs) , son total de points calculé en tant que 15/5 sera donc de :\n        </p>\n        <p>2x120 (2x15/3) + 60 (1x15/5)+ 20 (1x30/1) = 320 points , le joueur se maintient à son classement de 20 points\n          (il faut 300 points)\n        </p>\n        <p>Conclusion : le joueur descend au classement à 30\n        </p>\n\n      </div>\n    </div>\n\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h3>Le nombre de victoire prise en compte pour calculer son bilan\n        </h3>\n        <p>Le nombre de victoires prises en compte pour un compétiteur est fonction de son classement à l’échelon\n          calculé ; • du bilan V-E-2I-5G à cet échelon.</p>\n        <p>V = nombre de victoires (victoires par w.o. et bonus championnats compris) ;</p>\n        <p>E = nombre de défaites à échelon égal (défaites par w.o. non comprises) ;\n        </p>\n        <p>I = nombre de défaites à 1 échelon inférieur (défaites par w.o. non comprises) ;</p>\n        <p>G = nombre de défaites à 2 échelons inférieurs (défaites par w.o. non comprises). À partir du troisième,\n          chaque w.o. est considéré comme une défaite à 2 échelons inférieurs.\n        </p>\n\n        <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n          '/' + this._const('PATH.TENNIS.LICENCETENNIS.SELF')\n        }}\">La licence au tennis c’est quoi </a></strong></p>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/savoir.png\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/victoires.png\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h3>Les WO (walk over) , le joueur ne se présente pas au match</h3>\n        <p>\n          À partir du troisième, chaque w.o. est considéré comme une défaite à 2 échelons inférieurs. À partir du\n          cinquième, le classement est harmonisé à un échelon au-dessous du classement calculé\n        </p>\n        <h5>La phase de calcul au tennis</h5>\n\n        <p>Pour accéder à un échelon, il faut avoir les points du bilan minimum requis à cet échelon. (Voir tableau des\n          normes de bilan minimum requis)\n        </p>\n        <p>PRINCIPE DU CALCUL\n        </p>\n        <p>Le joueur est proposé à l’échelon le plus haut auquel il peut prétendre, c’est-à-dire à un échelon au-dessus\n          du classement d’origine de l’adver- saire le mieux classé qu’il a battu au cours de l’année s’il est en 2e ou\n          3e série, ou 2 échelons au-dessus s’il est en 4e série.\n        </p>\n        <p>À chaque passage de l’ordinateur, le joueur descendra jusqu’à ce qu’il ait le nombre de points nécessaire\n          pour être stabilisé à un échelon</p>\n      </div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h3>LES LIMITATIONS DE MONTÉE/DESCENTE S’ajoutent au principe de calcul les dispositions ci-dessous :\n        </h3>\n        <p>LA LIMITATION DE DESCENTE</p>\n        <p>La descente est limitée à un échelon pour tout licencié ou non. Elle peut être de 2 échelons pour les\n          compétiteurs ayant cinq w.o. et plus. Elle peut être même de 3 échelons si, en plus, un joueur de 2e série\n          obtient un bilan V-E-2I-5G égal ou inférieur à -100.\n        </p>\n        <p>LA LIMITATION DE MONTÉE </p>\n        <p>Un joueur ne peut monter plus haut qu’un échelon au-dessus du clas- sement d’origine (classement avant\n          calcul) de tous ceux qu’il a battus ou, si ce meilleur classement est en 4e série, de 2 échelons au-dessus.\n        </p>\n        <p>S’il n’a battu que des joueurs moins bien classés que lui, il ne pourra alors monter plus haut que d’un\n          échelon au-dessus de son propre classe- ment d’origine ou, si ce dernier est en 4e série, de 2 échelons\n          au-dessus. Les bonus aux vainqueurs de championnats ne sont pas pris en compte pour la détermination de ce\n          classement maximal.\n        </p>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/concept1.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n    </div>\n\n\n  </div>\n</div>\n<!-- section1 ends -->\n<!-- section2 starts -->\n<div class=\"section2 des_titre_backtext\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-12 col-sm-12 col-xs-12\">\n        <div class=\"des_back_content\">\n          <h4>\n            Nous avons créé un univers spécialement dédié au tennis pour nos passionnés + flouter Wilson raquette\n          </h4>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n\n<app-footer></app-footer>");

