"use strict";
__webpack_require__.r(__webpack_exports__);
/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n  <img src=\"./assets/images/cours-particuliers-de-tennis.jpg\" alt=\"Los Angeles\" />\n  <div class=\"inner_carousel\">\n    <h3>Oh My Tennis</h3>\n  </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n  <div class=\"banner_container\">\n    <h3>Réservez un cours particulier</h3>\n    <div class=\"row\">\n      <form class=\"text-left\" [formGroup]=\"coachform\" (ngSubmit)=\"onSubmitCoach()\">\n        <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n          <div class=\"form-group\">\n            <div class=\"addon-lg\">\n              <input class=\"form-control\" id=\"\" maxlength=\"6\" placeholder=\"Code Postal\" type=\"text\"\n                formControlName=\"code_postal\" />\n              <label><img src=\"./assets/images/ville_icon.png\" /></label>\n            </div>\n          </div>\n        </div>\n        <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n          <div class=\"form-group\">\n            <div class=\"addon-lg\">\n              <input type=\"text\" style=\"text-align:left!important;\" [min]=\"min\" class=\"form-control\" id=\"\"\n                placeholder=\"Date\" [owlDateTime]=\"dt1\" [owlDateTimeTrigger]=\"dt1\" formControlName=\"Date\" />\n              <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n              <label><img src=\"./assets/images/date_icon.png\" /> </label>\n            </div>\n          </div>\n        </div>\n        <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n          <button type=\"submit\" [disabled]=\"!coachform.valid\" class=\"btn black_btn\">\n            Rechercher\n          </button>\n        </div>\n      </form>\n    </div>\n  </div>\n</div>\n\n<!-- Inner Search area ends -->\n<!-- section1 starts -->\n<div class=\"section1 content_secs des_titre_list haspadd\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-12 col-sm-12 col-xs-12\">\n        <div class=\"page_title_div\">\n          <h1 class=\"page_title\">Ohmytennis : tournoi tennis officiel</h1>\n          <img src=\"./assets/images/title_border.png\" alt=\"title_border\" />\n        </div>\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <p>\n          Ce sont des tournois de tennis ouverts à tous les compétiteurs (sauf restriction de catégorie ou de classement\n          de la part des organisateurs) disposant d'une licence de la FFT (fédération française de tennis) et d'un\n          certificat médical contrairement aux tournois professionnels qui sont réservés aux joueurs inscrits dans un\n          circuit. </p>\n\n        <p>\n          Les tournois sont organisés par les clubs affiliés à la FFT sur les courts qu'ils occupent habituellement. Un\n          comité du tournoi regroupant des dirigeants, des adhérents, des enseignants du club doit réaliser les\n          démarches administratives (choix des dates, des catégories, du montant de l'engagement …), assure la promotion\n          de l’événement et recruter un juge arbitre de tournoi (JAT).\n\n        </p>\n        <p>\n          Ce dernier effectue la partie technique du tournoi. À partir des inscriptions, il doit réaliser les tableaux\n          puis convoquer les participants et s'assurer sur place du bon déroulement du tournoi (vérification de\n          l’identité, du classement, du paiement des participants, respect des règles).\n\n        </p>\n        <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n          '/' + this._const('PATH.TENNIS.PRATIQUER_TO_COMPETITIONMODEEMPLOI.SELF')\n        }}\">Comment participer à votre première compétition de tennis officielle ?</a></strong></p>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/concept_present1.jpg\" class=\"center-block\"\n          alt=\"tournoi officiel tennis/tournois de tennis officiel\" />\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/concept_present2.jpg\" class=\"center-block\"\n          alt=\"match tennis fft / matchs de tennis fft\" />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h2><strong>1. Principe d’un tournoi de tennis officiel fft \n          </strong></h2>\n        <p>\n          Un tournoi (open) est dit à progression c'est-à-dire qu'il tient compte du classement des participants et leur\n          propose de jouer une premier match à un classement plus faible ou égal puis les rencontres suivantes contre\n          des adversaires avec des classements supérieurs et ceci progressivement au fur et à mesure des tours.\n        </p>\n        <p>\n          Excepté éventuellement la première phase où des poules sont mises en place, un tournoi se déroule avec la\n          règle de l'élimination directe.\n        </p>\n\n        <p>Le principe de progression impose que tous les joueurs ne commencent pas au même tour.\n          On peut faire l'analogie avec la coupe de France de Football.\n        </p>\n        <p>Ainsi le RCS Montreuil par exemple qui joue en division d'honneur ne rencontrera pas le Paris-Saint-Germain\n          au premier tour de la coupe de France. Il rencontrera dans un premier temps un club de division inférieure.\n          S'il gagne, il jouera au tour suivant un club de division supérieure (championnat fédéral amateur de deuxième\n          division) puis en cas de victoire un club de première division de championnat fédéral amateur puis un de\n          national puis de ligue 2 puis de ligue 1. Donc si le RSC Montreuil joue le PSG en finale, il aura disputé\n          beaucoup plus de matchs. La coupe de France est donc aussi une compétition à progression.</p>\n        <p>Cette formule assure donc des matchs échelonnés et proches en niveau et satisfait donc aux compétiteurs de\n          tennis différenciés par leur classement.</p>\n        <p>Depuis quelques années, les tournois permettent aux compétiteurs les plus faibles en classement de disputer\n          avant la phase d'élimination directe des matchs en poule avec une formule de décompte des points, des jeux ou\n          des manches qui limite leur durée. Ce dispositif choisi ou non par les organisateurs du tournoi s'adresse aux\n          joueurs classés au maximum 30/3. Ils disputent donc deux ou trois matchs suivant l'importance de leur poule à\n          l'issu desquels le ou les meilleurs sont qualifiés pour la phase d’élimination directe. Afin de conserver la\n          même durée globale de matchs, les règles de décompte des points, des jeux ou des manches sont modifiées, on\n          parle de format de jeu court. On impose par exemple aux joueurs concernés de jouer avec le point décisif ou\n          des manches en quatre jeux ou un super jeu décisif comme troisième manche</p>\n\n        <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n          '/' + this._const('PATH.TENNIS.PRATIQUER_TO_LESCLASSEMENTS.SELF')\n        }}\">A lire aussi : Connaissez-vous les classements au tennis ?\n\n            </a></strong>\n        </p>\n\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h2><strong>2. Les catégories des tournois de tennis de la fft \n          </strong></h2>\n        <p>\n          On distingue la catégorie messieurs de la catégorie dames.\n\n        </p>\n        <p>\n          Il existe aussi des catégories d'âges.\n\n        </p>\n        <p>\n          Chez les jeunes, les compétitions pour les moins de 11 ans ont lieu en âge réel. On peut citer les catégories\n          11/12 ans, 13/14 ans … Les jeunes peuvent jouer dans des catégories d'âges supérieures à la leur\n          (surclassement) moyennant une autorisation pour un surclassement de plus de deux catégories. Par exemple un\n          joueur de 11 ans doit demander la permission de jouer en 15/16 ans.\n        </p>\n        <p>\n          Chez les adultes, on rencontre les catégories de + 35 ans, + 40 ans, + 45 ans … dites catégories seniors plus.\n        </p>\n        <p>Il est autorisé de jouer dans une catégorie d'âge inférieure, un joueur de plus de 40 ans peut jouer en + 35\n          ans.</p>\n        <p>Il y a aussi les mêmes catégories en double plus les catégories doubles mixtes\n        </p>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/concept_present3.jpg\" class=\"center-block\"\n          alt=\"compétition tennis fft / compétitions de tennis fft\" />\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/Deux tableaux intermédiaire.png\" class=\"center-block\" alt=\"compétition tennis fft / compétitions de tennis fft\" />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h2><strong>3. Les tableaux d'un tournoi en compétition fft de tennis</strong></h2>\n        <p>\n          Pour mieux comprendre l'organisation d'un tournoi, on a représenté ci-dessous plusieurs tableaux d'un tournoi\n          fictif appelé tournoi de printemps messieurs.\n          Il manque une dizaine de tableaux (intermédiaires) dans lesquels on trouverait les joueurs classés entre 30\n          inclus et 1/6 inclus.\n        </p>\n        <p>\n          3.1 Phase de poules\n        </p>\n        <p>Deux poules ont été nécessaires pour ce tournoi, le tableau de la poule A montre que seuls les joueurs\n          classés au maximum 30/5 sont concernés.\n          Chaque joueur concerné dispute deux matchs de poule, un format court a été choisi par les organisateurs. Les\n          deux premiers de la poule sont qualifiés pour le tour suivant d'élimination directe\n        </p>\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n\n    <div class=\"row split_marginbot \">\n\n      <div class=\"col-lg-12 col-sm-12 col-xs-12\">\n        <h3>3.2 Tableaux intermédiaires</h3>\n        <p>\n          Deux tableaux intermédiaires sont donnés.\n        </p>\n        <p>a. Tableau des 30/4 – 30/3\n        </p>\n        <p>On peut voir les deux qualifiés de la poule A (DAVID et ALEXANDER) et deviner les deux venant de la poule B\n          (IVO et NICK).\n        </p>\n        <p>À l'issue des différents tours, DAVID, IVO et PIERRE-HUGUES se qualifient pour le tableau suivant.\n        </p>\n        <p>On peut remarquer que pour arriver au même niveau que PIERRE-HUGUES, DAVID a disputé un match de plus dans ce\n          tableau et deux en poule.\n        </p>\n        <p>b. Tableau des 30/2 – 30/1\n        </p>\n        <p>On observe que IVO (q1), DAVID (q2) et PIERRE-HUGUES (q3) issus du tableau précédent sont bien qualifiés pour\n          le tableau des 30/2 – 30/1.\n        </p>\n        <p>Les quatre qualifiés de ce tableau (DAVID, PIERRE-HUGUES, JACK et GILLES) seront basculés dans le suivant qui\n          contiendra au moins des joueurs classés 30.\n        </p>\n      </div>\n    </div>\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/Tableau -2.png\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/Tableau-3.png\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h3>3.3 Tableau final </h3>\n        <p>C'est le dernier tableau, il désigne le vainqueur du tournoi</p>\n        <p>Ce tableau accueille quatre qualifiés du précédent</p>\n        <h2>4. Participation à un tournoi de tennis fft\n        </h2>\n        <p>L'inscription se fait traditionnellement par courrier mais aussi de plus en plus en ligne.</p>\n        <p>La liste des tournois est disponible sur l'espace tennis de la FFT ou dans les ligues régionales.</p>\n        <p>Il faut communiquer son nom, son prénom, son classement, son club, son numéro de licence, le montant de\n          l'engagement ainsi que ses disponibilités.\n        </p>\n\n        <p>Ces dernières sont importantes et doivent être respectées par le juge arbitre du tournoi.\n          Quand votre inscription a été prise en compte, le juge arbitre vous convoque pour le premier match au minimum\n          48 heures à l'avance, il vérifiera à cette occasion l'identité, le numéro de licence, le paiement de\n          l'engagement et la détention d'un certificat médical de non contre indication à la pratique du tennis en\n          compétition (CMNCPTC) de moins de 12 mois (6 mois pour les jeunes) délivré par un médecin.\n        </p>\n        <p>Étant donné que les matchs ne sont pas arbitrés (sauf les finales), il faut être honnête et faire confiance à\n          son adversaire. En cas de litige, le règlement de la FFT stipule que chaque joueur juge les balles dans sa\n          partie de terrain. Les adversaires peuvent s'entendre en remettant le point mais ceci n'est pas réglementaire.\n        </p>\n\n        <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n          '/' + this._const('PATH.TENNIS.PRATIQUER_TO_COMPETITIONMODEEMPLOI.SELF')\n        }}\"> A lire aussi : compétition de tennis mode d’emploi\n            </a></strong></p>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/tableau-4.png\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/Deux tableaux intermédiaire.png\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h2><strong>5. Le code fédéral de conduite pendant un tournoi de tennis fft\n        </strong></h2>\n        <p>\n          Il codifie le comportement des joueurs pendant les matchs et assure le bon déroulement des matchs, il constitue l'article 94 des règlements administratifs de la FFT.\n\n        </p>\n        <h3>Article 94 : Code fédéral de conduite A. Objet </h3>\n        <p>\n          L’application du Code fédéral de conduite est obligatoire pour toutes les compétitions. \n          Le Code a pour objet de sanctionner :           \n        </p>\n        <p>- à l’initiative de l’arbitre ou du juge-arbitre, le mauvais comportement sur le court du joueur ou, dans les compétitions par équipes, du capitaine ou de son adjoint (depuis le moment où l’intéressé pénètre sur le court jusqu’au moment où il le quitte) ; \n\n        </p>\n        <p>- à l’initiative de l’arbitre ou du juge-arbitre, le non-respect des règles concernant le jeu continu ; \n        </p>\n        <p>- à l’initiative du juge-arbitre, le retard d’un joueur ne se présentant pas sur le court à l’heure </p>\n        <p>à de sa convocation, sa non-présentation (forfait). \n        </p>\n        <p>Le juge-arbitre se substitue à l’arbitre de chaise en cas de carence de ce dernier, en matière d’application du Code fédéral de conduite. </p>\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h3>B. Application du Code pour comportement répréhensible du joueur </h3>\n        <p>Faits relevant de cette procédure : \n        </p>\n        <p>- jet de balle ; \n        </p>\n       \n        <p>jet de raquette ;</p>\n        <p>coup de raquette sur le sol, le filet, les grillages, etc. ; </p>\n        <p>tenue de propos inconvenants ;\n        </p>\n\n        <p>geste déplacé ; \n\n        </p>\n        <p> gêne volontaire de l’adversaire, par des paroles, bruits ou gestes ; \n        </p>\n        <p> non-respect délibéré de la continuité du jeu, entre deux points ou après un changement de côté, notamment pour cause de perte naturelle de condition physique, blessure ou refus de reprendre la partie sur ordre de l’arbitre ; \n        </p>\n        <p>sortie du court sans autorisation de l’arbitre ou du juge-arbitre ; </p>\n        <p>conseils ou soins non autorisés par les dispositions des règles du jeu ou des règlements sportifs ; </p>\n        <p>contestation répétée des décisions de l’arbitre ;</p>\n        <p>- toute forme de comportement antisportif, notamment lors d’une partie disputée sans arbitre.</p>\n        <!-- <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n          '/' + this._const('PATH.OH_MY_EVENT_NEW')\n        }}\"> A lire aussi : compétition de tennis mode d’emploi\n            </a></strong></p> -->\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/tableau-4.png\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/Deux tableaux intermédiaire.png\" class=\"center-block\" alt=\"titre_img1\" />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h3><strong>Sanctions : \n\n        </strong></h3>\n        <p>\n          1ère infraction : avertissement ;\n        </p>\n        >\n        <p>\n          2ème infraction : un point de pénalité ; \n        \n        </p>\n        <p>3ème infraction : trois points de pénalité ; \n\n        </p>\n        <p>4ème infraction : disqualification. </p>\n        <p>La disqualification ne peut être prononcée que par le juge-arbitre (sur requête ou non de l’arbitre). \n        </p>\n        <h3>Cas particuliers : \n        </h3>\n        <p>à de sa convocation, sa non-présentation (forfait). \n        </p>\n        <p>1. En cas de grave incorrection (injure, menace, obscénité...), l’arbitre ou le juge-arbitre peut, sans avertissement ni point de pénalité préalable, infliger directement trois points de pénalité ; le juge-arbitre peut même disqualifier le joueur fautif. \n        </p>\n\n        <p>2. Si un joueur blesse son adversaire en dehors d’une action de jeu et que ce dernier ne peut reprendre la partie, le joueur responsable de cet incident doit être immédiatement disqualifié. </p>\n\n        <p>3. Dépassement de temps non intentionnel \n          En cas de dépassement de temps (non-respect de la continuité du jeu, dépassement des 90 secondes lors d’un changement de côtés) non intentionnel, le joueur fautif reçoit un avertissement puis, à chaque infraction suivante, un point de pénalité. \n          </p>\n          <p>Cette procédure est indépendante de l’application du Code fédéral de conduite.</p>\n          <p>4. Retard \n          </p>\n          <p>Si le joueur n’est pas présent sur le court, prêt à jouer à l’heure de sa convocation, il doit être </p>\n          <p>sanctionné de la façon suivante :</p>\n          <p>- 5 minutes de retard : un jeu de pénalité au bénéfice de l’adversaire ; </p>\n          <p> 10 minutes de retard : deux jeux de pénalité au bénéfice de l’adversaire ;  </p>\n          <p>- 15 minutes de retard : forfait (le juge-arbitre prendra la décision dans l’intérêt de la compétition). </p>\n          <p>Ce code est à respecter scrupuleusement\n          </p>\n          <p>On peut remarquer que le jeu doit se dérouler dans continuité, il n'y a pas de limite de temps entre les points contrairement à la réglementation des tournois professionnels.\n\n          </p>\n          \n\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n  </div>\n</div>\n<!-- section1 ends -->\n<!-- section2 starts -->\n<div class=\"section2 des_titre_backtext\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-12 col-sm-12 col-xs-12\">\n        <div class=\"des_back_content\">\n          <h4>\n            Nous avons créé un univers spécialement dédié au tennis pour nos passionnés + flouter Wilson raquette\n          </h4>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n<app-footer></app-footer>");

