"use strict";
__webpack_require__.r(__webpack_exports__);
/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n  <img src=\"./assets/images/cours-particuliers-de-tennis.jpg\" alt=\"Los Angeles\" />\n  <div class=\"inner_carousel\">\n    <h3>Oh My Tennis</h3>\n  </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n  <div class=\"banner_container\">\n    <h3>Réservez un cours particulier</h3>\n    <div class=\"row\">\n      <form class=\"text-left\" [formGroup]=\"coachform\" (ngSubmit)=\"onSubmitCoach()\">\n        <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n          <div class=\"form-group\">\n            <div class=\"addon-lg\">\n              <input class=\"form-control\" id=\"\" maxlength=\"6\" placeholder=\"Code Postal\" type=\"text\"\n                formControlName=\"code_postal\" />\n              <label><img src=\"./assets/images/ville_icon.png\" /></label>\n            </div>\n          </div>\n        </div>\n        <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n          <div class=\"form-group\">\n            <div class=\"addon-lg\">\n              <input type=\"text\" style=\"text-align:left!important;\" [min]=\"min\" class=\"form-control\" id=\"\"\n                placeholder=\"Date\" [owlDateTime]=\"dt1\" [owlDateTimeTrigger]=\"dt1\" formControlName=\"Date\" />\n              <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n              <label><img src=\"./assets/images/date_icon.png\" /> </label>\n            </div>\n          </div>\n        </div>\n        <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n          <button type=\"submit\" [disabled]=\"!coachform.valid\" class=\"btn black_btn\">\n            Rechercher\n          </button>\n        </div>\n      </form>\n    </div>\n  </div>\n</div>\n<!-- Inner Search area ends -->\n\n<!-- section1 starts -->\n<div class=\"section1 content_secs des_titre_list haspadd\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-12 col-sm-12 col-xs-12\">\n        <div class=\"page_title_div\">\n          <h1 class=\"page_title\">Ohmytennis : la licence au tennis</h1>\n          <img src=\"./assets/images/title_border.png\" alt=\"title_border\" />\n        </div>\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-12 col-sm-12 col-xs-12\">\n\n        <h2><strong>Quelles sont les informations présentes sur la licence de tennis fft ? \n          </strong></h2>\n        <p>\n          On peut lire sur sa licence son nom , son prénom , son numéro de licence , sa catégorie , son classement (son\n          meilleur classement aussi) , son club et le numéro d’affiliation. Cela permet d’avoir un réel état de votre\n          niveau plutôt que de dire « je suis classé ». Avec la licence il est impossible de s’inviter un niveau , le\n          classement français est précis et donne tout de suite une indication sur votre valeur par rapport aux autres\n        </p>\n\n        <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n          '/' + this._const('PATH.TENNIS.PRATIQUER_TO_COMPETITIONMODEEMPLOI.SELF')\n        }}\">Comment s’inscrire à sa première compétition de tennis</a></strong></p>\n      </div>\n      <!-- <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/concept_present1.jpg\" class=\"center-block\"\n          alt=\"cours tennis / trouver un cours de tennis\" />\n      </div> -->\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/concept_present2.jpg\" class=\"center-block\"\n          alt=\"licence tennis/ tennis licence\" />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h2><strong>Les 4 licences au tennis qui existent :\n          </strong></h2>\n        <p>\n          La licence annuelle : licence C\n        </p>\n        <p>\n          Accessible à tous\n        </p>\n        <ul>\n          <li>Valable 12 mois du 1er octobre au 30 septembre de l’année suivante.\n          </li>\n          <li>Prix fixe 27 euros pour les adultes et 18 euros pour les enfants\n          </li>\n          <li> Renouvelable l’année suivante en licence C ou W (voir licence internet)\n          </li>\n          <li> Rattachée au club ayant délivré la licence.</li>\n          <li> Possibilité de jouer en compétition individuelle et en équipe\n          </li>\n          <li> Accès à la billeterie de Roland Garros\n          </li>\n          <li>Rattachée au club ayant délivré la licence.\n          </li>\n        </ul>\n        <p>Les garanties de la licence (responsabilités civileset accidents corporels)\n        </p>\n        <p>Lien téléchargeable</p>\n        <p>C’est la licence classique annuelle qui existe depuis la création de la Fédération Française de tennis en\n          1920. On compte aujourd’hui environ 1 millions de licenciés tennis en France.\n        </p>\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-12 col-sm-12 col-xs-12\">\n        <h2><strong>Récapitulatif des licences tennis sous forme de tableau :\n          </strong></h2>\n        <p>\n          La licence découverte : licence D\n        </p>\n        <p>\n          Accessible à tous les 15 ans et plus qui n’ont jamais été licenciés.\n\n        </p>\n        <ul>\n          <li>Valable 3 mois , à partir de la date d’enregistrement (elle ne peut aller au delà de la fin d’année\n            sportive) et saisissable via ADOC.</li>\n          <li>Prix fixe de 3€</li>\n          <li>Non renouvelable l’année suivante, mais transformable en licence « club » en cours d’année sportive dans\n            le club d’origine. Les 3 € seront alors déduits du prix de la licence annuelle.\n          </li>\n          <li>Rattachée au club ayant délivré la licence.</li>\n        </ul>\n\n        <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n          '/' + this._const('PATH.TENNIS.PRATIQUER_TO_LESCLASSEMENTS.SELF')\n        }}\">Découvrez les classements au tennis en France</a></strong></p>\n\n      </div>\n      <!-- <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/concept_present3.jpg\" class=\"center-block\"\n          alt=\"cours particuliers tennis / jouer avec un professeur de tennis\" />\n      </div> -->\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <!-- <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/jouer-au-tennis.jpg\" class=\"center-block\" alt=\"titre_img1\" />\n      </div> -->\n      <div class=\"col-lg-12 col-sm-12 col-xs-12\">\n        <h3><strong>La licence périscolaire : licence P\n          </strong></h3>\n        <p>\n          Accessible à tous les enfants de moins de 12 ans non licenciés participant à un cycle tennis dans le cadre des\n          activités scolaires et périscolaires déclarées à la ligue par le club.\n        </p>\n        <ul>\n          <li>Valable 3 mois à partir de la date d’enregistrement (elle ne peut aller au-delà de la fin d’année\n            sportive) et saisissable via ADOC</li>\n          <li>Prix fixe de 3€</li>\n          <li> Renouvelable l’année suivante.\n          </li>\n          <li>Transformable en licence « club » en cours d’année sportive dans le club d’origine. Les 3€ seront déduits\n            du prix de la licence annuelle.</li>\n          <li>Rattachée au club ayant délivré la licence.\n          </li>\n\n        </ul>\n        <p>Les garanties de la licence (responsabilités civileset accidents corporels)\n        </p>\n        <p>Lien téléchargeable\n        </p>\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/Récapitulatif sous forme de tableau.PNG\" class=\"center-block\"\n          alt=\"Récapitulatif sous forme de tableau\" />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/concept1.jpg\" class=\"center-block\" alt=\"licence de tennis / licence au tennis\" />\n      </div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-12 col-sm-12 col-xs-12\">\n        <h3>La licence internet : LICENCE W\n        </h3>\n        <p>\n          Accessible aux plus de 18 ans même s’ils ont déjà été licenciés en club\n        </p>\n        <ul>\n          <li>Valable 12 mois du 1er octobre au 30 septembre de l’année suivante</li>\n          <li>Prix licence annuelle + 5 euros</li>\n          <li>Renouvelable l’année suivante en licence C ou W\n          </li>\n          <li>Transformable en licence « club » en cours d’année sportive dans le club d’origine. Les 3€ seront déduits\n            du prix de la licence annuelle</li>\n          <li>Rattachée uniquement à la ligue.</li>\n          <li>Vous pouvez uniquement vous inscrire en compétition individuelle\n            Les garanties de la licence (responsabilités civiles et accidents corporels)\n            Lien téléchargeable\n          </li>\n        </ul>\n        <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n          '/' + this._const('PATH.CONSEILS.PREMIERTOURNOI.SELF')\n        }}\">Comment préparer son premier match de tennis officiel</a></strong></p>\n      </div>\n      <div class=\"col-lg-12 col-sm-12 col-xs-12\">\n        <h2>Il est toujours important d‘avoir une copie de la licence de tennis sur soi</h2>\n        <p>\n          On peut la télécharger en pdf directement sur l’espace du licencié , cela permet de l’avoir sur son téléphone\n          par exemple pour la présenter au juje arbitre du tournoi. Vous pouvez avoir également une copie imprimée dans\n          votre porte feuille si vous le souhaitez.\n        </p>\n\n      </div>\n    </div>\n\n\n  </div>\n</div>\n<!-- section1 ends -->\n<!-- section2 starts -->\n<div class=\"section2 des_titre_backtext\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-12 col-sm-12 col-xs-12\">\n        <div class=\"des_back_content\">\n          <h4>\n            Nous avons créé un univers spécialement dédié au tennis pour nos passionnés + flouter Wilson raquette\n          </h4>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n<app-footer></app-footer>");

