/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n  <img src=\"./assets/images/cours-particuliers-de-tennis.jpg\" alt=\"Los Angeles\" />\n  <div class=\"inner_carousel\">\n    <h3>Oh My Concept</h3>\n  </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n  <div class=\"banner_container\">\n    <h3>Réservez un cours particulier</h3>\n    <div class=\"row\">\n      <form class=\"text-left\" [formGroup]=\"coachform\" (ngSubmit)=\"onSubmitCoach()\">\n        <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n          <div class=\"form-group\">\n            <div class=\"addon-lg\">\n              <input class=\"form-control\" id=\"\" maxlength=\"6\" placeholder=\"Code Postal\" type=\"text\"\n                formControlName=\"code_postal\" />\n              <label><img src=\"./assets/images/ville_icon.png\" /></label>\n            </div>\n          </div>\n        </div>\n        <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n          <div class=\"form-group\">\n            <div class=\"addon-lg\">\n              <input type=\"text\" style=\"text-align:left!important;\" [min]=\"min\" class=\"form-control\" id=\"\"\n                placeholder=\"Date\" [owlDateTime]=\"dt1\" [owlDateTimeTrigger]=\"dt1\" formControlName=\"Date\" />\n              <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n              <label><img src=\"./assets/images/date_icon.png\" /> </label>\n            </div>\n          </div>\n        </div>\n        <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n          <button type=\"submit\" [disabled]=\"!coachform.valid\" class=\"btn black_btn\">\n            Rechercher\n          </button>\n        </div>\n      </form>\n    </div>\n  </div>\n</div>\n<!-- Inner Search area ends -->\n<!-- section1 starts -->\n<div class=\"section1 content_secs des_titre_list haspadd\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-12 col-sm-12 col-xs-12\">\n        <div class=\"page_title_div\">\n          <h1 class=\"page_title\">Comment trouver la bonne raquette pas chere pour mon niveau ?</h1>\n          <img src=\"./assets/images/title_border.png\" alt=\"title_border\" />\n        </div>\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <p>\n          Vous avez trois possibilités pour acheter votre matériel : Le proshop (magasin spécialisé) , la grande\n          distribution ou les sites Internet. Il y a également une autre façon qui est le marché de l’occasion. </p>\n        <h3><strong>Le proshop ou magasin spécialisé :</strong></h3>\n        <p>\n          Ma priorité en tant que pratiquant et professionnel du secteur reste le proshop car la valeur ajoutée du\n          conseil est la priorité lorsque je dois faire des choix sur ce qui est le mieux pour moi et mon jeu . Sur du\n          long terme le vendeur va me connaître et ainsi pouvoir me conseiller de façon optimisée pour que je puisse\n          progresser. Cela permet également de tisser un lien social avec le cordeur qui est le fournisseur de vos\n          exploits ! Vous avez la possibilité de vous rapprocher de votre prof de tennis qui lui connaît les points de\n          vente proches pour acheter du matériel. La plupart des enseignants travaillent avec les proshops et non avec\n          la grande distribution car ce sont des généralistes du sport et l’enseignant de tennis est un expert dans son\n          domaine. </p>\n        <p>\n          Après tout dépend également de la proximité du point de vente et des fois il est impossible de trouver ce\n          magasin spécialisé à proximité de chez soi et c’est là qu’intervient la grande distribution ou les sites\n          Internet. </p>\n          <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n            '/' + this._const('PATH.CONCEPTS.PRESENTATION.SELF')\n          }}\">Quelles sont les astuces pour tester son matériel au tennis ?</a></strong></p>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/concept_present1.jpg\" class=\"center-block\"\n          alt=\"achat balle de tennis / balle tennis pas chere\" />\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/concept_present2.jpg\" class=\"center-block\"\n          alt=\"achat raquette de tennis / raquette tennis pas chere\" />\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h3><strong>La grande distribution et les sites internet\n          </strong></h3>\n        <p>\n          On peut noter que la grande distribution ou les sites internet proposent ce type de produits mais il n’y a pas\n          la valeur ajoutée du vendeur avec qui il est possible d’entretenir une bonne relation pour avoir des conseils\n          avisés sur le long terme. La principale différence avec les magasins spécialisés reste le prix proposé par la\n          grande distribution et les sites Internet ce qui n’est pas négligeable. Cependant le conseil en prix , les\n          volumes en centrale d’achat ne sont pas les mêmes, ce qui peut expliquer des différences de prix allant\n          parfois jusqu’à même 20 %. On observe parfois des comportements très étranges où les consommateurs viennent\n          prendre des conseils en magasin spécialisé pour finalement aller acheter sur Internet. Soit vous installez une\n          relation de confiance avec le vendeur et vous achetez en magasin , soit vous avez un avis tranché sur votre\n          raquette pour des raisons qui vous sont propres (prix , couleur , marque représentée par un joueur que vous\n          adorez) et vous allez acheter directement le produit via internet ou en grande distribution.\n        </p>\n        <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n          '/' + this._const('PATH.CONSEILS.TESTER.SELF')\n        }}\">Comment bien choisir son matériel au tennis ?</a></strong></p>\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n\n    <div class=\"row split_marginbot \">\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <h3><strong>Le possibilité d’acheter d’occasion</strong></h3>\n        <p>\n          Vous avez également la possibilité d’acheter des raquettes de tennis en occasion que cela soit en magasin ou\n          via des sites Internet , notez bien que ce n’est pas le cas de tous. C’est une opportunité de pouvoir acheter\n          du matériel un peu plus haut de gamme à un prix plus abordable que s’ils étaient neuf , à vous d’être un bon\n          chineur pour acheter au bon moment !\n        </p>\n        <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n          '/' + this._const('PATH.TENNIS.PRINCIPLE.SELF')\n        }}\">Découvrez la reglementaion du matériel au tennis </a></strong></p>\n      </div>\n      <div class=\"col-lg-6 col-sm-12 col-xs-12\">\n        <img src=\"./assets/images/concept_present3.jpg\" class=\"center-block\"\n          alt=\"achat cordage tennis / cordgae tennis pas cher\" />\n      </div>\n      <div class=\"clearfix\"></div>\n    </div>\n  </div>\n</div>\n<!-- section1 ends -->\n<!-- section2 starts -->\n<div class=\"section2 des_titre_backtext\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-12 col-sm-12 col-xs-12\">\n        <div class=\"des_back_content\">\n          <h4>\n            Nous avons créé un univers spécialement dédié au tennis pour nos passionnés + flouter Wilson raquette\n          </h4>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n<app-footer></app-footer>");

