/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n<!-- Banner starts -->\n<!-- Banner starts -->\n<div class=\"innerbanner\">\n  <img src=\"./assets/images/jouer-tennis.jpg\" alt=\"Los Angeles\" />\n  <div class=\"inner_carousel\">\n    <h3>oh my Tennis</h3>\n  </div>\n</div>\n<!-- Banner ends -->\n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n  <div class=\"banner_container\">\n    <h3>Réservez un cours particulier</h3>\n    <div class=\"row\">\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input class=\"form-control\" id=\"\" maxlength=\"6\" placeholder=\"Code Postal\" [(ngModel)]=\"Ville\" type=\"text\" />\n            <label><img src=\"./assets/images/ville_icon.png\" /></label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n        <div class=\"form-group\">\n          <div class=\"addon-lg\">\n            <input type=\"text\" style=\"text-align:left!important;\" [min]=\"min\" class=\"form-control\" id=\"\"\n              placeholder=\"Date\" [(ngModel)]=\"Date\" [owlDateTime]=\"dt1\" [owlDateTimeTrigger]=\"dt1\" />\n            <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n            <label><img src=\"./assets/images/date_icon.png\" /> </label>\n          </div>\n        </div>\n      </div>\n      <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n        <button (click)=\"handleClick($event)\" class=\"btn black_btn\">\n          Rechercher\n        </button>\n      </div>\n    </div>\n  </div>\n</div>\n<!-- Inner Search area ends -->\n\n<!-- section1 starts -->\n<div class=\"regle_content\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"license\">\n        <div class=\"page_title_div col-xs-12\">\n          <h1 class=\"page_title\">Ohmytennis : Réglementation du matériel de tennis</h1>\n          <img src=\"./assets/images/title_border.png\" alt=\"title_border\" />\n        </div>\n        <div class=\"license_section\">\n          <div class=\"col-xs-12\">\n            <h2 style=\"font-size: 20px;\">\n              <strong>Quelle est la taille de la raquette de tennis ?</strong>\n            </h2>\n          </div>\n          <div class=\"col-md-8 col-sm-8 col-xs-12\">\n            <p class=\"license_txt\">\n              Un cadre de raquette de tennis est composé de trois parties : le\n              manche où on la tient, le tamis surface de frappe qui doit être\n              plat et le cœur qui relie les deux parties précédentes. Le cordage\n              (une ou plusieurs cordes qui se croisent et s'entrelacent grâce\n              aux trous dans le cadre) est attaché par des nœuds sur le tamis,\n              il doit être homogène.\n            </p>\n            <p class=\"license_txt\">\n              Le manche est généralement en bois, un grip permettant une meilleure sensation est enroulé autour. Les\n              joueurs ajoutent souvent un surgrip au-dessus du grip pour avoir une meilleure accroche avec le manche\n              notamment en cas de transpiration au niveau de la paume de la main.\n            </p>\n            <p class=\"license_txt\">\n              D'après les règlements de la FFT, la taille de la raquette de tennis le cadre de la raquette ne pourra dépasser 73,66 cm de longueur totale (manche comprise) ni 31,75 cm de largeur totale. Le tamis de la raquette de tennis quant à lui ne pourra excéder 39,37 cm de longueur totale ni 29,21 cm de largeur totale. \n            </p>\n          </div>\n          <div class=\"col-md-4 col-sm-4 col-xs-12\">\n            <img src=\"./assets/images/titre_img1.jpg\" class=\"center-block\" alt=\"diametre balle de tennis/dimension balle de tennis\" />\n          </div>\n          <div class=\"clearfix\"></div>\n          <div class=\"col-md-12 col-sm-12 col-xs-12\">\n            <p class=\"license_txt\">\n              Il est possible d'ajouter des éléments à la raquette de tennis\n              comme un ou plusieurs antivibrateurs dans le cordage aux endroits\n              où les cordes ne se croisent pas pour limiter l'effet des\n              vibrations dues aux impacts de la balle dans le cordage, des lests\n              en plomb pour modifier la masse et l'équilibre du cadre, un socle\n              en bas du manche pour une prise en main différentes.\n            </p>\n            <p class=\"license_txt\">\n              Toujours d'après les règlements de la FFT, le cadre de la\n              raquette, manche et cordage compris, doit être libre de tout\n              ajout, et ne doit être équipé d’aucun système qui permettrait, en\n              cours d’échange, de modifier la forme de la raquette ou\n              l’équilibre de son poids dans son axe longitudinal, ce qui\n              changerait son moment de torsion, ou de modifier délibérément\n              toute propriété physique de la raquette, susceptible d’affecter sa\n              performance. Enfin, aucune source d’énergie susceptible de\n              modifier les caractéristiques de jeu de la raquette ne peut être\n              intégrée ou attachée à la raquette.\n            </p>\n            <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n              '/' + this._const('PATH.TENNIS.DIMENSIONS.SELF')\n            }}\">Connaitre la longueur d’un court de tennis\n          </a></strong></p>\n          </div>\n          <div class=\"clearfix\"></div>\n\n          <div class=\"regles_section_2\">\n            <div class=\"col-md-4 col-sm-4 col-xs-12\">\n              <img src=\"./assets/images/titre_img2.jpg\" class=\"center-block\" alt=\"poids balle de tennis / poids raquette de tennis\" />\n            </div>\n\n            <div class=\"col-md-8 col-sm-8 col-xs-12\">\n              <h2 style=\"font-size: 20px;\">\n                <strong>Quel est le diamètre de la balle de tennis ?</strong>\n              </h2>\n              <p class=\"license_txt\">\n                Une balle de tennis est sphérique, elle est constituée de\n                caoutchouc, recouverte de feutre et remplie d'air plus ou moins\n                sous pression suivant le type.\n              </p>\n              <p class=\"license_txt\">\n                Ces différents paramètres (pression, qualité du feutre, masse) influent sur la longévité, la qualité du rebond de la balle et donc sur leur utilisation (joueur occasionnel ou confirmé). Par exemple, une balle dite sans pression (en réalité la pression est de 7000 Pa soit 7 % de la pression atmosphérique) a une longévité supérieure à une balle avec pression mais présente un rebond de moindre qualité. \n              </p>\n              <p class=\"license_txt\">\n                Les balles autorisées en compétition doivent être blanches ou\n                jaunes, les joueurs disposent de 3, 4 ou 6 balles suivant leur\n                niveau et le tournoi.\n              </p>\n            </div>\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n              <p class=\"license_txt\">\n                Il faut aussi noter qu'en compétition, si une balle crève en\n                cours d'échange, le point doit être remis alors que si on\n                constate qu'une balle est dégonflée après le point, il reste\n                acquis à son vainqueur.\n              </p>\n              <p class=\"license_txt\">\n                Certaines catégories de jeunes emploient des balles moins dures\n                comme pour les 8 ou 9 ans qui peuvent jouer avec des balles\n                dites souples (ou dites oranges) et les 9 ou 10 ans pouvant\n                utiliser des balles dites intermédiaires (ou appelées vertes)\n                qui sont un peu plus dures que les balles souples.\n              </p>\n              <p class=\"license_txt\">\n                <b>Les balles ordinaires doivent respecter les contraintes\n                  suivantes, les valeurs ont été arrondie :</b>\n              </p>\n\n              <ul class=\"regles_points\">\n                <li>\n                  une masse de la balle de tennis comprise entre 56 et 59,4 g.\n                </li>\n                <li>\n                  un diamètre de la balle de tennis entre 6,54 et 7,30 cm.\n                </li>\n                <li>\n                  un rebond sur une base en béton de référence entre 1,35 m et\n                  1,47 m pour une hauteur de chute de 2,54 m.\n                </li>\n              </ul>\n              \n              <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                '/' + this._const('PATH.TENNIS.ELEMENTS.SELF')\n              }}\">Découvrir les lignes du terrain de tennis\n            </a></strong></p>\n            </div>\n          </div>\n          <div class=\"clearfix\"></div>\n          <div class=\"regles_section_3 col-xs-12\">\n            <h2 style=\"font-size: 20px;\"><strong>Réglementation de la tenue de tennis</strong></h2>\n          </div>\n          <div class=\"col-md-8 col-sm-8 col-xs-12\">\n            <p class=\"license_txt\">\n              Les règles sont peu restrictives quant à la tenue de tennis\n              proprement dite ainsi les joueurs doivent porter des vêtements et\n              des chaussures. Par contre, les sigles ou logos d'équipementier\n              sont fortement réglementés, ils ne doivent figurer qu'une seule\n              fois sur les vêtements, chaussures, casquettes et ne peuvent\n              dépasser une surface de 13 cm2. Un second sigle ou logo est\n              autorisé et ne doit pas excéder 19,5 cm2 sur chaque vêtement ou\n              chaussure. Certaines compétitions internationales ajoutent des\n              règles encore plus contraignantes comme une tenue de tennis à\n              dominante blanche à Wimbledon ou des tenues à couleurs identiques\n              pour les partenaires de double en coupe Davis ou aux Jeux\n              Olympiques.\n            </p>\n            <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n              '/' + this._const('PATH.TENNIS.COMPTER.SELF')\n            }}\">Voir les règles du tennis\n          </a></strong></p>\n          </div>\n\n          <div class=\"col-md-4 col-sm-4 col-xs-12\">\n            <img src=\"./assets/images/titre_img3.jpg\"  alt=\"taille raquette de tennis / tamis tennis\"/>\n          </div>\n          <div class=\"clearfix\"></div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n\n<app-footer></app-footer>");

