/* harmony default export */ __webpack_exports__["default"] = ("<app-header></app-header>\n<app-top-menu></app-top-menu>\n  <!-- Banner starts --> \n  <div class=\"innerbanner\" style=\"background-color:#000\">\n    <img src=\"../assets/images/cours-particuliers-de-tennis.jpg\" style=\"width:100%;opacity:0.8\" alt=\"Los Angeles\">\n    <div class=\"inner_carousel\">\n        <h3>PRÉSENTATION DES PROFESSEURS DE TENNIS</h3>\n    </div>\n</div>\n<!-- Banner ends --> \n\n<!-- Inner Search area starts -->\n<div class=\"inner_searcharea\">\n    <div class=\"banner_container\">\n        <h3>Réservez un cours particulier</h3>\n        <div class=\"row\">\n            <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n                <div class=\"form-group\">\n                    <div class=\"addon-lg\">\n                        <input class=\"form-control\" id=\"\" maxlength=\"6\" placeholder=\"Code Postal\" [(ngModel)]=\"Ville\"\n                            type=\"text\" />\n                        <label><img src=\"./assets/images/ville_icon.png\" /></label>\n                    </div>\n                </div>\n            </div>\n            <div class=\"col-xs-12 col-sm-4 col-lg-4\">\n                <div class=\"form-group\">\n                    <div class=\"addon-lg\">\n                        <input type=\"text\" style=\"text-align:left!important;\" [min]=\"min\" class=\"form-control\" id=\"\"\n                            placeholder=\"Date\" [(ngModel)]=\"Date\" [owlDateTime]=\"dt1\" [owlDateTimeTrigger]=\"dt1\" />\n                        <owl-date-time #dt1 [pickerType]=\"'calendar'\"></owl-date-time>\n                        <label><img src=\"./assets/images/date_icon.png\" /> </label>\n                    </div>\n                </div>\n            </div>\n            <div class=\"col-xs-12 col-sm-4 col-lg-4 text-left\">\n                <!-- <button (click)=\"handleClick($event)\" class=\"btn black_btn\">\n                    Rechercher\n                </button> -->\n                <button  class=\"btn black_btn\">\n                    Rechercher\n                </button>\n            </div>\n        </div>\n    </div>\n</div>\n<!-- Inner Search area ends --> \n\n<!-- section1 starts -->\n<div class=\"section1 des_concept_list haspadd\">\n    <div class=\"container\">\n        \n        <div class=\"row\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">\n                <div class=\"page_title_div\">            \n                    <h1 class=\"page_title\">Ohmytennis : Présentation des professeurs de tennis</h1>\t\t\t\t\n                    <img src=\"../assets/images/title_border.png\" alt=\"title_border\" />\n                </div>\n            </div>\n            <div class=\"clearfix\"></div>\n        </div>\t\n        \n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">        \n                <div class=\"mid_contentdiv\">\n                    <h2>Les professeurs de tennis de notre plateforme</h2>\t\n                    <p>Une équipe d’experts à votre service : tous les enseignants liés a ohmytennis.com sont diplomés d’etat et sont actuellement en activité dans des clubs de tennis en Ile de France. Leur expérience est un gage de qualité leur permettant d’exercer avec professionnalisme auprès des élèves. Nos partenaires sont des professionnels avec qui nous entretenons au quotidien des relations étroites pour vous offrir les meilleurs services sur les courts.</p>\n                    <p>Notre métier consiste à vous apporter des conseils pédagogiques ainsi que des services liés au tennis pour vous faire progresser et découvrir notre milieu sous toutes ses formes.  Nous sommes en quelque sorte votre guide quelque soit votre questionnement sur votre activité.</p>\n                    <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                        '/' + this._const('PATH.DEVENIR_COACH')\n                      }}\">Découvrez notre offre de professeurs de tennis</a></strong></p>\n                </div>\n            </div>        \n            <div class=\"clearfix\"></div>\n        </div>\t\n        \n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">        \n                <div class=\"mid_contentdiv\">\n                    <h2>Prendre un cours de tennis</h2>\t\n                    <p>La plupart de nos enseignants de tennis sont disponibles en journée sur les terrains durant toute l’année plutôt en semaine car ils travaillent dans les clubs de tennis le soir et le samedi notamment. N’hésitez pas cependant à demander d’autres créneaux, certaines exceptions seront parfois envisageables. Notre plateforme web communautaire dédiée au pratiquant tennis est disponible 24h sur 24 afin de répondre à toutes vos interrogations.</p>\n                   <p>Vous avez la possibilité de prendre des cours de tennis particuliers ou collectifs aux endroits où l’enseignement est habilité. En effet certains règlement intérieurs interdisent la dispense de ce type de cours donc il est nécessaire de se renseigner avant.  Vous avez cependant le choix de jouer avec un partenaire où vous le souhaitez à condition bien sûr de trouver et réserver un terrain (c’est toujours plus facile de la sorte).</p>\n\n                    <!-- <p><strong><a class=\"content_link\" href=\"\">Préparez votre premier cours de tennis</a></strong></p> -->\n\n                    <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                        '/' + this._const('PATH.CONSEILS.PREMIERCOURS.SELF')\n                      }}\">Préparez votre premier cours de tennis</a></strong></p>\n              </div>\n            </div>        \n            <div class=\"clearfix\"></div>\n        </div>\t\n        \n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">        \n                <div class=\"mid_contentdiv\">\n                    <h2>Les services liés aux leçons individuelles et collectives de tennis</h2>\t\n                    <p>Notre équipe de professeurs de tennis vous proposera le meilleur service possible lors de son enseignement. Il vous permettra de progresser grâce au suivi personnalisé tout en prenant en compte des demandes des élèves (écoute), vous proposera les meilleurs tarifs (terrain+prof) en fonction de votre pratique (budget optimisé) et confirmera la réservation du terrain et du cours dans les 24H  (disponibilité). La ponctualité, le respect de l’élève durant l’heure de cours , la disponibilité des échanges (email, textos) entre les cours sont autant de confiance qu’il est nécessaire d’entretenir. Enfin la livraison de raquette cordée sur le terrain pour votre prochain cours et la possible prise en charge en voiture si l’accès en transport en commun est compliqué nous permettent d’avoir un service de proximité très sérieux vis à vis de nos élèves.</p>\n\n                    <!-- <p><strong><a class=\"content_link\" href=\"\">Quel matériel de tennis choisir pour jouer</a></strong></p> -->\n                    <p><strong><a class=\"content_link\" href=\"javascript:;\" routerLink=\"{{\n                        '/' + this._const('PATH.CONSEILS.CHOISIR.SELF')\n                      }}\">Quel matériel de tennis choisir pour jouer</a></strong></p>\n                </div>\n            </div>        \n            <div class=\"clearfix\"></div>\n        </div>\t\n        \n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">        \n                <div class=\"mid_contentdiv\">\n                    <h2>Progresser au tennis tout au long de l’année</h2>\t\n                    <p>Plus qu’une simple mise en relation avec les élèves qui veulent s’initier, notre plate forme web permet de baliser étape par étape l’accompagnement du nouveau pratiquant tennis. En effet le but est de vous accompagner dans le temps vers votre première compétition officielle : un tournoi de tennis pour devenir enfin classé ! Le cheminement est long et semé d’embûches mais plus belle sera la victoire au bout de cette expérience où vous apprendrez certainement sur vous même. Et peut être attraperez vous le virus de la compétition qui sait ?</p>\n         \n                </div>\n            </div>        \n            <div class=\"clearfix\"></div>\n        </div>\t\n        \n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">        \n                <div class=\"mid_contentdiv\">\n                    <h3>Cadrage/Montage vidéos sur le tennis</h3>\t\n                    <p>Nous recherchons des cadreurs et monteurs vidéos pour nous aider sur notre contenu e-learning. Si vous êtes passionné par le tennis et désireux d’avoir une première expérience grâce à nous n’hésitez pas , nous serons heureux de travailler avec vous pour développer notre offre.</p>\n                </div>\n            </div>        \n            <div class=\"clearfix\"></div>\n        </div>\t\n        \n        <div class=\"row middle_contents\">\n            <div class=\"col-md-12 col-sm-12 col-xs-12\">        \n                <div class=\"mid_contentdiv\">\n                    <h3>Modérateurs sur le forum tennis</h3>\t\n                    <p>Vous aimez animer , être actif sur les forums et aussi faire respecter la charte éditée alors cette fonction est faite pour vous.  En effet il faut être impliqué , diplomate , ouvert à la discussion pour permettre à la communauté de s’exprimer librement sur différents sujets. Vos fonctions vous permettront de déplacer des discussions , supprimer ou modifier des sujets ou des messages</p>\n     \n                </div>\n            </div>        \n            <div class=\"clearfix\"></div>\n        </div>\t   \n    </div>\n</div>   \n<app-footer></app-footer>\n\n");

